INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('> 本人所发布的一切软件仅限用于学习和研究目的，不得用于商业或非法用途，否则，一切后果请自负。版权争议与本站无关。您必须在下载后的24小时内，从您的设备中彻底删除上述内容。若您需要非免费软件或服务，请购买正版授权合法使用。若侵犯您权益，请资料联系我。\n\n主要是第一次弄这种算是破解吧,实在是害怕,我连[GreasyFork](https://greasyfork.org/)都没上传,饶了我吧呜呜\n\n提供了SVG和PNG两种图片格式下载\n\n但是存在些问题,svg就好像不是正确格式似的,在chrome中打开无错误,IDEA里打不开了\n\n通过[saveSvgAsPng](https://github.com/exupero/saveSvgAsPng)进行svg转png的下载方式\n\n通过XPATH定位dom中的logo位置\n\n是个油候脚本,要在logo的编辑页面中才能使用\n\n![image-20220708131754915](https://s2.loli.net/2022/07/08/8HcWl36Ip4PYu7s.png)\n\n也懒得美化透明那个checkbox了\n\n```javascript\n// ==UserScript==\n// @name         logosc下载logo\n// @namespace\n// @version      0.1\n// @description  一键下载\n// @author       loveliness\n// @match        https://*.logosc.cn/edit\n// @icon         http://q1.qlogo.cn/g?b=qq&nk=1695560542&s=640\n// @require      https://cdn.bootcss.com/jquery/3.3.1/jquery.min.js\n// @require      https://cdn.bootcss.com/FileSaver.js/1.3.8/FileSaver.min.js\n// @require      https://lf26-cdn-tos.bytecdntp.com/cdn/expire-1-M/save-svg-as-png/1.4.17/saveSvgAsPng.min.js\n// @grant        none\n// @license MIT\n// ==/UserScript==\n\n(function ($) {\n    \'use strict\';\n\n    //xpath定位方式\n    let xpath = function (xpathToExecute) {\n        var result = [];\n        var nodesSnapshot = document.evaluate(xpathToExecute, document, null, XPathResult.ORDERED_NODE_SNAPSHOT_TYPE, null);\n        for (var i = 0; i < nodesSnapshot.snapshotLength; i++) {\n            result.push(nodesSnapshot.snapshotItem(i));\n        }\n        return result;\n    }\n\n    let is_transp = function () {\n        if ($(\"#transparent\")[0].checked) {\n            //logo的下一层\n            let logo_rect = xpath(\"//div[@class=\'card__upper-view\'][1]/div/*[2]/*[1]\");\n            logo_rect[0].setAttribute(\"fill\", \"none\");\n        }\n    }\n\n    //去除水印\n    $(\".watermarklayer\").remove();\n    let btn = \'透明:<input type=\"checkbox\" id=\"transparent\" name=\"transparent\"/>\' +\n        \'<a id=\"xzlogoSVG\" href=\"javascript:;\" style=\"color: #ff6d23;display: inline-block;width: 96px;height: 42px;font-size: 15px;line-height: 42px;text-align: center;pointer-events: auto;background-color: #fff;border-radius: 21px;box-shadow: 0 3px 8px 0 rgb(0 0 0 / 10%);transition: all 300ms ease;\">下载SVG</a>\' +\n        \'<a id=\"xzlogoPNG\" href=\"javascript:;\" style=\"color: #a3ff23;display: inline-block;width: 96px;height: 42px;font-size: 15px;line-height: 42px;text-align: center;pointer-events: auto;background-color: #fff;border-radius: 21px;box-shadow: 0 3px 8px 0 rgb(0 0 0 / 10%);transition: all 300ms ease;\">下载PNG</a>\';\n    //移除多余元素\n    let btnGroup = $(\".display-actions\");\n    btnGroup = btnGroup[0];\n    btnGroup.removeChild(btnGroup.childNodes[2]);\n    btnGroup.removeChild(btnGroup.childNodes[1]);\n    //添加按钮\n    $(\".display-actions\").prepend(btn);\n\n    let logo = xpath(\"//div[@class=\'card__upper-view\'][1]/div/*[2]\");\n    $(\"a#xzlogoSVG\").click(function () {\n        is_transp();\n        let s = new XMLSerializer();\n        //SVGSVGElement转为字符\n        logo = s.serializeToString(logo[0]);\n        let svg = new Blob([logo], {\n            type: \"image/svg+xml;charset=utf-8\"\n        });\n        saveAs(svg, \"logo.svg\")\n    });\n\n    $(\"a#xzlogoPNG\").click(function () {\n        is_transp();\n        saveSvgAsPng(logo[0], \"logo.png\");\n    });\n})(jQuery);\n```\n\n[GitHub](https://github.com/lovelinessmoe/saveLogosc)', 'logosc下载logo');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('<h2><strong>项目管理</strong></h2><h3><strong>什么是项目</strong></h3><ul><li>项目是为了在一段时期里创建一个唯一的产品</li><li class=\"ql-indent-1\">项目要有明确的目标</li><li class=\"ql-indent-1\">项目之间的活动有相关性</li><li class=\"ql-indent-1\">限定的周期</li><li class=\"ql-indent-1\">特定性</li><li class=\"ql-indent-1\">资源成本的约束性</li><li>项目的不确定性</li><li class=\"ql-indent-2\">是伴随着项目的进行而进行的，确保满足成本，成功等。他是软件工程的一部分。</li><li class=\"ql-indent-2\">每个项目都是不同的，没有两个完全相同的项目</li><li class=\"ql-indent-2\">需求变更是必然的事情，控制需求在承受范围之内</li><li class=\"ql-indent-1\">使用新技术并不是完全成熟的，可能会导致出现问题</li><li>成本问题 </li><li>	* 沟通成本，每个人想的不同</li><li class=\"ql-indent-1\">进度和质量</li><li>开发混乱</li><li class=\"ql-indent-1\">	* 没有好的管理者，每个人做的都很乱</li><li>用户变更</li><li class=\"ql-indent-1\">	* 甲方的代理更换，对软件的要求非常不同</li></ul><h3><strong>软件项目的特殊性</strong></h3><ul><li>系统的独特性</li><li>需求变更</li><li>逻辑实体</li><li>渐近细明</li></ul><h2><strong>PMBOK与软件项目管理知识体系</strong></h2><h3><strong>项目管理知识体系指南-PMBOK</strong></h3><p>4-5年更新一个版本</p><p>具体项目可以有适合自己项目的过程</p><p><span class=\"ql-font-monospace\"><img src=\"https://s2.loli.net/2022/04/05/9F7h8iyUCAlwqBR.png\" alt=\"image-20220303113137899\"></span></p><h4><strong>5个过程组</strong></h4><ol><li>启动过程</li><li>规划过程</li><li>执行过程</li><li>监控过程</li><li>收尾过程</li></ol><h4><strong>10个知识域</strong></h4><ol><li>范围管理</li><li>进度管理</li><li>成本管理</li><li>质量管理</li><li>资源管理</li><li>沟通管理</li><li>风险管理</li><li>采购管理</li><li>干系人管理</li><li>集成管理</li></ol><p><br></p>', 'project_manage_day1');
