INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('---\n# 前言\n\n在将博客托管到[vercel](https://vercel.com/)上之后,他自带了个httpsSSL安全链接,在官网也没有找到解除Https的方法,他的SSL证书不能删除\n\n![image-20220414213255715](https://s2.loli.net/2022/04/14/K7yaXgJfw6QevZh.png)\n\n浏览器还存在Https连接不能请求Http请求的古怪要求,无奈之下只能直接将JAVA后端直接升级到了Https,这里使用的是阿里云白嫖的证书.\n\n但是我之前存在于七牛云的图片不能访问了,七牛云是http的协议才免费,升级到https需要另付费,但是他的套餐是一年100G,我这咋也到不了这流量.\n\n# Nginx代理流量\n\n百度一下[Https网站中请求Http内容](https://blog.csdn.net/huyuyang6688/article/details/106697889/)\n\n\n中有这几种方法\n\n> 1、如果在https网站中请求的http资源本身就支持https，可以在html页面加入\n>\n> ```html\n> <meta http-equiv=\"Content-Security-Policy\" content=\"upgrade-insecure-requests\">\n> ```\n>\n> 浏览器在解析请求的时候会自动把http请求转化为https请求。\n>\n> 2、如果如果在https网站中请求的http资源本身不支持https，可以把https网站换成http协议。（当我没说🙊）\n>\n> 3、如果如果在https网站中请求的http资源本身不支持https，但是请求的http资源在属于自己的服务上（非第三方服务），并且不考虑改为https协议带来的性能问题，可以把要请求的http资源协议改为https。\n>\n> 4、如果在https网站中请求的http资源本身不支持https，并且这些被请求的http资源都是静态资源（比如js、css等），可以考虑把这些资源下载下来放到现有的https服务器中，也可以寻找https协议的资源，很多免费的cdn服务都同时提供了https和http协议的静态资源。\n>\n> 5、如果在https网站中请求的http资源是动态资源（比如请求http接口），且是第三方接口（自己无法变更这个第三方接口是http协议的事实），可以用nginx代理的方式。\n\n## 使用Nginx代理也很简单\n\n我原来的七牛CDN为http://cdn.javaee.xyz/\n\n现在需要通过https://oss.javaee.xyz/这个域名转发到上边的域名里\n\n1. 申请一个SSL证书,在宝塔中配置好(你问我为什么是宝塔?问就是小白)\n\n   这里申请的是oss.javaee.xyz的SSL证书\n\n![image-20220414214452479](https://s2.loli.net/2022/04/14/WSzuYeqQkDA3MFj.png)\n\n2. 配置Nginx的文件\n\n   在server下添加\n\n   ```config\n   server\n   {\n       #代理http到https\n       location / {\n           proxy_pass http://cdn.javaee.xyz/;\n       }\n   }\n   ```\n\n   location后边的 / 代表请求域名的根路径走代理\n\n   proxy_pass表示代理到的连接\n\n   > 假设下面四种情况分别用 http://192.168.1.1/proxy/test.html 进行访问。\n   >\n   > 第一种：\n   >  location /proxy/ {\n   >  proxy_pass http://127.0.0.1/;\n   >  }\n   >  代理到URL：http://127.0.0.1/test.html\n   >\n   > \n   >\n   > 第二种（相对于第一种，最后少一个 / ）\n   >  location /proxy/ {\n   >  proxy_pass http://127.0.0.1;\n   >  }\n   >  代理到URL：http://127.0.0.1/proxy/test.html\n   >\n   > \n   >\n   > 第三种：\n   >  location /proxy/ {\n   >  proxy_pass http://127.0.0.1/aaa/;\n   >  }\n   >  代理到URL：http://127.0.0.1/aaa/test.html\n   >\n   > \n   >\n   > 第四种（相对于第三种，最后少一个 / ）\n   >  location /proxy/ {\n   >  proxy_pass http://127.0.0.1/aaa;\n   >  }\n   >  代理到URL：http://127.0.0.1/aaatest.html\n\n# 结语\n\n虽然曲线救国可以用了,但是高速的CDN流量到我这里又要走一遍服务器,简直慢死,这下策还是不能用.已经打算换又拍云了,听说https也免费\n\n', '七牛云Https');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 前言\n\n在前端升级到了https之后,七牛的服务https收费,决定换一个服务提供商.现在把vue+springboot的七牛接入写下.\n\n## SpringBoot\n\n1. 导入七牛云Maven依赖\n\n   ```xml\n   <!--七牛云储存-->\n   <dependency>\n     <groupId>com.qiniu</groupId>\n     <artifactId>qiniu-java-sdk</artifactId>\n     <version>7.9.5</version>\n   </dependency>\n   ```\n\n2. 七牛云的工具类,这里只有获取token的功能\n\n   ```java\n   import com.qiniu.util.Auth;\n   import lombok.NoArgsConstructor;\n   import org.springframework.beans.factory.annotation.Value;\n   import org.springframework.stereotype.Component;\n   \n   /**\n    * @author loveliness\n    * @description 七牛上传工具类\n    */\n   @NoArgsConstructor\n   @Component\n   public class QiniuUpload {\n   \n       @Value(\"${qi-niu.access-key}\")\n       private String accessKey;\n       @Value(\"${qi-niu.secret-key}\")\n       private String secretKey;\n       @Value(\"${qi-niu.bucket}\")\n       private String bucketName;\n   \n   \n       /**\n        * 客户端获取上传的凭证\n        *\n        * @return 七牛上传凭证\n        */\n       public String getUpToken() {\n           Auth auth = Auth.create(accessKey, secretKey);\n           return auth.uploadToken(bucketName);\n       }\n   }\n   ```\n\n3. 在配置文件中写入七牛的密钥\n\n   ```yml\n   # 配置你的七牛云\n   qi-niu:\n     access-key: \n     secret-key: \n     bucket: \n   ```\n\n4. 直接在Controller中调用\n\n   ```java\n   /**\n    * @author loveliness\n    */\n   @RestController\n   @RequestMapping(\"/qiniu\")\n   @Api(tags = \"七牛\")\n   @AllArgsConstructor\n   public class QiNiuController {\n   \n       private final QiniuUpload qiniuUpload;\n   \n       @GetMapping(\"/getQiNiuToken\")\n       public Result getQiNiuToken() {\n           return Result.ok().data(qiniuUpload.getUpToken());\n       }\n   }\n   ```\n\n获取七牛token的后台程序写好了\n\n## VUE\n\n1. npm导入依赖\n\n   ```sh\n   yarn add qiniu-js\n   //or\n   npm install qiniu-js -S\n   ```\n\n2. 这是上传的方法,请根据自己的\n\n   ```javascript\n   this.$refs.cropper.getCropBlob(async (img) => {\n                           let that = this;\n                           let observer = {\n                               next() {\n   \n                               },\n                               error(res) {\n                                   ElNotification.error({\n                                       title: \'网络错误\' + res,\n                                       message: \'服务器超时\'\n                                   })\n                               },\n                               complete(data) {\n                                   // this.status = \"success\";\n                                   ElNotification({\n                                       message: \'上传成功\',\n                                       type: \'success\'\n                                   })\n                                   //上传成功后返回父组件\n                                   that.$emit(\'upload-img-success\', data);\n                               }\n                           }\n                           uploadImg(img, observer);\n                       })\n   ```\n\n   ```javascript\n   export async function uploadImg(file, observer) {\n       let token = await getQiNiuToken();\n       token = token.data;\n       let config = {\n           useCdnDomain: true,\n       };\n       let observable = upload(file, null, token, {}, config)\n       observable.subscribe(observer) // 上传开始\n   }\n   ```\n\n   ```javascript\n   function getQiNiuToken() {\n       return request({\n           url: \'qiniu/getQiNiuToken\',\n           method: \'get\'\n       })\n   }\n   ```\n\n   \n\n', '七牛云OSS');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('还记得因为疫情你被取消了多少次旅行嘛❓\n\n因为疫情，很多人不得不搁置计划🌐\n\n即将迎来了激动人心的国庆节，紧急给大家整理了8⃣️个没有中高风险区的地方，赶紧看着攻略📖计划你的国庆出行吧别，图可看（数据截至9月9日21:00）\n\n![4cc5f7ba67cc074ac6f0da7afe651d91.jpg](https://oss.ashes.vip/Travel/tactic/2a08f439-a7b0-46d0-ba02-0f56f1ce6272.png)\n\n\n![9d83226807930bb2644d4425dea7680b.jpg](https://oss.ashes.vip/Travel/tactic/89f6acf7-1066-449a-8cdf-f528a11615b7.png)\n\n1⃣️宁夏：大漠西北，塞上江南\n\n·\n\n🚩景点推荐：沙坡头旅游景区、镇北堡西部影城、沙湖旅游景区、西夏王陵、须弥山石窟、贺兰山 黄沙古渡原生态旅游区\n\n.\n\n2⃣️浙江：天然氧吧，历史悠久古城慢生活\n\n·\n\n🚩景点推荐：莫干山风景区、乌镇、西塘、良渚古城遗址、中国大运河、西湖、西天目山、 清凉峰、慈城、天一阁、鲁迅故里、千岛湖风景区、四明山 前童古镇、东白山、 横店影视城、雁荡山风景区、西溪、南尖岩风景区、江郎山 黄茅尖、九龙山 普山等景点\n\n.\n\n3⃣️云南：有个地方叫云南，据说它可以治愈你所有的不愉快\n\n·\n\n🚩景点推荐：洱海、大理古城、腾冲、玉龙雪山、丽江古城、曼听公园、泸沽湖、梅里雪山\n\n![aabd6b8dbbf2e61ec56d59db79b55674.jpg](https://oss.ashes.vip/Travel/tactic/d37a7a2a-789f-4cf4-a909-cfc416de7045.png)\n\n\n4⃣️湖南：入湘随俗，看人间烟火气\n\n·\n\n🚩景点推荐：橘子洲、岳麋山、 杜甫江阁、张家界、凤凰古城、湖南博物馆.\n\n![d02f5f4cdc03ddd00f4bdb28763d04f8.jpg](https://oss.ashes.vip/Travel/tactic/f5b6379c-4d54-4fdb-afdf-967f68f658ea.png)\n\n5⃣️山西：低调保藏省份，看超燃山西\n\n·\n\n🚩景点推荐：山西博物馆、平遥古城、五台山 黄河壶口瀑布、绵山、 云丘山、 皇城相府\n\n![6d2ce35a622df1af73c361d0bc7838bf.jpg](https://oss.ashes.vip/Travel/tactic/e936eb58-f605-43ea-b1eb-4e0108955869.png)\n\n6⃣️安徽：一生痴绝处，无梦到徽州\n\n·\n\n🚩景点推荐：西溪南景区、西递、宏村风景区、木坑竹海、奇墅湖、塔川景区、黄山风景区、翡翠谷、九龙瀑、屯溪老街\n\n.\n\n7⃣️广西：湖光山色，岁月静好的代名词\n\n·\n\n🚩景点推荐：龙脊梯田、合那高速、德天跨国大瀑布、三墩、大石围天坑群、涠洲岛\n\n兴坪古镇、漓江\n\n![47dc4808ef217192c35a714c0309043a.jpg](https://oss.ashes.vip/Travel/tactic/9154c022-386e-4b70-9d37-f86b2dfda68f.png)\n\n8⃣️、福建：有空来趟福建吧，我的’福’份，就是遇”建”你\n\n·\n\n🚩景点推荐：鼓浪屿、太姥山、清源山、武夷山 灵通山 平潭岛、福建士楼、三坊七巷、泰宁风景区、三叠井森林公园\n\n.\n\n💃这个国庆去看看祖国的大好河山，领略无限的自然风光...\n\n\n\n![04e9d1727e023eebe55c674b2b159da2.jpg](https://oss.ashes.vip/Travel/tactic/00efeb5c-d4c5-4158-8cf7-c5c8830714cd.png)', '低风险8大热门');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('青岛天主教堂建于本世纪30年代初，也称圣弥爱尔大教堂，它是青岛地区最大的哥特式建筑，同时也是基督教建筑艺术的杰作。天主教属基督教的三大分支之一。\n\n![image.png](https://oss.ashes.vip/Travel/tactic/6db824f7-59ab-4797-8c1e-7ea2f03a8bde.png)\n基督教产生于公元一世纪中期的巴勒斯坦地区，相传为犹太的拿撒勒人耶酥所创，尔后逐渐向世界各地传播，成为拥有信徒最多的世界性宗教。\n\n公元十一世纪，基督教分裂为东西派教会，西派教会成为罗马公教，即天主教，东派教会称为东正教。\n\n到公元十六世纪，新教又从罗马公教中分裂出来，在中国称为基督教，或称耶酥教。 基督教最早传入我国是在唐代贞观七年（635），在中国称为\"景教\"，后中断自灭。元代也曾有传入，后也中断。\n\n明万历七年（1582），天主教由意大利耶酥会传教士利玛窦再度传入我国，并逐渐在国内许多地方传播。鸦片战争以后，随着殖民势力的侵入，基督教的许多派系陆续在我国传教，并迅速发展起来。青岛天主教活动始于19世纪末。\n\n1897年，德国以\\\"巨野教案\\\"为借口，出兵占领胶澳地区，天主教势力也随之而入。\n\n1898年春，德国传教士在太平路天后宫后面建起了第一处传教场所，发展教徒，开展宗教活动。\n\n1900年至1902年，德籍神父白明德在曲阜路购地修建了第一座天主教堂。1925年正式建立青岛天主教区。 \n\n天主教堂于1932年动工，1934年建成，占地2470平方米，是由德国建筑师毕娄哈主持完成的。教堂以黄色花岗岩和钢筋混凝土砌成，表面雕以简洁优美的纹案。窗户为半圆拱形，线条流畅，显得庄重而朴素。大门上方设一巨大玫瑰窗，两侧各耸立一座钟塔，塔身高56米，红瓦覆盖的锥形塔尖上各竖立一个4.5米高的巨大十字架，塔内悬有四口大钟，一但钟乐鸣奏，声传数里之外。\n\n进入教堂，是一个高达18米，可容千人的宽敞明亮的大厅，色彩斑斓的玻璃花窗透射出柔和的光线。大厅东西两侧设有走廊，后面设有两个大祭台，四个小祭台，厅的穹顶绘以圣象壁画，灯光炫目，充满浓厚的宗教气氛。 \n\n60年代后期，青岛天主教堂因受\\\"文革\\\"冲击而关闭，后经修复于1982年\\\"复活节\\\"重新开放。由于国家的宗教政策深得人心，因此天主教堂的宗教活动非常活跃。每逢星期天举行主日崇拜仪式，大厅内信徒满座，由神父主持做弥撒，信徒们在钢琴的伴奏下唱着动听的赞美诗，虔诚的向上帝祈祷。复活节和圣诞节是天主教的盛大节日，教堂每年都举行隆重的庆祝仪式和活动，节日气氛十分热烈。 ', '即墨天主教堂');
