INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('现河公园是以原现河故道改造而建成的，以游览、休闲、娱乐为主的观光公园。现河公园始建于1992年，扩建于1997年，总面积350亩。公园分为东西两区，以现河为中心设景，有游廊水榭，有庭院台阁，有梅溪竹径，有景墙影雕。其中，尤以各种水榭最具特色。凭柱阁、临渊坊，倚玉轩和静心斋等均依水面而建，造型别致，形态优美。公园西区以江南园林手法和唐代、日本建筑风格建设而成，东区融自然式园林和现代抽象式园林为一体。 园内旅游资源有水域风光类、生物景观类、古迹与建筑类、休闲求知类等，类型丰富，实体完美。郁秩湖是一处风格鲜明的水上建筑物，湖内树影婆娑，可临湖垂钓，可俯首观鱼。凭柱阁是园内的制高点，因沿袭天柱魏碑的历史而建。天柱山因魏碑而名闻遐迩，凭柱阁因天柱山而让人抚今忆古。田单火牛阵是历史上非常有名的战争范例，它就发生在平度境内的即墨故城，设计者据此用现代园林手法表现于公园建设当中。用红色的火炬树表示火，用象形的牛角表示火牛，一幅火牛阵图跃然园中。在此火牛阵北侧是青岛重点文物保护单位—彭寿莘故居。 公园在规划设计上匠心独运，意境独特，使景区具备了较高的审美价值、文化价值、园艺价值、历史价值和科普价值，赢得了游客的广泛好评。它的建设充分挖掘了平度历史文化渊源，大大丰富了平度旅游资源。', '平度现河公园');
