INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 企业一\n\n## Springboot Mybatis\n\n### MAVEN配置文件\n\nmaven的配置文件settings.xml存在于两个地方：\n\n- 安装的地方：`${M2_HOME}/conf/settings.xml`\n- 用户的目录：`${user.home}/.m2/settings.xml`\n\n#### setting.xml\n\n```xml\n<settings xmlns=\"http://maven.apache.org/SETTINGS/1.0.0\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:schemaLocation=\"http://maven.apache.org/SETTINGS/1.0.0 http://maven.apache.org/xsd/settings-1.0.0.xsd\">\n<mirrors>\n    <mirror>\n      <id>nexus-aliyun</id>\n      <mirrorOf>central</mirrorOf>\n      <name>Nexus aliyun</name>\n      <url>http://maven.aliyun.com/nexus/content/groups/public</url>\n    </mirror>\n	 </mirrors>\n    <servers>\n    	<server>\n      <id>deploymentRepo</id>\n     	 <username>repouser</username>\n      	<password>repopwd</password>\n   		</server>\n  </servers>\n</settings>\n```\n\n#### pom.xml\n\n```xml\n<project\n    xmlns=\"http://maven.apache.org/POM/4.0.0\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n    xsi:schemaLocation=\"http://maven.apache.org/POM/4.0.0 http://maven.apache.org/xsd/maven-4.0.0.xsd\">\n    \n    <groupId>com.winner.trade</groupId>\n    <artifactId>trade-core</artifactId>\n    <version>1.0.0-SNAPSHOT</version>\n    \n    <!-- 打包的机制，如pom, jar, maven-plugin, ejb, war, ear, rar, par，默认为jar -->\n    <packaging>jar</packaging>\n    \n    \n    <!-- 定义本项目的依赖关系 -->\n    <dependencies>\n        \n        <!-- 每个dependency都对应这一个jar包 -->\n        <dependency>\n            \n            <!-- 一般情况下，maven是通过groupId、artifactId、version这三个元素值（俗称坐标）来检索该构件 -->\n            <groupId>com.winner.trade</groupId>\n            <artifactId>trade-test</artifactId>\n            <version>1.0.0-SNAPSHOT</version>\n            <!-- maven认为，程序对外部的依赖会随着程序的所处阶段和应用场景而变化，所以maven中的依赖关系有作用域(scope)的限制。\n                scope包含如下的取值：compile（编译范围）、provided（已提供范围）、runtime（运行时范围）、test（测试范围）、system（系统范围） -->\n            <scope>test</scope>\n            <!-- 设置指依赖是否可选，默认为false,即子项目默认都继承:为true,则子项目必需显示的引入，与dependencyManagement里定义的依赖类似 。 -->\n            <optional>false</optional>\n            <!-- 屏蔽依赖关系。\n                比如项目中使用的libA依赖某个库的1.0版，libB依赖某个库的2.0版，现在想统一使用2.0版，就应该屏蔽掉对1.0版的依赖 -->\n            <exclusions>\n                <exclusion>\n                    <groupId>org.slf4j</groupId>\n                    <artifactId>slf4j-api</artifactId>\n                </exclusion>\n            </exclusions>\n        </dependency>\n    </dependencies>\n    \n    <!-- 为pom定义一些常量，在pom中的其它地方可以直接引用\n        使用方式 如下 ：${file.encoding} -->\n    <properties>\n        <file.encoding>UTF-8</file.encoding>\n        <java.source.version>1.5</java.source.version>\n        <java.target.version>1.5</java.target.version>\n    </properties>\n</project>\n```\n\n### Yaml properties \n\nyml最大的好处在于其拥有天然的树状结构，所以着手尝试将properties文件更改为yml文件，发现了几个要注意的地方： \n\n1. 在properties文件中是以”.”进行分割的， 在yml中是用”:”进行分割; \n2. yml的数据格式和json的格式很像，都是K-V格式，并且通过”:”进行赋值； \n3. 在yml中缩进一定不能使用TAB否则会报很奇怪的错误；缩进只能用空格！！！！\n4. 每个key的冒号后面一定都要加一个空格；\n5. 如果你的项目中存在 application.properties 文件， application.yml 文件就只是一个摆设。\n\n### Mapper映射器\n\nxml 数据库一对一对应\n\n我们需要告诉 MyBatis 到哪里去找到这些语句。在MyBatis配置文件中包含了<mappers></mappers>节点，这里就是MyBatis映射器。\n\n- 接口映射器+xml映射器 方式时，在mybatis配置文件中引入映射器 代码如下 ：\n\n```xml\n<mappers>\n <mapper class=\"org.mybatis.builder.AuthorMapper\"/>\n</mappers>\n```\n\n\n\n### Mvc设计模式 \n\n- M是指业务模型，V是指用户界面，C则是控制器\n\n- Model View Controller\n\n- 对应JavaWeb东西Model Jsp Servlet\n\n- 对应SpringBoot东西 Model 不分离就算不同的模版引擎 Controller\n\n### MAVEN 工程类型\n\n> 见上文Maven配置文件\n>\n> pom, jar, maven-plugin, ejb, war, ear, rar, par\n\n### MYBATIS 优点\n\n1. 与JDBC相比，减少了50%以上的代码量。　\n2. MyBatis是最简单的持久化框架，小巧并且简单易学。　\n3. MyBatis灵活，不会对应用程序或者数据库的现有设计强加任何影响，SQL写在XML里，从程序代码中彻底分离，降低耦合度，便于统一管理和优化，可重用。　\n4. 提供XML标签，支持编写动态SQL语句（XML中使用if, else）。　　\n5. 提供映射标签，支持对象与数据库的ORM字段关系映射（在XML中配置映射关系，也可以使用注解）。\n\n### SpringBoot和Spring具体区别\n\nSpring Boot基本上是Spring框架的扩展，它消除了设置Spring应用程序所需的复杂例行配置。\nspringBoot框架相对于springMvc框架来说，更专注于开发微服务后台接口，不开发前端视图，同时遵循默认优于配置，简化了插件配置流程，不需要配置xml，相对springmvc，大大简化了配置流程；\n\n### Mybatis-Plus缓存级别\n\n缓存有一级缓存、二级缓存。\n\n一级缓存是SqlSession级别的缓存。在操作数据库时需要构造sqlSession对象，在对象中有一个数据结构（HashMap）用于存储缓存数据。不同的sqlSession之间的缓存数据区域（HashMap）是互相不影响的。 一级缓存是默认开启的不用配置。\n\n二级缓存是mapper级别的缓存，多个SqlSession去操作同一个Mapper的sql语句，多个SqlSession可以共用二级缓存，二级缓存是跨SqlSession的。二级缓存的开启（实体类必须序列化），然后在配置文件里面配置。\n\n```yml\nmybatis-plus:\n  mapper-locations: classpath*:/mapper/*.xml\n  call-setters-on-nulls: true\n  configuration:\n    #缓存开启\n    cache-enabled: true\n```\n\n## 代码\n\n### Mybatis-Plus 测试类方法\n\n```java\n@SpringBootTest\nclass MybatisplusApplicationTests {\n    @Resource\n    private UserMapper userMapper;\n  \n		/**\n     * 查询全部\n     */\n    @Test\n    void queryAll() {\n        List<User> list = userMapper.selectList(null);\n        System.out.println(list);\n    }\n\n }\n```\n\n### SpringBoot Controller的方法\n\n访问路径 localhost/day0915/users/getall, service 自带的 getlist, 注解resbonsebody \n\n```java\n@Controller\n@RequestMapping(\"/users\")\npublic class TestController {\n\n    @Autowired\n    private UserService userService;\n\n    @ResponseBody\n    @GetMapping(\"/getAll\")\n    public List<User> getAll() {\n        List<User> list = userService.list();\n        return list;\n    }\n}\n\n```\n\n\n\n### Mapper文件UserMapper.msl User表 写出增删改查+标签+方法名字\n\n\n\nMapper\n\n```java\n/**\n * @author loveliness\n */\n@Mapper\npublic interface UserMapper extends BaseMapper<User> {\n\n    List<User> getAllUser();\n\n    int updateUserById(User user);\n\n    int insertUser(User user);\n\n    int deletUserById(int id);\n}\n```\n\nxml\n\n```xml\n<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\"\n		\"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<mapper namespace=\"xyz.javaee.demo.mapper.UserMapper\">\n	<select id=\"getAllUser\" resultType=\"xyz.javaee.demo.pojo.User\">\n		select *\n		from `user`;\n	</select>\n	<update id=\"updateUserById\" parameterType=\"xyz.javaee.demo.pojo.User\">\n		update `user`\n		set username = #{username},\n		    pwd      = #{pwd}\n		where `uid` = #{uid}\n	</update>\n	<insert id=\"insertUser\" keyColumn=\"uid\" parameterType=\"xyz.javaee.demo.pojo.User\">\n		insert into `user` (username, pwd)\n		values (#{username}, #{pwd})\n	</insert>\n	<delete id=\"deletUserById\">\n		delete\n		from `user`\n		where uid = #{id}\n	</delete>\n</mapper>\n\n```\n\n# 企业二\n\n## VUE框架\n\n### 计算属性Compute\n\n计算属性的特点\n\n1. 计算属性中任意一个实例数据发生变化。计算属性就会重新计算，视图也会更新。\n2. 每一个计算属性都包含一个getter和setter\n3. 计算属性可以依赖多个Vue实例中的数据\n\n 我们有时候会在模板中绑定表达式来做简单的数据处理，但是如果表达式太长，就会变得臃肿难以维护。\n\n比如以下代码\n\n```html\n<div>\n    {{text.split(\',\').reverse().join(\',\')}}\n</div>\n```\n\n表达式里面包含了3个操作，并不是很清晰，有时候可能会更加复杂，所以在遇到复杂的逻辑时，我们应该使用计算属性。上例可以用计算属性进行改写：\n\n  ```js\ncomputed:{\n      reverseText:funtion(){\n          return this.text.split(\',\').reverse().join(\',\');\n      	}\n      }\n  ```\n\n  所有的计算属性都以函数的形式写在 Vue 实例内的 computed 选项内，最终返回计算后的结果。\n\n【注意】虽然我们是以函数的形式书写计算属性的，但是在使用时，不能加（）\n\n### 组件Computer\n\n1. 组件是可复用的实例，一个网页中某一个部分需要在多场景中使用，可以抽成一个组件进行复用，提高代码复用性\n2. 组件化开发能大幅度的提高应用开效率、测试性、复用性，\n3. 合理划分组件，有助于提升应用性能，对数据频繁更新的内容单独创建一个组件。\n4. 开发过程中组件应该是高内聚、低耦合，组件的本质就是独立和可复用代码组织单元\n5. 遵循单项数据流的原则。\n\n### Emits为什么 干什么,声明自定义事件 \n\n- emits重要用于组件之间的通信，触发自定义事件，传递参数。\n\n- 触发自定义事件在emits节点下声明的自定义事件，可以通过this.$emit(\'自定义事件的名称\')方法进行触发\n\n- 自定义事件传参在调用this.$emit() 方法触发自定义事件时，可以通过第2 个参数为自定义事件传参\n\n```html\n<!-- 子组件 Count -->\n<template>\n  <h3>Count 子组件 --- {{ num }}</h3>\n  <button type=\"button\" class=\"btn btn-danger\" @click=\"add\">+1</button>\n</template>\n\n<script>\nexport default {\n  props: [\'num\'],\n  emits: [\'numchange\'],\n  methods: {\n    add() {\n      this.$emit(\'numchange\', this.num + 1)\n    }\n  }\n}\n</script>\n```\n\n```html\n<count :num=\"count\" @numchange=\"getNum\"></count>\n```\n\n\n\n\n\n\n### SPA单页面程序 优点 \n\n一、优点\n\n1. 良好的交互体验\n   单页应用的内容的改变不需要重新加载整个页面，获取数据也是通过Ajax异步获取，没有页面之间的切换，就不会出现“白屏现象”,也不会出现假死并有“闪烁”现象，页面显示流畅，web应用更具响应性和更令人着迷。\n\n2. 良好的前后端工作分离模式\n   后端不再负责模板渲染、输出页面工作，后端API通用化，即同一套后端程序代码，不用修改就可以用于Web界面、手机、平板等多种客户端。\n\n3. 减轻服务器压力\n   单页应用相对服务器压力小，服务器只用出数据就可以，不用管展示逻辑和页面合成，吞吐能力会提高几倍。\n\n### Create Mounted 区别 \n\n- created:在模板渲染成html前调用，即通常初始化某些属性值，然后再渲染成视图。\n- mounted:在模板渲染成html后调用，通常是初始化页面完成后，再对html的dom节点进行一些需要的操作。\n\n### Computed和 Methods区别 \n\n1. computed是响应式的，methods并非响应式。\n2. 调用方式不一样，computed定义的成员像属性一样访问，methods定义的成员必须以函数形式调用。\n3. computed是带缓存的，只有其引用的响应式属性发生改变时才会重新计算，而methods里的函数在每次调用时都要执行。\n4. computed中的成员可以只定义一个函数作为只读属性，也可以定义get/set变成可读写属性，这点是methods中的成员做不到的\n\n### Watch  监听\n\nwatch监听器会监听data中数据的变化，只要一变化，就能够执行相应的逻辑\n监听的数据名放到这里面作为函数名，这个函数里面有两个参数，一个是新值，一个是旧值\n\n```html\n<div id=\"root\">\n　　<input type=\"text\" v-model=\"cityName\"/>\n</div>\n```\n\n```js\nnew Vue({\n  el: \'#root\',\n  data: {\n    cityName: \'shanghai\'\n  },\n  watch: {\n    cityName(newName, oldName) {\n      // ...\n    }\n  } \n})\n```\n\n\n\n\n\n## 代码\n\n### Vites创建项目 配置Axios\n\n```shell\nnpm init vite-app project-name\n\ncd project-name\n\nnpm install\n\nnpm install axios -S\n```\n\nMain.js\n\n```javascript\nimport Vue from \'vue\'\nimport App from \'./App.vue\'\nimport axios from \'axios\'\n\n// 全局配置axios的请求根路径\naxios.defaults.baseURL = \'请求根路径\'\n\n// 将axios挂载到Vue上\nVue.prototype.$axios = axios\n// 今后在每个.vue组件中要发起请求,直接调用 this.$axios.xxx\n\nVue.config.productionTip = false\n\nnew Vue({\n  render: h => h(App),\n}).$mount(\'#app\')\n```\n\nrouter 权限控制 brfore\n\n```javascript\nimport {createRouter, createWebHashHistory} from \"vue-router\";\n\nconst routes = [\n    {\n        path: \'/page\', component: () => import(\'../components/page.vue\'),\n        beforeEnter: () => {\n            if (localStorage.getItem(\"token\") === null) {\n                console.log(\"未登陆\")\n                return {path: \'/\'}\n            }\n        },\n    },\n]\n\nconst router = createRouter({\n    history: createWebHashHistory(),\n    routes,\n})\n\n// 导航转成路由\nexport default router\n\n```\n\n\n\n### EventBus 不同组件的数据传递\n\n全局注册版本\n\n```shell\nnpm install --save mitt\n```\n\nMain.js\n\n```javascript\nimport { createApp } from \'vue\'\nimport mitt from \'mitt\'\nimport App from \'./App.vue\'\n\nconst app = createApp(App)\napp.config.globalProperties.$eventBus = new mitt()\n```\n\n触发\n\n```javascript\nthis.$eventBus.emit(\'my-event\', \"发送的内容\")\n```\n\n监听事件的\n\n```javascript\nthis.$eventBus.on(\'my-event\', data => {\n  console.log(data)\n})\n```\n\n非全局只需要共享同一个bus即可\n\n', '老廉之复习');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('要求写出一个下图的样式\n![页面效果图](https://tecs-prod-static.obs.cn-north-1.myhuaweicloud.com/richtext%2Fimage%2F20220413%2F32a718a62497473e8e669e7401cbad16.png)\n\n我也不是专业写前端的,随便写写就完事了\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Document</title>\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\"\n        integrity=\"sha512-SfTiTlX6kk+qitfevl/7LibUOeJWlt9rbyDn92a1DqWOw9vWG2MFoays0sgObmWazO5BQPiFucnnEAjpAB+/Sw==\"\n        crossorigin=\"anonymous\" referrerpolicy=\"no-referrer\" />\n</head>\n\n<body>\n    <div class=\"main\">\n        <div class=\"img_in\">\n            <span class=\"left icon\"><i class=\"fa fa-chevron-left fa-3x\"></i></span>\n            <span class=\"right icon\"><i class=\"fa fa-chevron-right fa-3x\"></i></span>\n            <span class=\"buttom\">\n                <i class=\"fa fa-circle fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n            </span>\n        </div>\n    </div>\n</body>\n\n\n\n<style>\n    body {\n        margin: 0;\n    }\n\n    .main {\n        margin: 0 auto;\n        width: 800px;\n        height: 400px;\n        border: 3px solid;\n    }\n\n    .img_in {\n        width: 100%;\n        height: 100%;\n        background-image: url(\'https://s2.loli.net/2022/04/03/NxQafWFpP5YkTm3.jpg\');\n        background-size: cover;\n        text-align: center;\n    }\n\n    .left {\n        float: left;\n    }\n\n    .right {\n        float: right;\n    }\n\n    .icon {\n        position: relative;\n        top: 40%;\n    }\n\n    .buttom {\n        margin: 0 auto;\n        border-radius: 10px;\n        background-color: rgb(181, 190, 200);\n        position: relative;\n        top: calc(100% - 30px);\n    }\n</style>\n\n</html>\n\n```\n\n我写的效果图\n![我的](https://s2.loli.net/2022/04/13/gik3oZ9QtE2zyu1.jpg)\n', '老廉讲H5_day1');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 使用Vue3完成网络数据的获取及渲染\n\n基于Vue3的Composition API写的一个实验\n带有删除功能但是接口没有真正的请求,实现了局部刷新\n\nV2:实现了增加和修改,但是接口都是死的,实现的局部刷新\n\nV1:![image-20220427120751137](https://s2.loli.net/2022/04/27/lUkiF6bgDJNGTAL.png)\n\nV2:![image-20220428184050542](https://s2.loli.net/2022/04/28/mglqPp3rBheKvTU.png)\n\n![image-20220428184117317](https://s2.loli.net/2022/04/28/UuCq6mBXyYDdKNf.png)\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!-- 导入样式 -->\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/element-plus/dist/index.css\" />\n    <!-- 导入 Vue 3 -->\n    <script src=\"https://unpkg.com/vue@next\"></script>\n    <!-- 导入组件库 -->\n    <script src=\"https://unpkg.com/element-plus\"></script>\n    <!-- axios -->\n    <script src=\"https://unpkg.com/axios/dist/axios.min.js\"></script>\n    <title>Document</title>\n</head>\n\n<body>\n    <div class=\"wrap\" id=\"app\">\n        <table>\n            <thead>\n                <tr>\n                    <th>id</th>\n                    <th>描述</th>\n                    <th>标题</th>\n                    <th>图片</th>\n                    <th>操作</th>\n                </tr>\n            </thead>\n            <tbody id=\"j_tb\">\n                <tr>\n                    <td><input v-model=\"blogAdd.articleId\"></td>\n                    <td><input v-model=\"blogAdd.articleShort\"></td>\n                    <td><input v-model=\"blogAdd.articleTitle\"></td>\n                    <td><input v-model=\"blogAdd.imgUrl\"></td>\n                    <td>\n                        <el-button @click=\"addIt()\">添加</el-button>\n                    </td>\n                </tr>\n                <tr v-for=\"(item,index) in data\">\n                    <td>{{item.articleId}}</td>\n                    <td>{{item.articleShort}}</td>\n                    <td>{{item.articleTitle}}</td>\n                    <td>\n                        <img height=\"160\" :src=\"item.imgUrl\" />\n                    </td>\n                    <td>\n                        <el-button @click=\"deletIt(item.articleId,index)\">删除</el-button>\n                        <br />\n                        <el-button @click=\"editItShow(index)\">修改</el-button>\n                    </td>\n                </tr>\n            </tbody>\n        </table>\n        <el-dialog v-model=\"editVisible\" title=\"修改\" width=\"30%\">\n            <input v-model=\"blogEdit.articleId\">\n            <input v-model=\"blogEdit.articleShort\">\n            <input v-model=\"blogEdit.articleTitle\">\n            <input v-model=\"blogEdit.imgUrl\">\n    \n            <template #footer>\n                <span class=\"dialog-footer\">\n                    <el-button @click=\"editVisible = false\">Cancel</el-button>\n                    <el-button type=\"primary\" @click=\"editIt()\">Confirm</el-button>\n                </span>\n            </template>\n        </el-dialog>\n    </div>\n\n</body>\n<script>\n\n    const request = axios.create({\n        baseURL: \'https://javaee.xyz/\',\n        timeout: 10000\n    })\n\n    const VueApp = {\n        setup() {\n            let current = Vue.ref(1);\n            let size = Vue.ref(5);\n\n            let data = Vue.ref([]);\n            Vue.onBeforeMount(async () => {\n                let res = await request({\n                    url: \'article/getList\',\n                    method: \'GET\',\n                    params: {\n                        current: current.value,\n                        size: size.value,\n                    }\n                })\n                data.value = res.data.data.records;\n            });\n\n            let deletIt = async (id, index) => {\n                console.log(index)\n\n                // 不可请求接口,只做测试\n                let res = await request({\n                    url: \'demo/deleteIt\',\n                    method: \'GET\',\n                    params: {\n                        id\n                    }\n                })\n                //做判断条件\n                data.value.splice(index, 1);\n            }\n\n            let blogEdit = Vue.ref([]);\n            let editVisible = Vue.ref(false);\n            let editItShow = async (index) => {\n                editVisible.value = true;\n                blogEdit.value = data.value[index];\n                blogEdit.value.index = index;\n            }\n            async function editIt(index) {\n                editVisible.value = false;\n                await addOrUpdate(blogEdit.value);\n\n                // 动态修改\n                data.value[blogEdit.value.index] = blogEdit.value;\n            }\n\n            let blogAdd = Vue.ref({});\n            async function addIt() {\n                await addOrUpdate(blogAdd.value);\n                // 动态添加\n                data.value.push(blogAdd.value);\n            }\n\n            let addOrUpdate = async (blogVO) => {\n                // 不可请求接口,只做测试\n                return await request({\n                    url: \'demo/addOrUpdate\',\n                    method: \'POST\',\n                    data: blogVO\n                })\n            }\n\n            return {\n                data, deletIt, addIt, editIt, blogAdd, blogEdit, editItShow, editVisible\n            }\n        }\n    }\n\n    const app = Vue.createApp(VueApp)\n    app.use(ElementPlus);\n    app.mount(\'#app\'); \n</script>\n\n<style>\n    * {\n        padding: 0;\n        margin: 0;\n    }\n\n    .wrap {\n        width: 100%;\n        margin: 0 auto;\n    }\n\n    table {\n        border-collapse: collapse;\n        border-spacing: 0;\n        border: 1px solid #c0c0c0;\n        width: 80%;\n        margin: 0 auto;\n    }\n\n    th,\n    td {\n        border: 1px solid #d0d0d0;\n        color: #404060;\n        padding: 10px;\n        font: 14px \"微软雅黑\";\n        text-align: center;\n    }\n\n    th {\n        background-color: #09c;\n        font: bold 16px \"微软雅黑\";\n        color: #fff;\n    }\n\n\n    tbody tr {\n        background-color: #f0f0f0;\n    }\n\n    tbody tr:hover {\n        cursor: pointer;\n        background-color: #fafafa;\n    }\n\n    tbody tr td span {\n        text-decoration: none;\n    }\n\n    tbody tr td span:hover {\n        color: red;\n    }\n</style>\n\n</html>\n```', '老廉讲VUE_day1');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 利用Vue侦听器 完成用户名已存在案例\n\n![image-20220506154503164](https://s2.loli.net/2022/05/06/zi6x83jNsGf5vBb.png)\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!-- 导入样式 -->\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/element-plus/dist/index.css\" />\n    <!-- 导入 Vue 3 -->\n    <script src=\"https://unpkg.com/vue@next\"></script>\n    <!-- 导入组件库 -->\n    <script src=\"https://unpkg.com/element-plus\"></script>\n    <!-- axios -->\n    <script src=\"https://unpkg.com/axios/dist/axios.min.js\"></script>\n    <title>Document</title>\n</head>\n\n<body>\n    <div id=\"app\">\n        <span style=\"color: red;\">{{tipMsg}}</span>\n        <el-input v-model=\"userName\" placeholder=\"请输入用户名\" />\n    </div>\n\n</body>\n<script>\n    // import { watch } from \"@vue/runtime-core\";\n\n    const request = axios.create({\n        baseURL: \'http://javaee.xyz/\',\n        timeout: 10000\n    })\n\n    const VueApp = {\n        setup() {\n            let userName = Vue.ref(\"\");\n            let tipMsg = Vue.ref(\"\");\n            Vue.watch(userName, async (newvalue, oldvalue) => {\n                // 请求后端\n                // let res = await request({\n                //     url: \'/isHaveUser\',\n                //     method: \'GET\',\n                //     params: {\n                //         userName: newvalue\n                //     }\n                // })\n                let res = {\n                    \"success\": true,\n                    \"code\": 200,\n                    \"message\": null,\n                    \"data\": true\n                };\n                if (res.data) {\n                    tipMsg.value = \"存在该用户\"\n                } else {\n                    tipMsg.value = \"\"\n                }\n                console.dir(res)\n                console.log(tipMsg.value)\n            });\n\n\n            return {\n                userName, tipMsg\n            }\n        }\n    }\n\n    const app = Vue.createApp(VueApp)\n    app.use(ElementPlus);\n    app.mount(\'#app\'); \n</script>\n\n<style>\n\n</style>\n\n</html>\n```\n\n\n\n\n\n# Vue计算属性\n\n需求:\n\n- 需求1: 求2个数的和显示到页面上\n- 需求2: 字符串翻转\n\n![image-20220506154534727](https://s2.loli.net/2022/05/06/U25hoYmC4vcqbJM.png)\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!-- 导入样式 -->\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/element-plus/dist/index.css\" />\n    <!-- 导入 Vue 3 -->\n    <script src=\"https://unpkg.com/vue@next\"></script>\n    <!-- 导入组件库 -->\n    <script src=\"https://unpkg.com/element-plus\"></script>\n    <!-- axios -->\n    <script src=\"https://unpkg.com/axios/dist/axios.min.js\"></script>\n    <title>Document</title>\n</head>\n\n<body>\n    <div id=\"app\">\n        <p>和为: {{ num }}</p>\n        <p>{{ reverseMessage }}</p>\n    </div>\n\n</body>\n<script>\n    // import { watch } from \"@vue/runtime-core\";\n\n    const request = axios.create({\n        baseURL: \'http://javaee.xyz/\',\n        timeout: 10000\n    })\n\n    const VueApp = {\n        setup() {\n            let a = Vue.ref(10);\n            let b = Vue.ref(20);\n            let message = Vue.ref(\"我是个字符串\");\n            let num = Vue.computed({\n                get: () => {\n                    //浏览器得到值时触发,不能拿到值\n                    return a.value + b.value;\n                },\n                set: (res) => {\n                    //设置值时触发\n                    console.log(res)\n                }\n            });\n            let reverseMessage = Vue.computed({\n                get: () => {\n                    //浏览器得到值时触发,不能拿到值\n                    return message.value.split(\"\").reverse().join(\"\");\n                },\n                set: (res) => {\n                    //设置值时触发\n                    console.log(res)\n                }\n            });\n\n\n            return {\n                num, reverseMessage\n            }\n        }\n    }\n\n    const app = Vue.createApp(VueApp)\n    app.use(ElementPlus);\n    app.mount(\'#app\'); \n</script>\n\n<style>\n\n</style>\n\n</html>\n```\n\n', '老廉讲VUE_day2');
