INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('\n<meting-js\n    server=\"netease\"\n    type=\"song\"\n    id=\"490595922\">\n</meting-js>\n# 购物车样例\n\n使用的依赖\n\n```json\n\"axios\": \"^0.27.2\",\n\"element-plus\": \"^2.2.2\",\n\"vuex\": \"^4.0.2\"\n```\n\n本来是购物车,但是懒得写后台接口了,直接使用的博客的列表,浏览人数作为了价钱\n\n使用的技术如上依赖所示\n\n使用element大致,计数器,多选框等,正常开发不能这样封装,图省事了哈哈哈\n\n![image-20220526201738657](https://s2.loli.net/2022/05/26/8H3rYFR7uhkKoXC.png)\n\n存在文字过长重叠的bug,它提供的pdf的锅,咱也不回调样式\n\n![image-20220526201823357](https://s2.loli.net/2022/05/26/HYBARZIL2TpD6NM.png)\n\n价钱都是使用计算属性做的\n\n```js\nlet sum = computed({\n        get: () => {\n            let sum = ref(0.0);\n            store.state.checkedList.forEach(e => {\n                sum.value += e.num * e.viewsCount;\n            })\n            return sum;\n        }\n    });\n```\n\n图省事直接用了vuex作为组建见参数传递,不然要烦死\n\n```js\nimport {createStore} from \'vuex\'\n\nconst state = {\n    cartList: [],\n    checkedList: [],\n    selectAll: false,\n    isIndeterminate: false\n}\nconst store = createStore({\n    state,\n})\nexport default store\n```\n\n使用的时候直接\n\n```js\nconst store = useStore(); // 使用useStore方法\n```\n\n得到的store直接操作就行了,~~正常是通过函数set和get的,我是懒蛋呜呜呜~~\n\n[GitHub地址](https://github.com/lovelinessmoe/vue_cart)\n[~~点我下载压缩包~~]()\n\n压缩包不传了呜呜,GitHub又不是不能下,点个Star吧\n', '老廉讲VUE_day5');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# Vue 3 京东商城首页案例\n\n仿照京东商城使用vue\n\n写的非常垃圾,懒得写了\n\n![image-20220531163408879](https://s2.loli.net/2022/05/31/kmTrIWcd4wvfNU5.png)\n\n[GitHub](https://github.com/lovelinessmoe/jd-home)\n\n来个Star,秋梨膏', '老廉讲VUE_day6');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# VUE_ROUTER 简单应用\n\n这次还是使用了大家熟知的\"element-plus\": \"^2.2.4\"\n\n除此之外添加了\"vue-router\": \"^4.0.15\"\n\n直接使用了element的menu的router模式,省了不少麻烦\n\n- page1用来删除和添加token\n\n  ![image-20220607174047269](https://s2.loli.net/2022/06/07/tcOjr63YIHxbMSk.png)\n\n- page2用来不需要token访问\n\n  ![image-20220607174122998](https://s2.loli.net/2022/06/07/9eAtdphjMU5QVDk.png)\n\n- page3是需要token才可以进入的页面\n\n  ![image-20220607174152405](https://s2.loli.net/2022/06/07/TqEcDuIAg1mty63.png)\n\n  如果token为null那么进入第三页面就会提示用户未登陆\n\n  ​	![image-20220607174240960](https://s2.loli.net/2022/06/07/vWPN7zOfohgrTe9.png)\n\nrouter/index.js\n\n```js\nimport {createRouter, createWebHashHistory} from \"vue-router\";\nimport {ElNotification} from \'element-plus\'\n\nconst routes = [\n    {path: \'/\', redirect: \'/page1\'},\n    {path: \'/page1\', component: () => import(\'../components/page1.vue\'),},\n    {path: \'/page2\', component: () => import(\'../components/page2.vue\'),},\n    {\n        path: \'/page3\', component: () => import(\'../components/page3.vue\'),\n        beforeEnter: () => {\n            if (localStorage.getItem(\"token\") === null) {\n                ElNotification({\n                    message: \'用户未登陆\',\n                    type: \'error\'\n                })\n                return {path: \'/\'}\n            }\n        },\n    },\n]\n\nconst router = createRouter({\n    history: createWebHashHistory(),\n    routes,\n})\n\n// 导航转成路由\nexport default router\n\n```\n\nApp.vue\n\n```vue\n<script setup>\n    // This starter template is using Vue 3 <script setup> SFCs\n    // Check out https://vuejs.org/api/sfc-script-setup.html#script-setup</script>\n\n<template>\n    <el-menu\n            style=\"float: left;\"\n            router\n            default-active=\"1\"\n            class=\"el-menu-vertical-demo\"\n    >\n        <el-menu-item index=\"1\" route=\"/page1\">\n            <el-icon>\n                <icon-menu/>\n            </el-icon>\n            <span>跳转1</span>\n        </el-menu-item>\n        <el-menu-item index=\"2\" route=\"/page2\">\n            <el-icon>\n                <document/>\n            </el-icon>\n            <span>跳转2</span>\n        </el-menu-item>\n        <el-menu-item index=\"3\" route=\"/page3\">\n            <el-icon>\n                <setting/>\n            </el-icon>\n            <span>跳转3</span>\n        </el-menu-item>\n    </el-menu>\n    <router-view style=\"float: right;\"/>\n</template>\n\n<style>\n    #app {\n        height: 100%;\n    }\n</style>\n```\n\nMain.js\n\n```js\nimport {createApp} from \'vue\'\nimport App from \'./App.vue\'\nimport ElementPlus from \'element-plus\'\nimport \'element-plus/dist/index.css\'\nimport * as ElIconModules from \'@element-plus/icons-vue\'\nimport router from \'./router\'\n\nlet app = createApp(App)\n\napp.use(router)\napp.use(ElementPlus)\n// 统一注册el-icon图标\nfor (let iconName in ElIconModules) {\n    app.component(iconName, ElIconModules[iconName])\n}\napp.mount(\'#app\')\n\n```\n\nPage1.vue\n\n```vue\n<template>\n    <h1>page1</h1>\n    <el-button @click=\"generateToken()\" plain size=\"mini\" type=\"danger\">生成token</el-button>\n    <el-button @click=\"removeToken()\" plain size=\"mini\" type=\"danger\">删除token</el-button>\n</template>\n\n<script>\n    export default {\n        name: \"page1\",\n    }\n</script>\n\n<script setup>\n    let generateToken = function () {\n        console.log(\"jsakdhfgsakdjh\")\n        localStorage.setItem(\'token\', \'haha\');\n    }\n    let removeToken = function () {\n        localStorage.removeItem(\'token\');\n    }\n\n</script>\n\n<style scoped>\n\n</style>\n\n```\n\n这个真没必要开源了,ok', '老廉讲VUE_day7');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('艾山风景区距离城区约20公里，是胶州市仅有的集山、水、平原于一体的自然风景群，也是富有历史文化内涵的综合型风景区。该景区坐落在胶州市洋河镇、张应镇、董城乡交汇处，由艾山、东石、西石、山洲水库四个景区组成，总面积达8.6平方公里。由于艾山风景区是道教的传教地，自古以来庙宇、神像众多，香火兴盛。艾山景区是整个风景区的重点，由南北两峰组成，南峰为主峰，海拔２２９.２米，北峰海拔２２４米，景点有圣母庙。东石海拔１３７米，突兀高耸犹如石狮雄居，东石脚下的玉皇庙在当地群众中有较高的知名度；西石海拔１４０米左右，登上西石，群山臣服，能使人体会到“山到绝顶我为峰”的感觉，景点有百子殿等。艾山风景区内的东石、西石被誉为胶州八景之一——“石耳争奇”，相传二郎神因犯天愆，遭贬被罚，玉帝令其担山填平东海，行走间被山石绊一踉跄，两筐中各洒落一石块，化为东西两石，这就是“石耳争奇”的来历。', '胶州艾山风景区');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('高凤翰纪念馆是为纪念胶州历史名人——高凤翰而建的，位于胶州市南涅河西北，占地０.９３公顷，分为故居和附属设施两部分，被青岛市评为“爱国主义教育基地”。高凤翰是我国１７世纪末１８世纪初的扬州派左笔书画家及篆刻家、诗人，他的一生在仕途上是坎坷不平，但他对艺术的追求却永无止境，在右手病痹后，又用左手坚持练字。此外，在绘画、制砚、篆刻方面都有很深的造诣。故居分为石鳌馆、北堂、春草堂、西亭和南斋五大部分。馆内环境幽雅，游人步入其中，会对一代艺术大师肃然起敬。', '胶州高凤翰纪念馆');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('根据如图所示程序流程图，分别用最少的测试用例完成基本路径覆盖、条件/判定覆盖的测试设计\n\n![image-20220330163059592](https://s2.loli.net/2022/04/08/VlzjOhAK2Ytgdo6.png)\n\n\n## 存在的组合示例\n\n| 组合编号 | 1(x > 0)<br/>3(x < -10) | 2(y > 10)<br/>4(y < 0) | 判定条件取值 | 判定/条件组合         |\n| -------- | ----------------------- | ---------------------- | ------------ | --------------------- |\n| 1        | T1                      | T2                     | M=T          | x > 0,y > 10,M取真    |\n| 2        | T1                      | F2                     | M=F          | x > 0,y <= 10,M取假   |\n| 3        | F1                      | T2                     | M=F          | x <= 0,y > 10,M取假   |\n| 4        | F1                      | F2                     | M=F          | x <= 0,y <= 10,M取假  |\n| 5        | T3                      | T4                     | N=T          | x < -10,y < 0,N取真   |\n| 6        | T3                      | F4                     | N=T          | x < -10,y >= 0,N取真  |\n| 7        | F3                      | T4                     | N=T          | x >= -10,y < 0,N取真  |\n| 8        | F3                      | F4                     | N=F          | x >= -10,y >= 0,N取假 |\n\n\n\n\n## 条件/判定覆盖\n\n让所有的判定结果至少出现一次,即覆盖组合存在1-8所有\n\n```javascript\nif(x > 0 && y > 10){//M\n  y=y/x;//1\n}//2\nif(x < -10 || y < 0){//N\n  y=-(y + x)//3\n}//4\n```\n\n\n### 测试用例\n\n| 测试用例                             | 覆盖条件    | 覆盖路径 | 覆盖组合 |\n| ------------------------------------ | ----------- | -------- | -------- |\n| 输入:x=1,y=11<br/>输出:x=1,y=11      | T1,T2,F3,F4 | 1-4      | 1,8      |\n| 输入:x=1,y=-1<br/>输出:x=1,y=0       | T1,F2,F3,T4 | 2-3      | 2,7      |\n| 输入:x=-11,y=11<br/>输出:x=-11,y=0   | F1,T2,T3,F4 | 2-3      | 3,6      |\n| 输入:x=-11,y=-11<br/>输出:x=-11,y=22 | F1,F2,T3,T4 | 2-3      | 4,5      |\n\n## 基本路径覆盖\n\n覆盖所有可能的路径,即1,3|1,4|2,3|2,4\n\n```javascript\nif(x > 0 && y > 10){//M\n  y=y/x;//1\n}//2\nif(x < -10 || y < 0){//N\n  y=-(y + x)//3\n}//4\n```\n\n### 基本路径\n\n1. 画流程图\n\n![329.drawio](https://s2.loli.net/2022/04/08/d58vCzXGHnrLWqJ.png)\n\n2. 计算程序环路复杂度\n\n   1. V(G)=区域数目=2\n   2. V(G)=边界数目-节点数目+2=4-4+2=2\n   3. V(G)=判断节点数目+1=1+1=2(出度>=2)\n\n3. 确定基本路径\n\n   	- 1-4\n   	- 2-3\n\n### 测试用例\n\n| 测试用例                        | 覆盖条件    | 覆盖路径 | 覆盖组合 |\n| ------------------------------- | ----------- | -------- | -------- |\n| 输入:x=1,y=11<br/>输出:x=1,y=11 | T1,T2,F3,F4 | 1-4      | 1,8      |\n| 输入:x=1,y=-1<br/>输出:x=1,y=0  | T1,F2,F3,T4 | 2-3      | 2,7      |\n\n\n\n## 下边是用于计算输出和路径统计的代码\n\n\n```javascript\nlet x = -11;\nlet y = -11;\n//////////////////////////\nif (x > 0) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\nif (y > 10) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\n//////////////////////////\nif (x > 0 && y > 10) {\n    y = y / x;\n    console.log(\"1\");\n}else{\n    console.log(\"2\");\n}\n//////////////////////////\nif (x < -10) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\nif (y < 0) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\n//////////////////////////\nif (x < -10 || y < 0) {\n    y = -(y + x);\n    console.log(\"3\");\n}else{\n    console.log(\"4\");\n}\n//////////////////////////\nconsole.log(\"x\", x);\nconsole.log(\"y\", y);\n```\n\n\n\n', '软件测试作业0329');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 第一章 引论\n- 采用先进的开发方式和较完善的开发流程，可以减少错误的引入，但不可能完全杜绝软件中的错误。\n- 软件测试伴随着软件开发，以检验每一个阶段性的成果是否符合质量要求和达到预先定义的目标，尽可能早地发现错误并及时地修正。\n- 为什么要进行软件测试？答案很简单，就是为了保证软件质量。\n- 软件测试，就好比制造工厂的质量检验，是对软件产品和阶段性工作成果进行质量检验，力求发现其中的各种缺陷，并督促缺陷得到修正，从而控制软件产品的质量。\n- Bill Hetzel在1983年，软件测试就是一系列活动，这些活动是为了评估一个程序或软件系统的特性能力，并确定其是否达到了预期结果。\n- Glenford J. Myers在1979 测试是为了发现错误而执行一个程序或者系统的过程。\n- Glenford J. Myers的软件测试定义，虽然受到业界的普遍认同，但也存在一些问题，例如：\n    1. 如果只强调测试的目的是寻找错误，就可能使测试人员容易忽视软件产品的某些基本需求或客户的实际需求，测试活动可能会存在一定的随意性和盲目性。\n    2. 如果只强调测试的目的是寻找错误，使开发人员容易产生一个错误的印象，认为测试人员的工作就是挑毛病的。\n- IEEE1983 of IEEE Standard 729 中对软件测试下了一个标准的定义：使用人工或自动手段来运行或测定某个系统的过程，其目的在于检验它是否满足规定的需求或是弄清预期结果与实际结果之间的差别。\n- 在著名的软件瀑布模型中，软件测试是处在“编程”的下游、在“软件维护”的上游，\n- 在著名的软件瀑布模型中，强调测试仅仅是对程序的检验。\n- 现在人们普遍认为软件测试贯穿着整个软件生命周期。\n- V模型，说明软件测试活动和项目同时启动，软件测试的工作很早就开始了，避免了瀑布模型所带来的误区——软件测试是在代码完成之后进行。（画出软件开发和测试的v模型）\n- 任何形式的产品都是过程执行得到的结果，因此对过程进行管理与控制是提高产品质量的一个重要途径。\n- 软件质量保证（Software Quality Assurance，SQA）活动是通过对软件产品有计划地进行评审和审计来验证软件是否合乎标准的系统工程，通过协调、审查和跟踪以获取有用信息，形成分析结果以指导软件过程。\n\n# 第二章 软件测试的基本概念\n- 1983年ANSI/IEEE STD729给出了软件质量定义——软件产品满足规定的和隐含的与需求能力有关的全部特征和特性，它包括：\n    1. 软件产品质量满足用户要求的程度；\n    2. 软件各种属性的组合程度；\n    3. 用户对软件产品的综合反映程度；\n    4. 软件在使用过程中满足用户的程度；\n- 根据标准ISO/IEC TR 9126（2003）或新的ISO/IEC 25000（2010）系列标准，软件质量分为内部质量、外部质量、使用质量\n- 在IEEE Standard 729（1983）中对软件缺陷给出了一个标准定义：\n    1. 从产品内部看，软件缺陷是软件产品开发或维护过程中所存在的错误、毛病等各种问题。\n    2. 从外部看，软件缺陷是系统所需要实现的某种功能的失效或违背。\n- 软件缺陷就是软件产品中所存在的问题，最终表现为用户所需的功能没有完全实现，没有满足用户的需求。\n- 软件缺陷表现的形式是各种各样的，不仅体现在功能的失效方面，还体现在其他方面，例如：\n    1. 运行出错，包括运行中断、系统崩溃、界面混乱。\n    2. 数据计算错误、导致结果不正确。\n    3. 功能、特性没有实现或部分实现。\n    4. 在某种特定条件下没能给出正确或准确的结果。\n    5. 计算的结果没有满足所需要的精度。\n    6. 用户界面不美观，如文字显示不对齐、字体大小不一致等。\n    7. 需求规格说明书的问题，如漏掉某个需求、表达不清楚或前后矛盾等。\n    8. 设计不合理，存在缺陷。例如，计算机游戏只能用键盘玩而不能用鼠标玩。\n    9. 实际结果和预期结果不一致。\n    10. 用户不能接受的其他问题，如存取时间过长、操作不方便等。\n- 规格说明书是软件缺陷出现最多的地方。\n- 缺陷发现或解决得越迟，成本就越高。\n- 软件评审的形式有互为评审、走查和会议评审。\n- 测试计划是为了高效地、高质量地完成测试任务而做的准备工作，包括对工作量的估算、测试资源和进度安排、测试风险评估、测试策略制定等工作。\n- 测试计划书的主要内容集中在下列几个方面：\n    1. 目标和范围：包括产品特性、质量目标、各阶段的测试对象、目标、范围和限制。\n    2. 项目估算：根据历史数据和采用恰当的评估技术，对测试工作量、所需资源（人力、时间、软硬件环境）做出合理的估算。\n    3. 风险计划：对测试可能存在的风险进行分析、识别，以及对风险的回避、监控和管理。\n    4. 进度安排：分解项目工作结构，并采用时限图、甘特图等方法制定时间/资源表。\n    5. 资源配置：人员、硬件和软件等资源的组织和分配包含每一个阶段和每一个任务所需的资源。\n    6. 跟踪和控制机制：包括质量保证和控制、变化管理和控制等，明确如何准备去做一个问题报告以及如何去界定一个问题的性质，问题报告包括问题的发现者和修改者，问题发生的频率，是用什么样的测试用例测出该问题的，以及明确问题产生时的测试环境。\n- 测试用例是为了特定的测试目的（如考察特定程序路径或验证某个产品特性）而设计的测试条件、测试数据及与之相关的测试规程的一个特定的使用实例或场景。\n- 测试用例的主要作用有一下几方面：\n    1. 测试用例是测试人员在测试过程中的重要参考依据。\n    2. 测试用例可以帮助实施有效的测试，所有被执行的测试都是有意义的，不要执行毫无意义的测试操作。\n    3. 良好的测试用例不断地被重复使用，使得测试过程事半功倍。\n    4. 测试用例是一个知识积累的过程。\n- 专职测试人员的主要责任应该是：\n    1. 尽早地、尽可能地发现软件程序、系统或产品中的问题，并督促开发人员尽快地解决程序中的缺陷；\n    2. 能够全面、客观地评估软件质量，及时提供项目的当前质量状态；\n    3. 持续地提供软件产品质量的反馈，暴露产品质量风险，引导团队关注质量；\n    4. 对质量工作的质量和效率负责，成为测试工作的负责人；\n    5. 成为测试专家，不断改进测试方法，提高测试效率，并能够指导开发人员或其他人员做好测试；\n    6. 对缺陷进行根本原因分析，抽象出缺陷模式，帮助团队做好缺陷预防；\n    7. 帮助团队建立质量保证体系，如督促编程规范的建立好实施。\n\n# 第三章 软件测试方法\n- Pair-wise方法，也称为“成对组合测试”、“两两组合测试”，即将众多因素的值两两组合起来而大大减少测试用例组合。\n- 导致程序员犯错的因素很多，有程序员本身的编程水平、习惯以及所属团队软件工程管理水平等，编程语言及其相关类库的有些难以理解的特性也是一个比较重要的原因。\n- 大量的测试数据统计分析可以发现有些软件缺陷是具有共性的。常见的软件缺陷模式，\n    1. 故障模式\n    2. 安全漏洞模式\n    3. 差性能模式\n    4. 并发缺陷模式\n    5. 不良习惯模式\n    6. 代码国际化模式\n    7. 易诱骗代码模式\n- 测试过程从源代码输入开始，经历预编译、词法分析、语法分析与语义处理、抽象语法树生成、控制流图生成和IP（ILLegal Pattern，非法模式）扫描等几个步骤，最后自动生成IP报表\n- 基于模式的测试，往往不是直接针对被测系统进行，而是根据算法、规则，针对源代码进行检测。\n- 基于模式的软件测试技术不能替代已有的其他测试技术，而是对其他测试技术一个有力的补充。\n- 一个程序的功能通常由静态说明和动态说明组成，动态说明描述了输入数据的次序或者转换的次序；静态说明描述了输入条件和输出条件之间的对应关系。对于比较复杂的程序，由于大量的组合情况存在，如果仅使用静态说明来组织测试往往是不够的，必须通过动态说明来补充测试。\n- 功能图法就是使用功能图形式化地表示程序的功能说明，并机械地生成功能图的测试用例。功能图模式由状态迁移图和逻辑功能模型组成。\n    1. 状态迁移图用于表示输入数据序列以及相应的输出数据，由输入和当前的状态决定输出数据和后续状态。\n    2. 逻辑功能模型用于表示在状态输入条件和输出条件之间的对应关系。逻辑功能模型只适用于描述静态说明，输出数据仅由输入数据决定。\n- 模糊测试方法，简单地说，就是通过一个自动产生数据的模板或框架（称为模糊器）来构造或自动产生大量的、具有一定随机性的数据作为系统的输入，从而检验系统在各种数据情况下是否会出现问题。\n- 形式化规范说明语言，一般由以下三个主要的成分构成。\n    1. 语法，定义用于表示规约的特定符号；\n    2. 语义，帮助定义用于描述系统的对象及其属性；\n    3. 一组关系，定义如何确定某个对象是否满足规约的规则。\n- 形式化验证，就是根据某些形式规范或属性，使用数学方法（形式逻辑方法）证明其正确性或非正确性。\n- 软件测试无法证明系统不存在缺陷，也不能证明它符合一定的属性。只有形式化验证过程可以证明一个系统不存在某个缺陷或证明一个系统符合某个属性。但是，还无法证明某个系统没有缺陷，这是因为不能形式化地定义“没有缺陷”。所以，我们能做的就是证明一个系统不存在可以想得到的缺陷，以及验证满足系统质量要求的属性。\n- 给定程序，根据语句覆盖、判断覆盖、条件覆盖和路径覆盖设计测试样例；\n- 给定程序或输入数据说明，根据等价类划分或边界值分析设计测试样例。\n\n# 第四章 软件测试流程和规范\n- W模型增加了软件各开发阶段中应同步进行的验证和确认活动。\n- 测试过程和开发过程都贯穿软件过程的整个生命周期，她们是相辅相成、相互依赖的关系，概况起来有以下三个关键点。\n    1. 测试过程和开发过程是同时开始的，同时结束的，两者保持同步的关系。\n    2. 测试过程是对开发过程中阶段性成果和最终的产品进行验证的过程，所以两者相互依赖。前期，测试过程更多地依赖于开发过程；后期，开发过程更多地依赖于测试过程。\n    3. 测试过程中的工作重点和开发工作的重点，可能是不一样的。两者有各自的特点。不论在资源管理方面，还是在风险管理方面，两者都存在着差异。\n- TMap所定义的测试生命周期由计划和控制、基础设施、准备、说明、执行和完成等阶段组成。这个过程目前也被ISTQB（国际软件测试资质认证委员会）所采用，成为测试过程的标准。\n- 测试驱动开发的思想是敏捷测试的核心，或者说，单元测试是敏捷测试的基础，在敏捷测试中，开发人员承担更多的测试，软件测试更依赖整个团队的共同努力。\n- 敏捷测试的实践具有鲜明的敏捷开发的特征，与传统测试的区别，可以概况如下：\n    1. 传统测试更强调测试的独立性，将“开发人员”和“测试人员”角色分得比较清楚，而敏捷测试可以有专职的测试人员，也可以是全民测试，即在敏捷测试中，可以没有“测试人员”角色，强调整个团队对测试负责。\n    2. 传统测试更具有阶段性，从需求评审、设计评审、单元测试到集成测试、系统测试等，从测试计划，测试设计再到测试执行、测试报告等。但敏捷测试团队每一天都在一起工作，一起讨论需求，一起评审需求，更强调持续测试，持续的质量反馈，测试的持续性更为显著。\n    3. 传统测试强调测试的计划性，认为没有良好的测试计划和不按计划执行，测试就难以控制和管理，而敏捷测试更强调测试的速度和适应性，侧重计划的不断调整以适应需求的变化。\n    4. 传统测试强调测试是由“验证”和“确认”两种活动构成的，而敏捷测试没有这种区分，始终以用户需求为中心，每时每刻不离用户需求，将验证和确认统一起来。\n    5. 传统测试强调任何发现的缺陷要记录下来，以便进行缺陷根本原因分析，达到缺陷预防的目的，并强调缺陷跟踪和处理的流程，区分测试人员和开发人员的各自不同的责任。而敏捷测试强调面对面沟通、协作，强调团队的责任，不太关注对缺陷的记录与跟踪。\n    6. 传统测试更关注缺陷，围绕缺陷开展一系列的活动，而敏捷测试更关注产品本身，关注可以交付的客户价值，在快速交付的敏捷开发模式下，缺陷修复的成本很低。\n    7. 传统测试鼓励自动化测试，但对于传统开发的周期比较长，即使没有自动化测试也是可以应付的，一般来说，回归测试能够获得几周时间，甚至一两个月的时间，自动化测试的成功与否对测试没有致命的影响。敏捷测试的持续性迫切要求测试的高度自动化，在1-3天内就要完成整个的验收测试（包括回归测试）。没有自动化，就没有敏捷，自动化测试是敏捷测试的基础。\n- 探索测试强调测试的学习、设计和执行同时展开，也就是没有测试用例\n- 软件测试5个学派\n    1. 分析学派：认为软件是逻辑性的，将测试看作计算机科学和数学的一部分，结构化测试、代码覆盖率就是其中一些典型的例子。他们认为测试工作是技术性很强的工作，侧重使用类似UML工具进行分析和建模。\n    2. 标准学派：从分析学派分离出来并得到IEEE的支持，把测试看作侧重劣质成本控制并具有可重复标准的、旨在衡量项目进度的一项工作，测试是对产品需求的确认，每个需求都需要得到验证。\n    3. 质量学派：软件质量需要规范，测试就是过程的质量控制、揭示项目质量风险的活动，确定开发人员是否遵守规范，测试人员扮演产品质量的守门员角色。\n    4. 上下文驱动学派：认为软件是人创造的，测试所发现的每一个缺陷都和相关利益者密切相关；认为测试是一种有技巧的心理活动；强调人的能动性和启发式测试思维。探索性测试就是其典型代表。\n    5. 敏捷学派：认为软件是持续不断的对话，而测试就是验证开发工作是否完成，强调自动化测试。TDD是其典型代表。\n- 基于风险的测试是指评估测试的优先级，先进行高优先级的测试，如果时间或精力不够，低优先级的测试可以暂时先不做。基于风险的测试，也就是根据事情的轻重缓急来决定测试工作的重点和工作的顺序。\n- 过程能力描述了遵循一个软件测试过程可能达到的预期结果的范围。\n- TMM也将测试过程成熟度分为5个等级——初始级、定义级、集成、管理&度量、优化。\n\n\n# 第五章 单元测试与集成测试\n- 单元测试是对单元的代码规范性、正确性、安全性、性能等进行验证。\n- 通过单元测试，需要验证下列这些内容：\n    1. 数据或信息能否正确地流入和流出单元。\n    2. 在单元工作过程中，其内部数据能否保持其完整性，包括内部数据的形式、内容及相互关系不发生错误，也包括全局变量在单元中的处理和影响\n    3. 在数据处理的边界处能否正确工作。\n    4. 单元的运行能否做到满足特定的逻辑覆盖。\n    5. 单元中发生了错误，其中的出错处理措施是否有效。\n    6. 指针是否被错误引用、资源是否及时被释放。\n    7. 有没有安全隐患？是否使用了不恰当的字符串处理函数等。\n- 通过单元测试的一般标准\n    1. 软件单元功能与设计需求一致。\n    2. 软件单元接口与设计需求一致\n    3. 能够正确处理输入和运行中的错误。\n    4. 在单元测试中发现的错误已经得到修改并且通过了测试。\n    5. 达到了相关的覆盖率的要求。\n    6. 完成软件单元测试报告。\n- 单元测试的任务包括单元中所有独立执行路径、数据结构、接口、边界条件、容错性等测试。\n- 单元独立执行路径的测试，主要检查下列问题\n    1. 误解或用错了算符优先级；\n    2. 混合类型运算；\n    3. 变量初始化错误、赋值错误；\n    4. 错误计算或精度不够；\n    5. 表达式符号错等。\n- 单元局部数据结构的测试，发现下面几类错误：\n    1. 不合适或不相容的类型说明；\n    2. 变量无初值；\n    3. 变量初始化或缺省值有错；\n    4. 不正确的变量名（拼错或不正确地截断）；\n    5. 出现上溢、下溢和地址异常。\n- 单元接口测试应该考虑下列主要因素：\n    1. 输入的实际参数与形式参数的个数、类型等是否匹配、一致；\n    2. 调用其他单元时所给实际参数与被调用单元的形式参数个数、属性和量纲是否匹配；\n    3. 调用预定义函数时所用参数的个数、属性和次序是否正确；\n    4. 是否存在与当前入口点无关的参数引用；\n    5. 是否修改了只读型参数；\n    6. 对全程变量的定义各单元是否一致；\n    7. 是否把某些约束作为参数传递。\n- 单元容错性测试着重检查下列问题：\n    1. 输出的出错信息难以理解；\n    2. 记录的错误与实际遇到的错误不相符；\n    3. 在程序自定义的出错处理代码运行之前，系统已介入；\n    4. 异常处理不当；\n    5. 错误陈述中未能提供足够的定位出错信息。\n- 代码审查包括互查、走查、会议评审等形式。\n- 驱动程序也称为驱动模块，用以模拟被测试模块的上级模块，能够调用被测试模块。在测试过程中，驱动模块接收测试数据，调用被测模块并把相关的数据传送给被测模块。\n- 桩程序，也称为桩模块，用以模拟被测模块工作过程中所调用的下层模块。\n- 对于类的单元测试可以看作是对类的成员函数进行测试。\n- 5.4代码评审案例分析（5个）\n- 单元测试工具JUnit、CppUnit、NUnit、HtmlUnit、JsUnit、PhpUnit、PerlUnit、XmlUnit\n- 代码静态检测工具CheckStyle 、FindBugs、PMD\n- 集成测试的模式：非渐增式测试模式和渐增式测试模式；两种模式的优缺点：\n    1. 渐增式测试模式需要编写的软件较多，工作量较大，而非渐增式测试模式开销小；\n    2. 渐增式测试模式发现模块间接口错误早，而非渐增式测试模式晚；\n    3. 非渐增式测试模式发现错误，较难诊断，而使用渐增式测试模式，如果发生错误则往往和最近加进来的那个模块有关。\n    4. 渐增式测试模式更彻底；\n    5. 渐增式测试模式需要较多的机器时间。\n    6. 使用非渐增式测试模式可以并行测试。\n\n# 第六章系统测试\n- 系统测试一般由若干个不同测试类型组成，目的是充分运行系统，验证整个系统是否满足功能和非功能性的质量需求。\n- 非功能：压力测试、容量测试和性能测试\n- 选择回归测试策略应该兼顾效率和有效性两个方面，下面有几种方法：\n    1. 再测试全部用例。\n    2. 基于风险选择测试。\n    3. 基于操作剖面选择测试。\n    4. 再测试修改的部分\n- 性能测试就是为了发现系统性能方面或获取系统性能相关指标（如运行速度、响应时间、资源使用率等）而进行的测试。\n- 系统的性能指标包括两个方面的内容——系统资源（CPU、内存）的使用率和系统行为表现。资源使用率越低，一般来说系统会有更好的性能表现，系统资源使用率很高甚至耗光，系统的性能肯定不会好。资源利用率是分析系统性能指标进而改善性能的主要依据。\n- 系统行为的性能指标很多，常见的有以下几个：\n    1. 请求响应时间；\n    2. 事物响应时间；\n    3. 数据吞吐量；\n- 性能测试，根据其不同的测试目的分为以下几类：\n    1. 性能验证测试，验证系统是否达到事先已定义的系统性能指标、能否满足系统的性能需求。\n    2. 性能基准测试，在系统标准配置下获得有关的性能指标数据，作为将来性能改进的基准线。\n    3. 性能规划测试，在多种特定的环境下，获得不同配置的系统性能指标，从而决定在系统部署时采用什么样的软、硬件配置。\n    4. 容量测试\n- 负载加载的方式：逐步加载、平均加载、随机加载、峰谷交替加载。\n- 性能测试过程：\n    1. 确定性能测试需求，包括确定哪些性能指标要度量的，以及系统会承受哪些负载。\n    2. 根据测试需求，选择测试工具和开发相应的测试脚本。\n    3. 建立性能测试负载模型，就是确定并发虚拟用户的数量，每次请求的数据量、思考时间、加载方式和持续加载的时间。\n    4. 执行性能测试。通过多次运行性能测试负载模型，获得系统的性能数据。\n    5. 提交性能测试报告，包括性能测试方法、负载模型和实际执行的性能测试、性能测试结果及其分析。\n- 在测试过程中，要善于捕捉被监控的数据曲线发生突变的地方——拐点，这一点就是饱和点或性能瓶颈。\n- 压力测试，也称为强度测试、负载测试。压力测试是模拟实际应用的软硬件环境及用户使用过程的系统负荷，长时间或超大负荷地运行测试软件，来测试被测系统的性能、可靠性、稳定性等。压力测试的目的就是在软件投入使用以前或软件负载达到极限以前，通过执行可重复的负责测试，了解系统可靠性、性能瓶颈等，以提高软件系统的可靠性、稳定性，减少系统的宕机时间和因此带来的损失。\n- 容量测试，预先分析出反映软件系统应用特征的某项指标的极限值，如某个web站点可以支持的多少个并发用户的访问量、网络在线会议系统的与会人员。\n- 安全性要求分析，包括确定可能的或潜在的各类安全威胁和找到处理这些威胁的策略。\n- 安全性测试就是全面检验软件在需求规格说明书中规定的防止危害状态措施的有效性和在每一个危险状态下的反应，对软件设计中用于提高安全性的结构、算法、容错、冗余、中断处理等方案进行针对性测试，并对安全性关键的软件单元和软件部件，单独进行加强的测试，以确认其满足安全性需求。\n- 理论上讲，只要有足够的时间和资源，没有不可进入的系统。因为系统安全设计的准则是，使非法侵入的代价超过被保护信息的代价，此时非法侵入者已无利可图。\n- 安全性一般分为两个层次，即应用程序级别的安全性和系统级别的安全性。应用程序级别的安全性：核实操作者只能访问其所属用户类型已被授权访问的那些功能或数据。系统级别的安全性：核实只有具备系统和应用程序访问权限的操作者才能访问系统和应用程序。\n- 他们的关系:\n    1. 应用程序级别的安全性，包括对数据或业务功能的访问；系统级别大安全性，包括系统的登录或远程访问。\n    2. 应用程序级别的安全性可确保：在预期的安全性情况下，操作者只能访问特定的功能或用例，或者只能访问有限的数据；\n    3. 系统级别的安全性可确保只有具备系统访问权限的用户才能访问应用程序，而且只能通过相应的网关来访问。\n- 根据GB17859-1999，确定系统安全性的5个级别：\n    1. 用户自主保护级\n    2. 系统审计保护级\n    3. 安全标记保护级\n    4. 结构化保护级\n    5. 访问验证保护级\n- Web的安全性测试中，通常需要考虑下列的情形：\n    1. 数据加密\n    2. 登录或身份验证\n    3. 输入验证\n    4. SQL注入\n    5. 超时限制\n    6. 目录\n    7. 操作留痕\n- 容错性测试主要检查系统的容错能力，检查软件在异常条件下自身是否具有防护性的措施或者某种灾难性恢复的手段。\n- 对于自动恢复需验证重新初始化、检查点、数据恢复和重新启动等机制的正确性；对于人工干预的恢复系统，还需估算平均修复时间，确定其是否在可接受的范围内。\n- 可靠性是产品在规定的条件下和规定的时间内完成规定功能的能力，它的概率度量称为可靠度。\n- 软件可靠性是软件系统在规定的时间内及规定的环境条件下，完成规定功能的能力。\n- 软件可靠性测试，也称软件可靠性评估，指根据软件系统可靠性结构、寿命类型和各单元的可靠性试验信息，利用概率统计方法，评估出系统的可靠性特征量。\n- 软件可靠性模型分为两大类，即软件可靠性结构模型和软件可靠性预计模型。\n- 软件可靠性结构模型是依据系统结构逻辑关系，对系统的可靠性特征及其发展变化规律做出可靠性评价。此模型既可用于软件可行性综合评价又可用于软件可靠性分解。\n- 软件可靠性预计模型则是用来描述失效与软件缺陷的关系，借助这类模型，可以对软件的可靠性特征做出定量的预计或评估。\n- 预计模型有以下几类\n    1. 面向时间的预计模型，以时间为基准，描述软件可靠性特征随时间变化的规律。\n    2. 面向输入数据的预计模型，描述软件可靠性与输入数据的联系，利用程序运行中的失效次数与成功次数的比作为软件可靠性的度量。\n    3. 面向错误数的预计模型。，描述程序中现存错误数的多少预示程序的可靠性。\n- ISO9000 国际质量标准（ISO/IEC9126-1991）规定，软件产品的可靠性含义是：在规定的一段时间和条件下，软件能维持其性能水平的能力有关的一组属性，可用成熟性、容错性、易恢复性三个基本子特性来度量。\n- 成熟性度量可以通过错误发现率来表现。\n- GJB438A-1997中，软件测试报告应具备下列内容：\n    1. 产品标识\n    2. 使用的配置\n    3. 使用的文档\n    4. 产品说明、用户文档、程序和数据的测试结果。\n    5. 与需求不相符项的列表\n    6. 测试的最终日期\n\n\n# 第七章 验收测试\n- 验收测试是在软件产品完成了功能测试和系统测试之后，产品发布之前所进行的软件测试活动。\n- 验收测试是检验产品和产品规格说明书的一致性。\n- 好的用户界面包含7个要素：\n    1. 符号标准和规范\n    2. 直观性\n    3. 一致性\n    4. 灵活性\n    5. 舒适性\n    6. 正确性\n    7. 实用性\n- 安装测试时，一般要注意一下几个方面\n    1. 一般严格按照安装文档中的说明，一步一步地进行操作，最好从文档中复制出各种操作命令及其参数，确保输入到计算机的命令和文档中的内容一致。检查系统安装是否能够安装所有需要的文件、数据并完成必要的系统设置。\n    2. 软件的安装说明书有无对安装环境做限制和要求。至少在标准配置和最低配置两种环境下安装。\n    3. 安装过程是否简单，容易掌握\n    4. 安装过程是否有明显的、合理的提示信息。\n    5. 卸载测试也是安装测试的一部分。\n    6. 安装过程中是否会出现不可预见的或不可修复的错误，进一步验证安装过程中对硬件的识别能力、是否会破坏其他文件或配置。\n    7. 安装程序是否占用太多系统资源、是否有冲突、是否会影响原系统的安全性。\n    8. 软件安装的完整性和灵活性。\n    9. 软件使用的许可号码或注册号码的验证，用户许可协议的条款要保证其合理、合法。\n\n\n# 第八章 软件本地化测试\n- 软件本地化是将一个软件产品按特定国家或语言市场的需要进行全面定制的过程，包括翻译、重新设计、功能调整以及功能测试、是否符合各个地方的习俗、文化背景、语言和方言的验证等。\n- 为了减少本地化的工作，软件产品国际化应该具有下面一系列特性：\n    1. 支持Unicode字符集；\n    2. 分离程序代码和显示内容（文本、图片、对话框、信息框和按钮等）如将这些内容由资源文件统一处理。\n    3. 消除硬代码（hard code，指程序代码中所包含一些特定的数据，它们本应该作为变量处理，而对应的具体数据应该存储在数据库或初始化文件中）；\n    4. 使用Header Files去定义经常被调用的代码段；\n    5. 改善翻译文本尺寸，具体调整的灵活性，如在资源文件中可以直接具有调整用户界面的灵活性来适应翻译文本尺寸。\n    6. 支持各个国家的键盘设置，并有对应的热键处理；\n    7. 支持文字不同方向的显示；\n    8. 支持各个国家的度量衡、时区、货币单位格式等自定义功能；\n    9. 用户界面（包括颜色、字体等）自定义特性\n- 软件本地化基本步骤：\n    1. 建立一个配置管理体系，跟踪目标语言各个版本的源代码；\n    2. 创造和维护术语表；\n    3. 从源语言代码中分离资源文件或提取需要本地化的文本；\n    4. 把分离或提取的文本、图片等翻译成目标语言；\n    5. 把翻译好的文本、图片重新插入目标语言的源代码版本中；\n    6. 如果需要，编译目标语言的源代码；\n    7. 测试翻译后的软件，调整UI以适应翻译后的文本；\n    8. 测试本地化后的软件，确保格式和内容都正确。\n- 本地化测试着重与以下几个方面\n    1. 主要的功能性测试，函数之间传递的参数、数据库的默认值经过本地化处理后，可能会对系统的功能运行产生较大的影响，从而引起功能缺陷。\n    2. 在本地化环境中的安装和升级测试，由于目标语言的操作系统和软件本身都不一样了，安装或升级过程也常常受到影响；\n    3. 根据产品的目标区域而进行的应用程序和硬件兼容性测试，其应用程序的接口、标准可能不同，硬件型号及其配置更有可能存在差异；\n    4. 受本地化影响的用户界面，包括布局、格式、文字和图片等内容显示问题；\n    5. 特殊的语言环境（意境）、文化背景和地理位置等可能给软件带来的问题；\n    6. 文字翻译的正确性、准确性以及是否遗漏等。\n- 针对用户界面和语言文化方面的测试，其具体内容包括以下几个方面。\n    1. 应用程序源文件的有效性；\n    2. 验证语言的准确性和源代码的属性；\n    3. 排版错误；\n    4. 检查印刷文档和联机帮助、界面信息的一致性以及命令键的顺序等；\n    5. 用户界面是否符合当地审美标准（或情趣）；\n    6. 文化适用性的评估；\n    7. 政治敏感内容的检查。\n\n\n# 第九章 测试自动化及其框架\n- 自动化测试是相对手工测试而存在的一个概念，有手工逐个地运行测试用例的操作过程被测试工具或系统自动执行的过程代替，包括输入数据自动生成、结果的验证、自动发送测试报告等。主要是通过所开发的软件测试工具、脚本等来实现，具有良好的可操作性、可重复性和高效率等特点。测试自动化是软件测试中提高测试效率、覆盖率和可靠性等重要手段。\n- 手工测试的局限性\n    1. 通过手工测试无法做到覆盖所有代码路径，也难以测定测试的覆盖率；\n    2. 通过手工测试很难捕捉到与时序、死锁、资源冲突、多线程等有关的错误；\n    3. 在系统负载、性能测试时，需要模拟大量数据或大量并发用户等大负载的应用场合时，没有测试工具的帮助是无法想象的。\n    4. 在系统可靠性测试中，需要模拟系统运行几年、十几年，以验证系统能否稳定运行，也是手工测试无法模拟的。\n    5. 在回归测试中，多数情况下时间很紧，希望一天能完成成千上万个测试用例的执行，手工测试，即使然测试人员通宵达旦地干，也干不完；\n    6. 测试可以发现错误，并不能表明程序的正确性。\n- 自动化测试的优势：\n    1. 自动运行的速度快、执行效率高，是手工无法相比的。\n    2. 永不疲劳。\n    3. 测试结果准确。\n    4. 可靠。\n    5. 可复用性。\n    6. 特别的能力\n- 最早进行代码分析的工具是编译器。\n- 脚本是一组测试工具执行的指令集合，也是计算机程序的一种形式。脚本可以通过录制测试的操作产生，然后再做修改，这样可以减少脚本开发的工作量。\n- 结构化脚本具有很好的可重用性、灵活性，所以结构化脚本易于维护。\n- 数据驱动脚本，将测试脚本和数据分离开来，测试输入数据存储在独立的（数据）文件中，而不是存储在脚本中。\n- 测试工具的分类\n    1. 根据测试方法不同，分为白盒测试工具和黑盒测试工具，或者分为静态测试工具和动态测试工具等。\n    2. 根据测试的对象和目的不同，分为单元测试工具、功能测试工具、负载测试工具或性能测试工具、测试管理工具等。\n- 测试工具的选择步骤\n    1. 成立小组负责测试工具的选择和决策，制定时间表；\n    2. 确定自己的需求，研究可能存在的不同解决方案，并进行利弊分析；\n    3. 了解市场上满足自己需求的产品，包括基本功能、限制、价格和服务等；\n    4. 根据市场上产品的功能、限制和价格，结合自己的开发能力、预算、项目周期等决定是自己开发，还是购买；\n    5. 对市场上的产品进行对比分析，确定两三种产品作为候选产品；\n    6. 请候选产品的厂商来介绍、演示，并解决几个实例；\n    7. 初步确定；\n    8. 商务谈判；\n    9. 最后决定。\n- 自动化测试时没有达到预期效果，没有让测试工具发挥应有的作用。主要原因有：\n    1. 不正确的观念或不现实的期望；\n    2. 缺乏具有良好素质、经验的测试人才；\n    3. 测试工具本身的问题影响测试的质量；\n    4. 没有进行有效的、充分的培训；\n    5. 没有考虑到公司的实际情况，盲目引入测试工具；\n    6. 没有形成一个良好的使用测试工具的环境；\n    7. 其他技术问题和组织问题。\n- 测试自动化框架：\n    1. harness/IDE\n    2. 自动化测试脚本的管理\n    3. 代理负责Harness与工具的通信，控制测试工具的运行。\n    4. 测试工具\n    5. 任务安排\n    6. 报告呈现，任何一个人都能以Web方式及时查到测试结果。\n\n\n\n# 大题\n\n## 一\n\n对于YMD三个参数，NEXT函数应该是得出他的下一天\n\n假设年在2000到2022有效\n\n| 输入 | 有效等价类                                    | 无效等价类                                                   |\n| ---- | :-------------------------------------------- | ------------------------------------------------------------ |\n| Y    | 1. [2000-2022]之间的整数                      | 2. (-∞,2000)的整数 <br/>3. (2022,+∞)的整数 <br/>4. 小数字母等无效输入 |\n| D    | 5. [1-28]的整数<br/>6. 29<br/>7. 30<br/>8. 31 | 9. (-∞,1)的整数<br/>10. (31,+∞)的整数<br/>11. 29<br/>12. 30<br/>13. 31<br/> 14. 小数字母等无效输入 |\n| M    | 15. [1-12]的整数                              | 16. (-∞,1)的整数<br/>17. (12,+∞)的整数<br/>18. 小数字母等无效输入 |\n\n\n\n无效\n\n|      | Y              | D    | M    | 异常                    |\n| ---- | :------------- | ---- | ---- | ----------------------- |\n| 1.   | 1999           | 1    | 1    | Y2. (-∞,2000)的整数     |\n| 2.   | 2023           | 1    | 1    | Y3. (2022,+∞)的整数     |\n| 3.   | Abcd           | 1    | 1    | Y4. 小数字母等无效输入  |\n| 4.   | 2000           | 0    | 1    | D9. (-∞,1)的整数        |\n| 5.   | 2000           | 32   | 1    | D10. (31,+∞)的整数      |\n| 6.   | 2021(不是闰年) | 29   | 2    | D11. 29                 |\n| 7.   | 2021(不是闰年) | 30   | 2    | D12. 30                 |\n| 8.   | 2000           | 31   | 4    | D13. 31                 |\n| 9.   | 2000           | 0.1a | 1    | D14. 小数字母等无效输入 |\n| 10.  | 2000           | 1    | 0    | M16. (-∞,1)的整数       |\n| 11.  | 2000           | 1    | 13   | M17. (12,+∞)的整数      |\n| 12.  | 2000           | 1    | A    | M18. 小数字母等无效输入 |\n\n有效\n\n|      | Y    | D    | M    | 说明                                                         |\n| ---- | ---- | ---- | ---- | :----------------------------------------------------------- |\n| 1.   | 2000 | 1    | 1    | Y1. [2000-2022]之间的整数<br/>D5. [1-28]的整数<br/>M15. [1-12]的整数 |\n| 2.   | 2000 | 29   | 1    | Y1. [2000-2022]之间的整数<br/>D6. 29<br/> M15. [1-12]的整数  |\n| 3.   | 2000 | 30   | 1    | Y1. [2000-2022]之间的整数<br/>D7. 30<br/>M15. [1-12]的整数   |\n| 4.   | 2000 | 31   | 1    | Y1. [2000-2022]之间的整数<br/>D8. 31 <br/>M15. [1-12]的整数  |\n\n## 二\n\n根据如图所示程序流程图，分别用最少的测试用例完成语句覆盖、判定覆盖的测试设计\n\n![image-20220330163023449](322.assets/image-20220330163023449.png)\n\n```javascript\nif(x > 0 && y > 10){\n  y=y/x;\n}\nif(x < -10 || y < 0){\n  y=-(y + x)\n}\n```\n\nx=1 y=11 的情况\n\n满足第一个分支 y=11\n\n不满足第二个分支\n\nx=-11 y=1 的情况\n\n不满足第一个分支\n\n满足第二个分支 y=10\n\n上边这两条测试用例就可以做到语句覆盖，我没有找到一条覆盖所有的用例\n\n并且上边这两条测试用例也可以做到判定覆盖\n\n\n\n## 三(做的有问题)\n\n根据如图所示程序流程图，分别用最少的测试用例完成基本路径覆盖、条件/判定覆盖的测试设计\n\n![image-20220330163059592](https://s2.loli.net/2022/04/08/VlzjOhAK2Ytgdo6.png)\n\n\n## 存在的组合示例\n\n| 组合编号 | 1(x > 0)<br/>3(x < -10) | 2(y > 10)<br/>4(y < 0) | 判定条件取值 | 判定/条件组合         |\n| -------- | ----------------------- | ---------------------- | ------------ | --------------------- |\n| 1        | T1                      | T2                     | M=T          | x > 0,y > 10,M取真    |\n| 2        | T1                      | F2                     | M=F          | x > 0,y <= 10,M取假   |\n| 3        | F1                      | T2                     | M=F          | x <= 0,y > 10,M取假   |\n| 4        | F1                      | F2                     | M=F          | x <= 0,y <= 10,M取假  |\n| 5        | T3                      | T4                     | N=T          | x < -10,y < 0,N取真   |\n| 6        | T3                      | F4                     | N=T          | x < -10,y >= 0,N取真  |\n| 7        | F3                      | T4                     | N=T          | x >= -10,y < 0,N取真  |\n| 8        | F3                      | F4                     | N=F          | x >= -10,y >= 0,N取假 |\n\n\n\n\n## 条件/判定覆盖\n\n让所有的判定结果至少出现一次,即覆盖组合存在1-8所有\n\n```javascript\nif(x > 0 && y > 10){//M\n  y=y/x;//1\n}//2\nif(x < -10 || y < 0){//N\n  y=-(y + x)//3\n}//4\n```\n\n\n### 测试用例\n\n| 测试用例                             | 覆盖条件    | 覆盖路径 | 覆盖组合 |\n| ------------------------------------ | ----------- | -------- | -------- |\n| 输入:x=1,y=11<br/>输出:x=1,y=11      | T1,T2,F3,F4 | 1-4      | 1,8      |\n| 输入:x=1,y=-1<br/>输出:x=1,y=0       | T1,F2,F3,T4 | 2-3      | 2,7      |\n| 输入:x=-11,y=11<br/>输出:x=-11,y=0   | F1,T2,T3,F4 | 2-3      | 3,6      |\n| 输入:x=-11,y=-11<br/>输出:x=-11,y=22 | F1,F2,T3,T4 | 2-3      | 4,5      |\n\n## 基本路径覆盖\n\n覆盖所有可能的路径,即1,3|1,4|2,3|2,4\n\n```javascript\nif(x > 0 && y > 10){//M\n  y=y/x;//1\n}//2\nif(x < -10 || y < 0){//N\n  y=-(y + x)//3\n}//4\n```\n\n### 基本路径\n\n1. 画流程图\n\n![329.drawio](https://s2.loli.net/2022/04/08/d58vCzXGHnrLWqJ.png)\n\n2. 计算程序环路复杂度\n\n   1. V(G)=区域数目=2\n   2. V(G)=边界数目-节点数目+2=4-4+2=2\n   3. V(G)=判断节点数目+1=1+1=2(出度>=2)\n\n3. 确定基本路径\n\n   	- 1-4\n   	- 2-3\n\n### 测试用例\n\n| 测试用例                        | 覆盖条件    | 覆盖路径 | 覆盖组合 |\n| ------------------------------- | ----------- | -------- | -------- |\n| 输入:x=1,y=11<br/>输出:x=1,y=11 | T1,T2,F3,F4 | 1-4      | 1,8      |\n| 输入:x=1,y=-1<br/>输出:x=1,y=0  | T1,F2,F3,T4 | 2-3      | 2,7      |\n\n\n\n## 下边是用于计算输出和路径统计的代码\n\n\n```javascript\nlet x = -11;\nlet y = -11;\n//////////////////////////\nif (x > 0) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\nif (y > 10) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\n//////////////////////////\nif (x > 0 && y > 10) {\n    y = y / x;\n    console.log(\"1\");\n}else{\n    console.log(\"2\");\n}\n//////////////////////////\nif (x < -10) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\nif (y < 0) {\n    console.log(\"T\")\n}\nelse {\n    console.log(\"F\")\n}\n//////////////////////////\nif (x < -10 || y < 0) {\n    y = -(y + x);\n    console.log(\"3\");\n}else{\n    console.log(\"4\");\n}\n//////////////////////////\nconsole.log(\"x\", x);\nconsole.log(\"y\", y);\n```\n\n## 谈谈软件测试的正反两方面观点所带来的利弊\n\n\n正方\n优点：能够通过软件测试使程序更完美，能够按照预期的运行\n缺点：难以发现隐藏的问题\n\n\n反方\n优点：能够发现软件中存在的不易被察觉的错误，能够提升软件的质量\n缺点：测试人员只是为了测试而测试，忽略了本应该做的实际需求也客户的需要\n\n## 如何理解软件质量和软件缺陷的对立统一关系\n\n缺陷和质量他两个就是对立的两个词，甲方要一个功能，做的好就是质量高，缺陷少。做的不好就算是项目的缺陷，质量就差。他两个相辅相成，要有缺陷才有质量，有质量才有缺陷\n\n## 单元独立执行路径的测试、单元局部数据结构的测试主要检查的问题包括哪些？\n\n单元独立执行路径的测试检查单元中的代码行\n主要检查\n1 误解或用错了算术符号优先级\n2 混合类型运算\n3 变量初始化错误 赋值错误\n4错误计算或者精度不够\n5表达式符号错等\n\n单元局部数据结构的测试是检查存储的数据在执行中是否正确\n主要检查\n1 不合适或不相容的类型说明\n2 变量无初值\n3 变量初始化或缺省值有错\n4 不正确的变量名 拼错或不正确的截断\n5 出现上溢 下溢和地址异常\n\n## 验收测试是由用户完成的吗？为什么？\n\n验收测试是由测试人员和用户一起完成的,测试人员无法完全预见用户的操作情况,不可能发现所有的错误.\n往往验收测试会转变为两种测试\n1alpha测试,可以叫内测,用户在开发环境进行的测试,发现的问题提交给开发者,进行处理\n2beta测试,公测,由众多用户进行测试,基于真实的生产环境\n\n## 为什么说软件本地化不等同于是翻译\n\n 翻译是本地化的一个过程，但是本地化中包含着更多的东西，要尊重对方的宗教，习俗，习惯等。\n\n翻译是把文字转换成能看懂的文字，本地化不仅要能看懂，还要贴合地区。\n\n比如一个推荐功能，伊斯兰教的就不能推荐猪肉类食品。\n\n不同国家地区的时间表示方式也不同。\n\n', '软件测试复习');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('<meting-js\n	server=\"netease\"\n	type=\"playlist\"\n	id=\"7374461551\">\n</meting-js>\n\n# 软件项目管理（1-8章课后题）\n\n## 判断题\n\n1.  - [x] 搬家属于项目。\n2.  - [ ] 项目是为了创造一个唯一的产品或提供一个唯一的服务而进行的永久性的努力。\n3.  - [x] 过程管理目的是要让过程能够被共享、复用，并得到持续的改进。\n4.  - [x] 项目具有临时性的特征。\n5.  - [ ] 日常运作存在大量的变更管理，而项目基本保持连贯性的。\n6.  - [ ] 项目开发过程中可以无限制地使用资源。\n7.  - [ ] 项目招标对于一个项目的开发是必需的，即便项目是内部项目。\n8.  - [x] 自主开发相当于make or buy决策中的make。\n9.  - [ ] 项目建议书是项目计划阶段开发的文档。\n10.  - [ ] 项目立项需要获得项目经理的认可，但不需要项目发起人的认可。\n11.  - [ ] 项目章程是项目执行组织高层批准的确认项目存在的文件，其中不包括对项目经理的授权。\n12.  - [x] 乙方即供方（有时也称卖方）是为顾客提供产品或服务的一方。\n13.  - [x] 在软件项目合同中，甲方是需求放，乙方是供方。\n14.  - [ ] 项目初始阶段甲方为软件开发方，乙方为顾客。\n15.  - [ ] 瀑布模型不适合短期项目。\n16.  - [x] 增量式模型可以避免一次性投资太多带来的风险。\n17.  - [x] V模型适合的项目类型是需求很明确、解决方案很明确，而且对系统的性能要求比较严格的项目。\n18.  - [x] 在瀑布生存期模型中，要求项目所有的活动都严格按照顺序执行，一个阶段的输出是下一个阶段的输入。\n19.  - [x] 燃尽图是Scrum模型中常用的米姐开发工程实践。\n20.  - [x] 需求规格说明可以包括系统的运行环境。\n21.  - [ ] 数据流分析方法是一种自下而上逐步求精的分析方法。\n22.  - [x] 需求分析工作完成的一个基本标志是形成了一份完整的、规范的需求规格说明书。\n23.  - [x] 需求是指用户对软件的功能和性能的要求，就是用户希望软件能做什么事，完成什么样的功能，达到什么性能。\n24.  - [ ] 软件项目系统的响应时间属于功能性需求。\n25.  - [ ] 数据字典是由数据项、数据流以及操作指令组成的。\n26.  - [ ] 用例分析方法采用一种面向过程的情景分析方法。\n27.  - [x] WBS提供了项目范围基线。\n28.  - [x] 一个工作包可以分配给另一个项目经理去完成。\n29.  - [ ] 如果开发人员对项目比较熟悉或者对项目大局有把握，开发WBS时最好采用自底向上方法。\n30.  - [x] 对于一个没有做过的项目，开发WBS时可以采用自底向上方法。\n31.  - [x] 在任务分解结果中，最底层的要素必须是实现项目目标的充分必要条件。\n32.  - [x] 一个工作包应当由唯一主题负责。\n33.  - [ ] WBS的最高层次的可交付成果是工作包。\n34.  - [ ] 对任务的分解只能是自上而下的。\n35.  - [x] WBS的最底层任务是能分配到一个人完成的任务。\n36.  - [x] 任务分解是将一个项目分解为更多的工作细目或者子项目，是项目变得更小、更易管理和操作。\n37.  - [ ] 在软件项目估算中，估算结果是没有误差的。\n38.  - [x] 人的劳动消耗所付出的代价是软件产品的主要成本。\n39.  - [ ] 功能点估算与项目所使用的语言和技术有关。\n40.  - [ ] COCOMO81有3个等级的模型：有机型、嵌入型、半嵌入型。\n41.  - [ ] 经验对于估算来说不重要。\n42.  - [x] 估算时既要考虑直接成本又要考虑间接成本。\n43.  - [ ] 在进行软件估算的时候，可以直接考虑参照其他企业的模型进行项目估算。\n44.  - [ ] 间接成本是与一个具体项目相关的成本。\n45.  - [x] 软件项目规模就是软件项目工作量。\n46.  - [x] 一个工作也可以通过多个活动完成。\n47.  - [ ] 在项目进行过程中，关键路径是不变的。\n48.  - [x] 在PDM网络图中，箭线表示的是任务之间的逻辑关系，节点表示的是活动。\n49.  - [ ] 项目各项活动之间不存在相互联系与相互依赖关系。\n50.  - [x] 在资源冲突问题中，过度分配也属于资源冲突。\n51.  - [ ] 浮动是在不增加项目成本的条件下，一个活动可以延迟的时间量。\n52.  - [ ] 在使用应急法压缩时间时，不一定要在关键路径上选择活动来进行压缩。\n53.  - [x] 时间是项目规划中灵活性最小的因素。\n54.  - [ ] 外部依赖关系又称强制性依赖关系，指的是项目活动与非项目互动之间的依赖关系。\n55.  - [ ] 当估算某活动时间，存在很大不确定性时应采用CPM估计。\n56.  - [x] 质量是满足要求的程度，包括符合规定的要求和客户隐含的需求。\n57.  - [x] 软件质量是软件满足明确说明或者隐含的需求的程度。\n58.  - [ ] 软件质量可以通过后期测试得以提高。\n59.  - [x] 质量计划可以确定质量保证人员的特殊汇报渠道。\n60.  - [ ] 软件质量是代码正确的程度。\n61.  - [x] 项目立项可以确立项目目标.时间和资源成本，同时得到项目发起人的认可。\n62.  - [x] 敏捷项目采取的是仆人式管理方式\n63.  - [x] 极限编程从3个层面提供了13个敏捷实践\n64.  - [x] 敏捷包括《敏捷宣言》的价值观.12个原则，以及一些通用实践等\n65.  - [x] 瀑布模型和V模型都属于预测型生存期模型\n66.  - [x] 用户故事常常写在卡片上，然后将其部署在墙上\n67.  - [x] 敏捷项目的一个Epic还可以继续分解为一些用户故事\n68.  - [x] 故事点估算是一个相对的估算过程。\n69.  - [x] 敏捷项目要求全程的质量审查\n70.  - [x] 持续支付领域强调对项目所有的相关产物及其之间的关系都要进行有效配置管理\n71.  - [ ] 持续支付更倾向于使用基于分支的开发模式\n72.  - [x] 敏捷团队的人员一般在3~9人，而且一般集中地在一个场地开发，可以围坐一个桌子开会\n73.  - [x] 购买保险是一种回避风险的应对策略\n74.  - [x] 敏捷项目没有长期计划，这本身也是一个风险，因为存在一些无法识别的风险。\n75.  - [ ] 对于甲方来说，风险最高的是CPCC合同类型，风险最低的是FFP合同类型，乙方则相反\n76.  - [x] 《敏捷宣言》认为“客户协作高于合同协商”\n\n\n\n## 选择题\n\n1. 下面选项中不是PMBOK的知识域的是()\n      - [x] 招聘管理\n      - [ ] 质量管理\n      - [ ] 范围管理\n      - [ ] 风险管理\n2. 下面关于敏捷模型描述不正确是()\n      - [ ] 与传统模型相比，敏捷模型属于自适应过程\n      - [x] 可以应对需求的不断变化\n      - [ ] Scrum模型.XP模型.DevOps模型等都属于敏捷模型\n      - [ ] 敏捷型是预测型和迭代型的混合模型\n3. 关于迭代模型，下列说法不正确的是()\n      - [ ] 不断反馈原型\n      - [x] 可以加快开发速度\n      - [ ] 项目需求变化大\n      - [ ] 不多次提交\n4. 敏捷项目需求一般采用下面()描述\n      - [ ] 用户用例\n      - [ ] DFD\n      - [x] 用户故事\n      - [ ] 数据字典\n5. ()可以表示敏捷项目的进度，并且可以表示出剩余的任务\n      - [ ] 燃起图\n      - [x] 燃尽图\n      - [ ] 里程碑图\n      - [ ] 网络图\n6. 下面()不是敏捷项目的质量实践\n      - [ ] 结对编程\n      - [ ] TDD\n      - [ ] 迭代评审\n      - [x] 需求规格编写过程审计\n7. ()以图形方式展示项目团队成员及其报告关系这样可以减少沟通渠道，减少成本\n      - [x] 项目组织图\n      - [ ] 甘特图\n      - [ ] 网络图\n      - [ ] RAM图\n8. 下面不是敏捷角色的是()\n      - [ ] 产品负责人\n      - [ ] 团队促进者\n      - [ ] 跨职能团队成员\n      - [x] 合同管理者\n9. 在项目管理的3种组织结构中，适用于主要由一个部门完成的项目或技术比较成熟的项目组织结构是( )\n      - [ ] 矩阵型组织结构\n      - [ ] 项目型组织结构\n      - [x] 职能型组织结构\n      - [ ] 都一样\n10. 下面哪项不是敏捷项目设计的动态特性的合同签署技术()\n      - [ ] 多层结构\n      - [ ] 总结增量\n      - [ ] 动态范围方案\n      - [x] 固定价格\n11. 某异地开发的信息系统集成项目以程序流程图、数据流程图等为主要分析设计工具。由于用户身处异地，现场参与系统开发成本较高，因此项目组采用了先开发一个简化系统，待用户认可后再开发最终系统的策略。该信息系统集成项目的开发方法属于(  )。\n      - [x] 结构化方法与原型法的组合应用\n      - [ ] 结构化方法与面向对象方法的组合应用\n      - [ ] 原型法与面向对象方法的组合应用\n      - [ ] 原型法与形式化方法的组合应用\n12. 螺旋模型的开发过程具有周期性重复的螺旋线状，每个开发周期由 4 个象限组成，分别标志着开发周期的 4 个阶段。螺旋模型之所以特别适用于庞大而复杂的、高风险的系统开发，是因为它强调其中的(  )阶段。\n      - [ ] 制定计划\n      - [x] 风险分析\n      - [ ] 实施工程\n      - [ ] 客户评估\n13. 团购是当前一种较为流行的电子商务模式，某团购网站通过自己强大的公关能力与企业合作，向用户提供价格较为低廉或折扣较高的产品，同时为方便用户使用，该团购网站也提供了用户之间的转让平台。根据上述描述，该团购网站涉及的电子商务类型是( )。\n      - [ ] B2B  和 B 2C\n      - [x] B2C 和 C2C\n      - [ ] B2B  和 C2C\n      - [ ] B2B、B2C 和 C2C\n14. 软件过程管理涉及启动、计划、实施等六个方面的内容，以下说法不正确的是(  )。\n      - [ ] 从管理的角度，软件项目计划是指进行为软件工程做准备而要采取的活动\n      - [ ] 软件项目实施是指进行软件工程过程中发生的各种软件工程管理活动.\n      - [x] 评审和评价是指软件工程项目完成后进行的活动.\n      - [ ] 软件工程度量是指在软件工程组织中有效地进行开发和实现度量的程序.\n15. 根据《软件工程术语 GB/T11457-2006》，基线是业已经过正式审核与同意，可用作下一步开发的基础，并且只有通过正式的修改管理步骤方能加以修改的规格说明或产品。对于配置管理，有以下三种基线：功能基线、(  )和产品基线。\n      - [ ] 编码基线\n      - [ ] 测试基准\n      - [ ] 里程碑\n      - [x] 分配基线\n16. 某单位计划开发信息系统来实现其全员工资计算的自动化，根据《软件文档管理指南 GB/T16680-1996》，该信息系统项目中的文档质量等级最低应达到(  )。\n      - [x] 4 级\n      - [ ] 3 级\n      - [ ] 2 级\n      - [ ] 1 级\n17. 小张的 U 盘中存储有企业的核心数据。针对该 U 盘，以下有关信息安全风险评估的描述中，不正确的是(  )。\n      - [ ] 风险评估首先要确定资产的重要性，由于该 U 盘中存储有核心数据，安全性要求高，因此该 U 盘重要性赋值就高\n      - [x] 如果公司制定了 U 盘的安全使用制度，小张的 U 盘就不具有脆弱性\n      - [ ] 如果小张的计算机在接入 U 盘时没断网线，木马病毒就构成对该 U 盘的威胁\n      - [ ] 风险分析要同时考虑资产的重要性、威胁概率和脆弱性严重程度\n18. 某公司网管员对核心数据的访问进行控制时，针对每个用户指明能够访问的资源，对于不在指定资源列表中的对象不允许访问。该访问控制策略属于(  )。\n      - [x] 自主访问控制(DAC)\n      - [ ] 强制访问控制(MAC)\n      - [ ] 基于角色的访问控制(RBAC)\n      - [ ] 访问控制列表方式(ACL)\n19. 根据《软件工程术语 GB/T11457-2006》，验证过程试图确保活动的输出产品已经被正确制造，而确认过程则试图确保建造了正确的产品。因此，项目组为保证系统的设计满足需求规格说明书要求而实施的过程称为(  )。\n      - [ ] 架构验证\n      - [ ] 需求确认\n      - [ ] 架构确认\n      - [x] 需求验证\n20. 下列做法符合《招投标法》相关规定的是( )。\n      - [ ] 某项目的招标文件中详细介绍了招标人的名称和地址、招标项目的性质、数量、实施地点和时间、评标委员会组成名单以及获取招标文件的办法等事项。\n      - [x] 投标监督员有权对标书的密封情况进行检查，投标人之间也可以相互检查标书的密封情况。\n      - [ ] 某项目在截止时间前仅收到了两份投标文件，招标人直至收到第三份投标文件后才宣布开标。\n      - [ ] 某企业在中标之后，将主体工程分为三个部分，并将其中两个部分分别承包给其他单位。\n21. 下列选项中不是项目与日常运作的区别的是\n      - [ ] 项目是以目标为导向的，日常运作是通过效率和有效性体现的。\n      - [ ] 项目是通过项目经理及其团队工作完成的，而日常运作是职能式的线性管理。\n      - [ ] 项目需要有专业知识的人来完成，而日常运作的完成无需特定专业知识。\n      - [x] 项目是一次性的，日常运作是重复性的。\n22. 以下都是日常运作和项目的共同之处，除了\n      - [ ] 由人来做\n      - [ ] 受限于有限的资源\n      - [ ] 需要规划、执行和控制\n      - [x] 都是重复性工作\n23. 下列选项中属于项目的是\n      - [ ] 上课\n      - [ ] 社区保安\n      - [x] 野餐活动\n      - [ ] 每天的卫生保洁\n24. 下列选项中正确的是\n      - [ ] 一个项目具有明确的目标而且周期不限\n      - [ ] 一个项目一旦确定就不会发生变更\n      - [x] 每个项目都有自己的独特性\n      - [ ] 项目都是一次性的并由项目经理独自完成\n25. 是为了创造一个唯一的产品或提供一个唯一的服务而进行的临时性的努力。\n      - [ ] 过程\n      - [x] 项目\n      - [ ] 项目群\n      - [ ] 组合\n26. 下列活动中不是项目的是\n      - [ ] 野餐活动\n      - [ ] 集体婚礼\n      - [x] 上课\n      - [ ] 开发操作系统\n27. 下列选项中不是项目的特征的是\n      - [ ] 项目具有明确的目标\n      - [ ] 项目具有限定的周期\n      - [x] 项目可以重复进行\n      - [ ] 项目对资源成本具有约束性\n28. 下列选项中最能体现项目的特征\n      - [ ] 运用进度计划技巧\n      - [ ] 整合范围与成本\n      - [x] 确定期限\n      - [ ] 利用网络进行跟踪\n29. 项目经理的职责不包括\n      - [ ] 开发计划\n      - [ ] 组织实施\n      - [ ] 项目控制\n      - [x] 提供资金\n30. 项目管理专业人员资格是指(　 )。\n      - [ ] PMI\n      - [ ] ERP\n      - [x] PMP\n      - [ ] SAP\n31. 下列选项中正确的是(　 )。\n      - [ ] 项目目标明确但周期不限\n      - [ ] 项目内容一旦确定就不允许发生变更\n      - [x] 每个项目都有独一无二的\n      - [ ] 项目由项目经理独自完成\n32. 项目管理过程中的进度目标，成本目标，质量目标，范围目标等各个目标之间是(　  ) 的。\n      - [ ] 相互独立\n      - [x] 相互关联和制约\n      - [ ] 进度目标最重要\n      - [ ] 没有关系\n33. 下列关于项目管理工具软件Project的功能说法不正确的是(　 )。\n      - [ ] 计算项目信息\n      - [ ] 编制和组织信息\n      - [ ] 跟踪项目信息\n      - [x] 项目编码和测试\n34. 以下那项不是制约项目目标实现的主要因素(　 )。\n      - [ ] 范围\n      - [ ] 进度\n      - [ ] 成本\n      - [x] 风险\n35. 华为云DevCloud是(   )。\n      - [x] 云端DevOps平台\n      - [ ] 云端Cloud storage平台\n      - [ ] 云端Cloud computing平台\n      - [ ] 云端Big data development平台\n36. 下列不是项目立项过程内容的是()\n   