     - [ ] WBS\n      - [ ] 项目章程、批准的详细的项目范围说明书和WBS\n      - [ ] 项目章程、项目工作说明书和WBS\n      - [x] 批准的详细的项目范围说明书、WBS和WBS字典\n56. WBS非常重要，因为下列原因，除了()\n      - [ ] 帮助组织工作\n      - [ ] 防止遗漏工作\n      - [ ] 为项目估算提供依据\n      - [x] 确定团队成员责任\n57. WBS中的每一个具体细目通常都指定唯一的()\n      - [x] 编码\n      - [ ] 地点\n      - [ ] 功能模块\n      - [ ] 提交截至期限\n58. 下列不是创建WBS的方法的是()\n      - [ ] 自顶向下\n      - [ ] 自底向上\n      - [x] 控制方法\n      - [ ] 模板参照\n59. 任务分解时，()方法从特殊到一般的方向进行，首先定义一些特殊的任务，然后将这些任务组织起来，形成更高级别的WBS层。\n      - [ ] 模板参照\n      - [ ] 自顶向下\n      - [ ] 类比\n      - [x] 自底向上\n60. 下列关于WBS的说法，不正确的是()\n      - [ ] WBS是任务分解的结果\n      - [ ] 不包括再WBS中的任务就不是该项目的工作\n      - [ ] 可以采用清单或者图表的形式标石WBS的结果\n      - [x] 如果项目是一个崭新的项目，最好采用自顶向下方法开发WBS\n61. 检验WBS分解结果的标准不包括以下那一项？\n      - [ ] 最底层的要素是否是实现目标的充分必要条件\n      - [ ] 非叶节点是否包含两个以上的叶节点\n      - [ ] 最底层元素是否有重复\n      - [x] 最底层要素是否有清晰完整定义\n62. WBS是对项目由粗到细的分解过程，它的结构是()\n      - [ ] 分层的集合结构\n      - [x] 分级的树形结构\n      - [ ] 分层的线性结构\n      - [ ] 分级的图状结构\n63. 任务分解时，()方法从一般到特殊的方向进行，从项目的大局着手，然后逐步分解子细目，将项目变为更细、更完善的部分。\n      - [ ] 模板参照\n      - [x] 自顶向下\n      - [ ] 类比\n      - [ ] 自底向上\n64. 为了有效地管理项目，应该将工作分解为更小的部分，以下各项中，哪一项不能说明任务应该分解到什么程度？\n      - [ ] 可以在80小时内完成\n      - [x] 可由一个人完成\n      - [ ] 不能再进一步进行逻辑细分了\n      - [ ] 可以进行实际估算\n65. 任务分解可以(    )，它是范围变更的一项重要输入。\n      - [ ] 规定项目采用的过程\n      - [ ] 提供项目成本估算结果\n      - [x] 提供项目范围基线\n      - [ ] 提供项目的关键路径\n66. ()是成本的主要因素，是成本估算的基础。\n      - [ ] 计划\n      - [x] 规模\n      - [ ] 风险\n      - [ ] 利润\n67. 下列不是UFC的功能计数项是()\n      - [ ] 外部输出\n      - [ ] 外部文件\n      - [x] 内部输出\n      - [ ] 内部文件\n68. 成本预算的目的是()\n      - [x] 生产成本基线\n      - [ ] 编写报告书\n      - [ ] 指导设计过程\n      - [ ] 方便进度管理\n69. 下列不是软件项目规模单位的是()\n      - [ ] 源代码长度(LOC)\n      - [ ] 功能点(FP)\n      - [ ] 人天、人月、人年\n      - [x] 小时\n70. 在成本管理过程中，每个时间段中等各个工作单元的成本是()\n      - [ ] 估算\n      - [x] 预算\n      - [ ] 直接成本\n      - [ ] 间接成本\n71. 下面关于估算的说法，错误的是()\n      - [ ] 估算是有误差的\n      - [ ] 估算时不要太迷信数学模型\n      - [x] 经验对于估算来说不重要\n      - [ ] 历史数据对于估算来说非常重要\n72. 估算的基本方法不包括