方案\n      - [x] 固定价格\n109. 下面选项中不是《敏捷宣言》中的内容的是()\n      - [ ] 个体和交互胜过过程和工具\n      - [ ] 可以工作的软件胜过面面俱到的文档\n      - [x] 敏捷开发过程是自适应的过程\n      - [ ] 响应变化胜过遵循计划\n110. PMI人才三角不包括()\n      - [ ] 技术项目管理\n      - [x] 测试能力\n      - [ ] 领导力\n      - [ ] 战略和商务管理\n111. 下列关于用户故事描述不正确的是()\n      - [ ] 英文称：user story\n      - [ ] 不使用技术语言来描述\n      - [ ] 可以描述敏捷需求\n      - [x] 一种数据结构\n112. 三点估算法选择的3种估算值不包括()\n      - [ ] 最可能成本\n      - [ ] 最乐观成本\n      - [ ] 最悲观成本\n      - [x] 项目经理估算值\n113. 下面关于估算的说法，错误的是()\n      - [ ] 估算是有误差的\n      - [ ] 估算时不要太迷信数学模型\n      - [x] 经验对于估算来说不重要\n      - [ ] 历史数据对于估算来说非常重要\n114. 假设某项目的注册功能为3个故事点，而其中成绩录入工作量比注册功能工作量略多，如果采用Fibonacci 等级标准估算，则成绩录入功能的估算值的()\n      - [x] 5个故事点\n      - [ ] 4个故事点\n      - [ ] 6个故事点\n      - [ ] 7个故事点\n115. 常见的成本估算方法不包括()\n      - [ ] 代码行\n      - [ ] 功能点\n      - [ ] 类比法\n      - [x] 关键路径法\n116. 以下哪一项不是任务之间的关系？()\n      - [ ] 结束-开始\n      - [ ] 开始-开始\n      - [ ] 结束-结束\n      - [x] 结束-开始-结束\n\n## 填空题\n\n1. 敏捷模型包括(4)个核心价值，对应(12)个敏捷原则。\n2. 编写项目章程需要的数据资料包括：(项目工作说明书) ，商业论证 ，合同， 事业环境因素 ，(组织过程资产)。\n3. 某项目有活动A、B、C、D，活动依赖关系为：B、C只有在A完成后才能进行，D在B、C完成后可以立即开始。计算活动D的最早开始时间的公式是()。\n4. 项目风险管理的目标是(提高)项目积极事件的概率和影响，(降低)项目消极事件的概率和影响。\n5. 功能点方法中5类功能组件的计数项是外部输入、(外部输出)、外部查询、(内部逻辑文件)、外部接口文件。\n6. (关键路径)决定了项目在给定的金钱关系和资源条件下完成项目所需的最短时间。\n7. WBS最底层次课交付成果是(工作包)。\n8. 应该从以下几个方面去分析信息系统项目风险：政策、法律变化、技术来源是否可靠、稳定、网络安全威胁、()，替代品出现。\n\n## 主观题\n\n1. 项目管理知识体系（PMBOK）包括哪10个知识领域？\n\n   > 1. 项目集成管理\n   > 2. 项目范围管理\n   > 3. 项目时间管理\n   > 4. 项目成本管理\n   > 5. 项目质量管理\n   > 6. 项目人力资源管理\n   > 7. 项目沟通管理\n   > 8. 项目风险管理\n   > 9. 项目采购管理\n   > 10. 项目干系人管理\n\n2. 请简述项目管理的5个过程组及其关系\n\n   > 1. 启动过程组：主要是确定一个项目或一个阶段可以开始了，并要求着手实行；定义和授权项目或者项目的某个阶段。\n   > 2. 计划过程组：为完成项目所要达到的商业要求而进行的实际可行的工作计划的设计、维护，确保实现项目的既定商业目标。计划基准是后面跟踪和监控的基础。\n   > 3. 执行过程组：根据前面制定的基准计划，协调人力和其他资源，去执行项目管理计划或相关子计划。\n   > 4. 控制过程组：通过监控和检测过程确保项目达到目标，必要时采取一些修正措施。集成变更控制是一个重要的过程。\n   > 5. 收尾过程组：取得项目或阶段的正式认可并且有序地结束该项目或阶段。向客户提交相关产品，发布相关结束报告，并且更新组织过程资产并释放资源。\n\n3. 项目的特征是什么\n\n   > - 目标性\n   > - 相关性\n   > - 临时性\n   > - 独特性\n   > - 资源约束性\n   > - 不确定性\n\n4. 某公司希望开发一套软件产品，如果选择自己开发软件的策略，公司需要花费30000元，根据历史信息，维护这个软件每个月需要3500元。如果选择购买软件公司产品的策略，需要18000元，同时软件公司为每个安装的软件进行维护的费用是4200元/月。该公司该如何决策？\n\n   > - 自制\n   > 	- 成本30000+维护3500*x\n   >\n   > - 购买\n   > 	- 成本18000+维护4200*x\n   >\n   > > 30000+3500x=18000+4200x\n   > > > x=17.14\n   > > > 如果使用十七月内购买,超过十七月自制\n\n5. 什么是项目章程？\n\n   > 项目章程是项目执行组织高层批准的一份以书面签署的确认项目存在的文件，包括对项目的确认、对项目经理的授权和项目目标的概述等。\n\n6. 在项目招投标阶段，甲乙双方的主要任务分别是什么\n\n   > - 甲方\n   > > 招标书定义、供方选择、合同签署\n   > - 乙方\n   >\n   > > 进行项目选择。\n\n7. 招标书主要包括那几部分内容\n\n   > 技术说明、商务说明和投标说明。\n   >\n   > 1. 技术说明主要对采购的产品或者委托的项目进行详细的描述\n   > 2. 商务说明主要包括合同条款\n   > 3. 投标说明主要是对项目背景、标书的提交格式、内容、提交时间等做出规定\n\n8. 写出三种你熟悉的生存期模型，并说明这些模型适用于什么情况下的项目\n\n   > 1. 瀑布模型\n   > 	适用于软件需求很明确的软件项目，即一般适用于功能明确、完成、无重大变化的软件系统的开发，即：\n   > 	 1.   在项目开始前，项目的需求已经被很好的理解、也很明确，而且项目经理很熟悉为实现这一模型所需要的过程。\n   > 	 2.   解决方案在项目开始前也很明确。\n   > 	 3.   短期项目可采用瀑布模型。\n   > 2. V模型\n   > 适用于项目需求在项目开始前很明确、解决方案在项目开始前也很明确，项目对系统的安全很严格，如航天飞机控制系统、公司的财务系统等。\n   > 3. 快速原型模型\n   > 适用于项目的需求在项目开始前不明确，需要减少项目的不确定性的时候。\n\n9. 下图是SPM项目需求规格文档中的一个用例图，请根据图中信息判断参与者是什么角色？并写出至少三个用例，如登录、注册等\n\n   ![微信图片_20220525103245.png](https://images.ptausercontent.com/27a7c8cf-20b4-430a-ace0-dbdd8f48f6a1.png)\n\n   >1. 参与者的角色是课务管理系统中的学生用户\n   >2. 用例：登录、注册、选课\n\n10. 我们常常从哪些方面着手处理需求不明确的问题\n\n    > 1. 让用户参与开发\n    > 2. 开发用户界面原型\n    > 3. 需求讨论会议\n    > 4. 强化需求分析和评审\n\n11. 写出任务分解的方法和步骤\n\n    > 1. 确认并分解项目的组成要素(WBS编号)。\n    > 2. 确定分解标准，按照项目实施管理的方法分解，而且分解的标准要统一\n    > 3. 确认分解是否详细，是否可以作为费用和时间估计的标准，明确责任\n    > 4. 确定项目交付成果（可以编制WBS字典）\n    > 5. 验证分解正确性。验证分解正确后，建立一套编号系统。\n    > 	任务分解方法：\n    > 	1. 模板参照方法\n    > 	2. 类比方法\n    > 	3. 自上而下\n    > 	4. 自下而上\n\n12. 当项目过于复杂是，可以对项目进行任务分解，这样做的好处是什么\n\n    > 将一个项目分解为更多的工作细目或者子项目，使项目变得更小、更易管理、更易操作，这样可以提高估算成本、时间和资源的准确性，使工作变得更易操作，责任分工更加明确。\n\n13. 检验任务分解结果的标准是什么\n\n    > 1. 最底层的要素是否是实现目标的充分必要条件\n    > 2. 最底层要素是否有重复的\n    > 3. 每个要素是否清晰完整定义\n    > 4. 最底层要素是否有定义清晰的责任人\n    > 5. 是否可以进行成本估算和进度安排 \n\n14. 项目经理正在进行一个图书馆信息查询系统的项目估算，他采用Delphi的专家估算方法，邀请了3位专家进行估算，第一位专家给出了2万元、7万元、12万元的估算值，第二位专家给出了4万元、6万元、8万元的估算值，第三位专家给出了2万元、6万元、10万元的估算值，试计算这个项目的成本估算值。\n\n    > 1. $Ei=\\frac{ai+4mi+bi}{6}=\\frac{2+4*7+12}{6}=7$\n    > 2. $Ei=\\frac{ai+4mi+bi}{6}=\\frac{4+4*6+8}{6}=6$\n    > 3. $Ei=\\frac{ai+4mi+bi}{6}=\\frac{2+6*7+10}{6}=6$\n    > - $Ei=\\frac{7+6+6}{3}=6.33$\n\n15. 如果某软件公司正在进行一个项目，预计有50KLOC的代码量，项目是中等规模的半嵌入型的项目，采用中等COCOMO模型，项目属性中只有可靠性为很高级别（即取值为1.3），其他属性为正常（书上说，正常就是1），计算项目是多少人月的规模，如果是2万元/人月，则项目的费用是多少？\n\n    > $$Effort=a*(KLOC)^b*F$$\n    > $$a=3,b=1.12,F=1$$\n    > $$Effort=3*50^{1.12}*1.3*1=311.82(人月)$$\n    > 所以项目的费用为$2* Effort=623.64万元$\n\n16. 已知某项目使用C语言完成，该项目共有85个功能点，请用IBM模型估算源代码行数、工作量、项目持续时间、人员需要量以及文档数量\n\n    > C语言代码行与功能点的关系近似为150LOC/FP，所以，85个功能点代码行数为L85*150=12750行=1.75KLOC\n    > - 工作量估算$E=5.2*L0.91=5.2*12.750.91≈52.725(人月)$\n    > - 项目时间$D=4.1*L0.36=4.1*12.750.36≈10.25(月)$\n    > - 人员需求量$S=0.54*E0.6=0.54*52.7250.6≈5.829(人)$\n    > - 文档数量 $DOC=49*L1.01=49*12.751.01≈640.857(页)$\n\n17. 对一个任务进行进度估算时，A是乐观者，估计用6天完成，B是悲观者，估计用24天完成，C是有经验者，认为最有可能用12天完成，那么这个任务的历时估算介于10天到16天的概率是多少？\n\n    > $E=\\frac{6+24+4*12}{6}=13,δ=\\frac{24-6}{6}=3$\n    > $E-δ=10$\n    > $E+δ=16$\n    > 所以任务历时估算介于10——16天的概率为：68.3%\n\n18. 请将下图所示的PDM（优先图法）网络图改画为ADM（箭线法）网络图\n\n    ![7-2.png](https://images.ptausercontent.com/1cf24354-30bd-4466-a90d-9e27da04605c.png)\n\n    > ![PDM转ADM 18](https://s2.loli.net/2022/06/05/f2SWXn9zj7VDkqG.png)\n\n19. 根据下面任务流程图和下表给出的项目历时估算值，采用PERT方法估算，求出项目在14.57天内完成的概率的近似值\n\n    ![7-3.png](https://images.ptausercontent.com/7961cdc9-5c51-46ba-897c-dad53064d86b.png)\n\n    > $E1=\\frac{2+6+4*3}6=\\frac{20}6$\n    > $E2=\\frac{4+8+4*6}6=6$\n    > $E3=\\frac{3+6+4*4}6=\\frac{25}6$\n    >\n    > 任务方差、标准差分别为：\n    >\n    > |          | 标准差δ    | 方差δ2          |\n    > | :------- | :--------- | :-------------- |\n    > | 任务1    | $\\frac4 6$ | $\\frac{16}{36}$ |\n    > | 任务2    | $\\frac4 6$ | $\\frac{16}{36}$ |\n    > | 任务3    | $\\frac3 6$ | $\\frac{9}{36}$  |\n    > | 项目路径 | $1.07$     | $\\frac{41}{36}$ |\n    >\n    > 所以，$E= E1+ E2+ E3=13.5天$，δ=1.07\n    > E-δ=12.43，E+δ=14.57			[12.43，14.57]的概率为：68.3%\n    > E-2δ=11.36，E+2δ=15.64			[11.36，15.64]的概率为：95.5%\n    > E-3δ=10.29，E+3δ=16.71			[10.29，16.71]的概率为：99.7%\n    >\n    > 所以，项目在14.57天内完成的概率为：50%+68.3%/2=84.15%\n\n20. 简述质量保证的主要活动，以及质量保证的要点\n\n    > 质量保证的主要活动是项目执行过程审计和项目产品审计。\n    > 质量保证的要点是\n    > > 1. 对项目进行评价\n    > > 2. 推测能否达到质量指标\n    > > 3. 建立对项目的信心\n\n21. 简述质量保证与质量控制的关系\n\n    > - 质量保证（QA）是通过评价项目整体绩效,建立对质量要求的信任，提供项目和产品可视化的管理报告。这个任务本身并不能提高产品的质量，但是通过质量保证的一系列工作可以间接地提高产品的质量。质量保证一般由质量保证部门人员实施。\n    > - 质量控制（QC）是确定项目结果与质量标准是否相符,同时,确定消除不符的原因和方法，它控制产品的质量，及时纠正缺陷。这个任务本身提高产品的质量，一般由开发人员实施。\n    >\n    > 质量保证是后期质量活动，质量控制是前期质量活动。它们是有区别的:质质量保证是针对项目实施过程的管理手段，质量控制是针对项目产品的技术手段;实施质量保证是针对过程改进和审计的，强调的是过程改进和信心保证。实施质量控制是按照质量要求，检查具体可交付成果的质量，强调的是具体的可交付成果。\n\n22. 质量计划中可以采用哪些方法\n\n    > 1. 试验设计：试验设计是一种统计学方法，确定哪些因素可能会对特定变量产生影响。\n    > 2. 基准对照：是一种寻找最佳实践的方法，是利用其他项目的实施情况作为当前项目性能衡量的标准。\n    > 3. 质量成本分析：质量计划必须进行质量成本的综合分析，以便决定质量活动。\n    > 4. 流程图方法：可以显示系统的各种成分是相互的关系，帮助我们预测在何处可能发生何种质量问题。\n    > 5. 因果分析图：也称鱼刺图。描述相关的各种原因和子原因如何产生潜在问题或影响，将影响质量问题的“人员、设备、参考资料、方法、环境”等各方面的原因进行细致的分解，方便地在质量计划中制定相应的预防措施。\n\n23. 【场景】\n    B公司中标某网络视频公司系统运维项目，甲方位于内蒙古呼和浩特市的数据中心，并签署了运维合同。合同明确了运维对象包括服务器，存储及网络等设备，并约定：核心系统备件四小时到场；非核心系统各件24小时到场 ；80%以上备件需满足上述时效承诺，否则视为违约。\n    B公司任命小赵担任该项目的项目经理，为确保满足服务承诺，小赵在呼和浩特市建立了备件库，招聘了专职备件管理员及库房管理员，考虑到备件成本较高，无法将服务器、存储和网络设备的所有备件都进行储备，备件管理员选择了一些价格较低的备件列入《备件采购清单》，并经小赵批准后交给了采购部。随后采购部通过网站搜索发现C公司能够提供项目所需全部备件且价格较低，于是确定C公司作为备件供应商并签署了备件采购合同。\n    项目实施三个月后，甲方向公司投诉，一是部分核心系统备件未能按时到场，二是部分备件加电异常，虽然补发了备件，但是影响了系统正常运行。\n    针对备件未能按时到场的问题，小赵通过现场工程师了解到：一部分核心系统备件没有储备；二是部分备件在库存信息中显示有库存，但调取时却找不到。为此需要临时从C公司采购，延误了备件到场时间。\n    针对备件加电异常的问题，小赵召集采购部、库房管理员、C公司召开沟通会议，库房管理员认为C公司提供的备件质量存在严重问题，但无法提供相应证据。C公司则认为，供货没有问题，是库房环境问题导致备件异常，因为C公司人员送备件到库房曾多次发现库房温度、湿度超标。采购部人员观点与库房管理员一致，原因是采购部通过查询政府采购网等多家网站发现，C公司去年存在多项失信行为记录，大家各执一词，会议无法达成共识。\n\n    【问题】：\n\n    1. （5分）请说明采购管理的主要步骤。\n    2. （10分）结合案例，请指出，项目采购管理中存在的问题。\n    3. （5分）请简述采购货物入库的三个条件。\n\n    > - 采购管理主要步骤\n    >\n    > > 1. 需求确定和采购计划的制订\n    > > 2. 供应商的搜寻与分析\n    > > 3. 定价\n    > > 4. 拟定并发出定单\n    > > 5. 订单的跟踪和跟催\n    > > 6. 验货与收货\n    > > 7. 开票和支付货款\n    > > 8. 记录管理\n    >\n    > - 项目采购管理中存在的问题\n    >\n    > > 1. 没有编制采购管理计划\n    > > 2. 备件管理员选择了一 -些价格较低的备件存在问题,不能为了节约成本选择价格低的备件,可能存在质量问题\n    > > 3. 实施采购存在问题,采购部通过网站搜索发现B公司能够提供备件就签署了备件采购合同，应该对供应商进行调查和评估\n    > > 4. 控制采购存在问题,部分核心系统备件未能按时到场,部分备件加电异常。\n    > > 5. 库存管理存在问题,部分备件在库存信息中显示有库存,但调取时却找不到。\n    > > 6. 采购合同存在问题,责任、违约、索赔没有定义清晰。\n    > > 7. 采购记录管理存在问题,没有对采购过程进行详细的记录\n    >\n    > - 货物入库的三个条件\n    >\n    > > 1. 采购产品验证完毕后,检验合格的产品,《进货检验记录单》作为办理入库的条件。\n    > > 2. 库房核对采购设备对应项目准确无误。\n    > > 3. 供应商提供的运货单或者到货证明。\n\n\n', '软件项目管理1-8章课后题');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 判断题\n\n1.  - [ ] 一个软件配置项可能有多个标识。\n2.  - [ ] 基线提供了软件开发阶段的一个特定点。\n3.  - [x] 有效的项目管理能够控制变化，以最有效的手段应对变化，不断命中移动的目标。\n4.  - [x] 一个（些）配置项形成并通过审核，即形成基线。\n5.  - [ ] 软件配置项是项目需定义其受控于软件配置管理的款项，每个项目的配置项是相同的。\n6.  - [ ] 基线的修改不需要每次都按照正式的程序执行。\n7.  - [ ] 基线产品是不能修改的。\n8.  - [ ] 基线修改应受到控制，但不一定要经SCCB授权。\n9.  - [x] 变更控制系统包括从项目变更申请、变更评估、变更审批到变更实施的文档化流程。\n10.  - [ ] 在软件项目配置管理中最终应保证软件产品的完整性、一致性、有效性、机密性。\n11.  - [x] 项目干系人是项目计划的一部分。\n12.  - [ ] 项目型的优点是可以资源共享。\n13.  - [ ] 应尽量多建立一些沟通渠道。\n14.  - [x] 项目沟通的基本原则是及时性、准确性、完整性和可理解性\n15.  - [x] 在IT项目中，成功的最大威胁是沟通的失败\n16.  - [x] 责任分配矩阵是明确项目团队成员的角色与职责的有效工具\n17.  - [ ] 口头沟通不是项目沟通的方式\n18.  - [x] 对于紧急的信息，应该通过口头的方式沟通；对于重要的信息，应采用书面的方式沟通\n19.  - [x] 人员计划描述项目的团队人员时候，以及如何加入和离开团队\n20.  - [x] 沟通计划包括确定谁需要信息，需要什么信息，何时需要信息，以及如何接收信息等\n21.  - [x] 人员管理计划没有明确的具体体现形式，作为项目计划的一部分，其详细程度因项目而异\n22.  - [x] 任何项目都是有风险的。\n23.  - [x] 风险是损失发生的不确定性，是对潜在的、未来可能发生损害的一种度量。\n24.  - [x] 风险识别、风险评估、风险规划、风险控制是风险管理的4个过程。\n25.  - [x] 应对风险的常见策略是回避风险、转移风险、损失控制和自留风险。\n26.  - [ ] 项目的风险几乎一样。\n27.  - [ ] TOP风险清单中的条目越多越好。\n28.  - [ ] 当风险发生的概率极高、风险后果影响很严重时，才可以考虑采用回避风险策略。\n29.  - [ ] 软件项目外包的实质是软件开发过程从公司内部部分或者全部延伸到公司外部的过程\n30.  - [ ] 如果一个项目的合同类型是固定价格（FFP），合同价格是100万元，实际花费是160万元，则项目结算金额为160万元\n31.  - [x] 成本加奖金（CPIF）合同居右激励机制\n32.  - [x] 合同类型有成本补偿合同、固定价格合同和单价合同\n33.  - [ ] 选择合同类型时，应该屏蔽工作成果、供应商等因素，是选择更加精确\n34.  - [x] 招标书可以是合同计划的输出\n35.  - [x] 范围和成本成一定的正比关系\n36.  - [ ] 进度和成本是关系最为密切的两个要素，几乎成对立关系，进度的缩短一定依靠成本增加实现，而成本的降低也一定已牺牲工期进度为代价\n37.  - [x] 项目管理过程是一个集成的过程，范围计划、进度、成本、质量、风险是相互联系的\n38.  - [ ] 软件项目管理的最重要的四个要素是范围、质量、进度和风险\n39.  - [x] 记录反映当前项目状态的项目性能数据是控制项目的基础。\n40.  - [x] 项目进度成本控制的基本目标是在给定的限制条件下，用最短时间、最小成本、以最小风险完成项目工作。\n41.  - [x] 代码走查是在代码编写阶段，开发人员自己检查自己的代码。\n42.  - [ ] 在使用应急法压缩进度时，不一定要在关键路径上选择活动来进行压缩。\n43.  - [x] 累计费用曲线中某时间点ACWP比BCWS高，意味着在这个时间点为止，实际的成本要比计划的高，二者之间的差值就是成本差异。\n44.  - [ ] CPI=0.90说明目前的预期成本超出计划的90%。\n45.  - [x] 技术评审的目的是尽早发现工作成果中的缺陷，并帮助开发人员技师消除缺陷，从而有效的提高产品质量。\n46.  - [ ] 软件测试的目的是证明软件没有错误。\n47.  - [ ] 麦克勒格的X理论是参与理论。提示：Y理论属于参与理论\n48.  - [ ] 产品提交之后，如果甲方提出修改一些功能，对于这个维护需求，我们应该及时给予维护。\n49.  - [x] 风险管理是连续的过程。\n50.  - [x] 管理干系人参与和控制干系人参与都是干系人管理的任务。\n51.  - [x] 敏捷生存期模型中的每天站立会议是很有效的一种沟通方式。\n52.  - [ ] 有大量文件说明就能保证项目成功。\n53.  - [x] 项目验收过程是甲方对乙方交付的产品或服务进行验收检验，以保证它满足合同条款的要求。\n54.  - [x] 项目计划中确定的可交付成果已经出现，项目的目标已经成功实现时，可终止项目。\n55.  - [ ] 项目没完成时，不能终止项目。\n56.  - [x] 一个项目的交付验收，意味着项目的结束。\n57.  - [ ] 只有项目成功完成了，才说明项目结束了。\n58.  - [ ] 项目经验教训总结是项目结束的一个重要输出。\n59.  - [x] 当一个项目的目标已经实现，或者明确看到目标已经不可能实现时，项目就应该终止。\n60.  - [ ] 项目的最后评审是不必要的。\n\n\n# 选择题\n\n1. 下列不属于SCCB的职责的是（）\n   - [ ] 评估变更\n   - [ ] 与项目管理层沟通\n   - [ ] 对变更进行反馈\n   - [x] 提出变更申请\n2. 为了更好地管理变更，需要定义项目基线，关于基线的描述，下列描述正确的是（）\n   - [ ] 不可变化\n   - [x] 可以变化，但是必须通过基线变更控制流程处理\n   - [ ] 所以的项目必须定义基线\n   - [ ] 基线发生变更时，必须修改需求\n3. 软件配置管理无法确保以下哪种软件产品属性（）\n   - [x] 正确性\n   - [ ] 完整性\n   - [ ] 一致性\n   - [ ] 可控性\n4. 变更控制需要关注的是（）\n   - [ ] 阻止变更\n   - [x] 标识变更，提出变更，管理变更\n   - [ ] 管理SCCB\n   - [ ] 客户的想法\n5. 以下哪项不是项目配置管理中可能遇到的问题？（）\n   - [ ] 找不到某个文件的历史版本\n   - [x] 甲方与乙方在资金调配上存在意见差异\n   - [ ] 开发人员未经授权修改代码或文档\n   - [ ] 因协同开发中，或者异地开发，版本变更混乱导致整个项目失败\n6. 以下哪项不是项目配置管理中可能遇到的问题？（）\n   - [ ] 找不到某个文件的历史版本\n   - [x] 甲方与乙方在资金调配上存在意见差异\n   - [ ] 开发人员未经授权修改代码或文档\n   - [ ] 因协同开发中，或异地开发，版本变更混乱导致整个项目失败。\n7. 项目经理花在沟通上的时间是（）\n   - [ ] 20%-40%\n   - [x] 75%-90%\n   - [ ] 60%\n   - [ ] 30%-60%\n8. 在（    ）组织结构中，项目成员没有安全感\n   - [ ] 职能型\n   - [ ] 矩阵型\n   - [x] 项目型\n   - [ ] 弱矩阵型\n9. 下列关于干系人的描述中，不正确的是（）\n   - [ ] 影响项目决策的个人、群体或者组织\n   - [ ] 影响项目活动的个人、群体或者组织\n   - [ ] 影响项目结果的个人、群体或者组织\n   - [x] 所有项目人员\n10. 编制沟通计划的基础是( )\n      - [x] 沟通需求分析\n      - [ ] 项目范围说明书\n      - [ ] 项目管理计划\n      - [ ] 历史资料\n11. 对于项目中比较重要的通知，最好采用（）沟通方式\n      - [ ] 口头\n      - [x] 书面\n      - [ ] 网络方式\n      - [ ] 电话\n12. 在一个高科技公司，项目经理正在为一个新的项目选择合适的组织结构，这个项目涉及多的领域和特性，他应该选择（）组织结构\n      - [x] 矩阵型\n      - [ ] 项目型\n      - [ ] 职能型\n      - [ ] 组织型\n13. 在项目管理的3种组织结构中，适用于主要由一个部门完成的项目或技术比较成熟的项目组织结构是（）\n      - [ ] 矩阵型组织结构\n      - [ ] 项目型组织结构\n      - [x] 职能型组织结构\n      - [ ] 都一样\n14. 在3种组织结构中，（）组织结构是目前最普遍的项目组织形式，它是一个标准的金字塔型组织形式\n      - [ ] 矩阵型\n      - [ ] 项目型\n      - [x] 职能型\n      - [ ] 都一样\n15. 项目经理在一个高科技公司，现在正在为一个新的项目选择合适的组织结构，这个项目涉及很多的领域和特性、他应该选择那种组织结构？（）\n      - [ ] 矩阵型\n      - [ ] 项目型\n      - [x] 职能型\n      - [ ] 组织型\n16. 项目团队原来有4个成员，现在人员扩充，又增加了4个成员这样沟通渠道增加了（）\n      - [x] 4.7倍\n      - [ ] 两倍\n      - [ ] 4条\n      - [ ] 无法确定\n17. 以下说法错误的是（）\n      - [ ] 团队是一定数量的个体成员的集合\n      - [x] 团队包括自己组织的人、供应商、分包商、客户\n      - [ ] 团队应注重个人发挥，应该将某项任务分工给擅长该技术的职员\n      - [ ] 团队的目的是开发出高质量的产品\n18. 下列不属于项目风险的三要素的是（）。\n      - [ ] 一个事件\n      - [x] 事件的产生原因\n      - [ ] 事件发生的概率\n      - [ ] 事件的影响\n19. 下列属于可预测风险的是（）。\n      - [ ] 不现实的交付时间\n      - [ ] 没有需求或软件范围的文档\n      - [x] 人员调整\n      - [ ] 恶略的开发环境\n20. 下列不是风险管理过程的是（）\n      - [ ] 风险评估\n      - [ ] 风险识别\n      - [ ] 风险规划\n      - [x] 风险收集\n21. 下列说法错误的是（）。\n      - [ ] 项目风险的3个要素是一个事件、事件发生的概率、事件的影响\n      - [ ] 风险规划的4个过程是风险识别、风险评估、风险规划、风险控制\n      - [ ] 风险规划的主要策略是回避风险、转移风险、损失控制、自留风险\n      - [x] 项目风险是由风险发生的可能性决定的\n22. 在一个项目的开发过程中采用了新的技术，为此，项目经理找来专家对项目组人员进行技术培训，这是什么风险应对策略？（）。\n      - [ ] 回避风险\n      - [x] 损失控制\n      - [ ] 转移风险\n      - [ ] 自留风险\n23. 下列不属于风险评估方法的是（）。\n      - [ ] 盈亏平衡分析\n      - [ ] 模拟法\n      - [ ] 决策树分析\n      - [x] 二叉树分析\n24. 下列不属于项目风险的三要素的是（）。\n      - [ ] 一个事件\n      - [ ] 事件发生的概率\n      - [x] 风险值\n      - [ ] 事件的影响\n25. 以下各项关于回避风险的陈述除了（）都是正确的。\n      - [x] 风险倘若发生，就接受后果\n      - [ ] 决定不对风险过高的项目进行投标\n      - [ ] 消除引起风险的因素\n      - [ ] 决定取消采用具有高风险的新技术，而采用原来熟悉的技术\n26. 下列合同类型中，卖方承担的风险最大的是（）\n      - [ ] 成本加成本百分比\n      - [ ] 成本加固定费\n      - [ ] 成本加奖金\n      - [x] 固定价格\n27. 某项目采用成本加奖金的成本补偿类合同，当预算成本为20万元，利润4万元，且奖励分配为80/20时，如果实际成本降至16万元，则项目总价为（）。\n      - [ ] 24万元\n      - [ ] 23.2万元\n      - [x] 20.8万元\n      - [ ] 20万元\n28. 合同是需要靠（）约束的。\n      - [ ] 双方达成的共识\n      - [ ] 道德\n      - [ ] 责任\n      - [x] 相关法律法规\n29. 下列与签署合同没有关系的是（）\n      - [x] 设计模版\n      - [ ] 协议附件\n      - [ ] 招标文件\n      - [ ] 评估标准\n30. 合同激励可以使（）。\n      - [ ] 乙方节约成本\n      - [ ] 甲方节约成本\n      - [ ] 增加乙方成本\n      - [x] 合同双方的目标和利益得到协调\n31. 可以在（）阶段采用制造/购买决策分析。\n      - [ ] 卖方选择\n      - [x] 立项（采购计划编制）\n      - [ ] 合同管理\n      - [ ] 成本计划\n32. 下列合同类型中，买方承担的风险最大的是（）\n      - [x] CPPC成本加成本百分比\n      - [ ] CPIF成本加奖金\n      - [ ] FPIF固定成本加奖金\n      - [ ] FFP 固定价格\n33. 项目将近收尾的时候，项目职员更关注将来能够分配的任务，而不是当前的项目，下列哪项是当前职员的需要？（）\n      - [ ] 生理需求\n      - [x] 自我实现\n      - [ ] 安全\n      - [ ] 受人尊敬\n34. 项目集成管理包括以下内容，除了（）\n      - [ ] 对计划的集成管理和项目跟踪控制的集成管理\n      - [ ] 保证项目各要素协调\n      - [x] 软件设计文档\n      - [ ] 在相互影响的项目目标和方案中做出权衡\n35. 设成本C是范围S、质量Q、进度T的一个函数C=F（S，Q，T），在成本或时间不充足的情况下，可以通过减小范围或者（）来解决。\n      - [ ] 提高质量\n      - [ ] 增加项目成员\n      - [x] 降低质量\n      - [ ] 以上均不行\n36. 项目管理过程中的进度目标，成本目标，质量目标，范围目标等各个目标之间是（）\n      - [ ] 相互独立\n      - [x] 相互关联和制约的\n      - [ ] 进度目标最重要\n      - [ ] 没有关系的\n37. 下列不属于项目管理计划的是（）\n      - [ ] 数据里程碑\n      - [ ] 数据进度\n      - [x] 数据库设计\n      - [ ] 风险清单\n38. 下列不属于软件项目管理要素的是（）\n    A．范围\n      - [ ] 质量\n      - [x] 交互\n      - [ ] 成本\n39. 项目集成计划具有以下几个特点，除了（）\n      - [ ] 综合性\n      - [ ] 全局性\n      - [ ] 内外兼顾性\n      - [x] 针对性\n40. 在一个项目会议上，一个成员提出增加任务的要求，而这个要求超出了WBS确定的项目基线，这时项目经理提出项目团队应该集中精力完成而且仅完成原来定义的范围基线，这是一个（）的例子。\n      - [ ] 范围定义\n      - [x] 范围管理\n      - [ ] 范围蔓延\n      - [ ] 范围变更请求\n41. 项目原来预计于2014.5.23完成1000元的工作，但到2014.5.23只完成850元工作，而为了这些工作花费900元，则成本偏差和进度偏差分别是（）\n      - [x] CV=50元，SV=-150元\n      - [ ] CV=-50元，SV=-150元\n      - [ ] CV=-50元，SV=-50元\n      - [ ] CV=-50元，SV=-150元\n42. 如果成本效能指标CPI=90%，他说明（）\n      - [ ] 目前项目成本超出90%\n      - [x] 投入1元产生0.9元的效果\n      - [ ] 项目完成的时候，将超支90%\n      - [ ] 项目已经完成计划90%\n43. 进度控制重要的一个组成部分是（）\n      - [x] 确定进度偏差是否需要采取纠正措施\n      - [ ] 定义为项目的可交付成果所需要的活动\n      - [ ] 评估WBS定义是否足以支持进度计划\n      - [ ] 确保项目队伍的士气高昂\n44. 当项目进展到（）左右时，CPI处于稳定。\n      - [ ] 10%\n      - [x] 20%\n      - [ ] 30%\n      - [ ] 40%\n45. 抽样统计的方法中，（）\n      - [ ] 应该选择更多的样品\n      - [x] 以小批量的抽样为基准进行检验\n      - [ ] 去定大量或批量产品质量的唯一方法\n      - [ ] 导致更高的成本\n46. 资源平衡最好用于（  ）活动。\n      - [ ] 时间很紧的\n      - [ ] 按时的\n      - [ ] 非关键路径\n      - [x] 关键路径\n47. 下面不是质量控制3个要点之一的是（）\n      - [x] 确定人员分配是否合理\n      - [ ] 检查项目结果\n      - [ ] 依据相关质量标准进行跟踪检查\n      - [ ] 去定消灭质量问题的措施\n48. 移情聆听需要理解他人的观点，为了展示移情聆听的技巧，项目经理应该（）。\n      - [ ] 检查阐述的内容是否正确\n      - [x] 重复他人的内容，并且有感情色彩\n      - [ ] 评估内容并提出建议\n      - [ ] 重复\n49. 对于冲突而言，下面哪个说法是正确的？（）\n      - [ ] 冲突是坏事情\n      - [x] 冲突尝尝是有利的事情\n      - [ ] 冲突是由捣乱分子制造的\n      - [ ] 应该避免冲突\n50. 项目培训特点不包括（）\n      - [ ] 时间短\n      - [x] 连续性\n      - [ ] 针对性强\n      - [ ] 见效快\n51. “为什么大家不能都让一步解决这个问题呢？”，这是哪种冲突解决方法的体现？（）\n      - [ ] 解决问题（confrontationorproblemsolving）\n      - [x] 妥协（compromise）\n      - [ ] 强迫方式（forcingmode）\n      - [ ] 撤退（withdrowal）\n52. 项目中的小组成员要同时离开公司，项目经理首先应该（）。\n      - [x] 实施风险计划\n      - [ ] 招募新员工\n      - [ ] 与人力资源经理谈判\n      - [ ] 修订计划\n53. 客户接受项目的交付结果之前，项目经理应该做什么？\n      - [x] 检查交付结果的质量\n      - [ ] 修改合同款项\n      - [ ] 开具项目完成的发票\n      - [ ] 给项目成员分配新的项目\n54. 不包括在项目验收过程中的是（）。\n      - [ ] 完成项目收尾工作\n      - [ ] 项目成果评价\n      - [ ] 准备项目验收材料\n      - [x] 项目总结\n55. 软件项目收尾工作应该做的事情不包括（）。\n      - [x] 人员角色选择\n      - [ ] 范围确认\n      - [ ] 质量验收和产品交付\n      - [ ] 费用决算和项目文档验收\n56. 下列除了哪项，其他都可以是项目终止的条件？（）\n      - [ ] 项目计划中确定的可交付成果已经出现，项目的目标已经成功实现\n      - [ ] 项目已经不具备实用价值\n      - [ ] 项目由于各种原因而导致无限期拖长\n      - [x] 项目需求发生了变化\n57. 下列不是项目成功与失败的标准是（）。\n      - [ ] 是否实现目标\n      - [ ] 可交付成功如何\n      - [ ] 是否达到项目客户的期望\n      - [x] 项目人数庞大\n58. 在项目的末期，与卖方的合同还有尚未解决的索赔，项目经理（）。\n      - [ ] 可能将合同收尾工作转交给其他人员\n      - [ ] 通过审计来澄清索赔原因\n      - [ ] 不能进行收尾工作\n      - [x] 进行合同收尾，合同收尾之后，可能采取法律行动\n59. 项目接近结束的时候，如果客户希望对项目范围进行大的变更，项目经理应该如何做？\n      - [ ] 进行变更\n      - [x] 告诉客户变更带来的影响\n      - [ ] 拒绝变更\n      - [ ] 不理会\n\n# 主观题\n\n\n\n写出三种你熟悉的生存期模型，并说明这些模型适用于什么情况下的项目。\n\n> 1. 瀑布模型\n>    适用于软件需求很明确的软件项目，即一般适用于功能明确、完成、无重大变化的软件系统的开发，即：\n>   2. 在项目开始前，项目的需求已经被很好的理解、也很明确，而且项目经理很熟悉为实现这一模型所需要的过程。\n>   3. 解决方案在项目开始前也很明确。\n>   4. 短期项目可采用瀑布模型。\n> 5. V模型\n>    适用于项目需求在项目开始前很明确、解决方案在项目开始前也很明确，项目对系统的安全很严格，如航天飞机控制系统、公司的财务系统等。\n> 6. 快速原型模型\n>    适用于项目的需求在项目开始前不明确，需要减少项目的不确定性的时候。\n\n下图是SPM项目需求规格文档中的一个用例图，请根据图中信息判断参与者是什么角色？并写出至少三个用例，如登录、注册等。\n\n![微信图片_20220525103245.png](https://images.ptausercontent.com/27a7c8cf-20b4-430a-ace0-dbdd8f48f6a1.png)\n\n> 1. 参与者是课务管理系统中的学生用户\n> 2. 登录、注册、选课\n\n我们常常从哪些方面着手处理需求不明确的问题？\n\n> 1. 让用户参与开发\n> 2. 开发用户界面原型\n> 3. 需求讨论会议\n> 4. 强化需求分析和评审\n\n写出配置管理的基本过程\n\n> 1. 配置项标识、跟踪\n> 2. 配置管理环境建立\n> 3. 基线变更管理\n> 4. 配置管理审计\n> 5. 配置状态统计\n> 6. 配置管理计划\n\n说明软件配置控制委员会（SCCB）的基本职责\n\n> 1. 评估变更\n> 2. 批准变更申请\n> 3. 在生存期内规范变更申请流程\n> 4. 对变更进行反馈\n> 5. 与项目管理层沟通\n\n写出几个常见的软件配置项\n\n> 1. 软件项目计划\n> 2. 需求分析结果\n> 3. 软件需求规格说明书\n> 4. 设计规格说明书\n> 5. 源代码清单\n> 6. 测试规格说明书\n> 7. 测试计划\n> 8. 测试用例与实验结果\n> 9. 可执行程序\n> 10. 用户手册\n> 11. 维护文档\n\n写出5种以上项目沟通方式\n\n> 1. 书面沟通和口头沟通\n> 2. 语言沟通和非语言沟通\n> 3. 正式沟通和非正式沟通\n> 4. 单向沟通和双向沟通\n> 5. 网络沟通\n\n对于特别重要的内容，你认为一般采用哪些方式才能确保有效沟通 \n\n> 对于特别重要的内容，要采用多种方式进行有效沟通确保传达到位，除发送邮件外还要电话提醒、回执等，重要的内容还要通过举行各种会议进行传达\n\n一个项目在进行规划的时候，碰到了一个风险问题，项目经理决定是否采用方案A。如果采用方法A需要使用一个新的开发工具，而能够掌握这个工具的概率是30%，通过使用这个工具可以获利5万元，如果采用方案A而不能掌握这个工具，将损失1万元。利用决策树分析技术说明这个项目经理是否应该采用这个方案A？（绘制决策树）\n\n> ![决策树分析练习-第 2 页](https://s2.loli.net/2022/06/17/Fx8SlRz2fObKH7Z.png)\n\n企业在今年有甲乙两种产品方案可以选择，每种方案的状态、收益和概率如表11-11所示，绘制决策树时，判断哪种方案将有更大收益。\n表每种方案的状态、收益和概率\n\n![3213.png](https://images.ptausercontent.com/afa3d769-deaf-4b31-8c8f-867e1125d1fb.png)\n\n> ![决策树分析练习-第 3 页.drawio](https://s2.loli.net/2022/06/17/zIogdYXyTr8PEUa.png)\n\n一种成本加奖金的合同类型，项目的激励比是80/20，估计成本是12万元，利润是1万元，如果实际成本是12万元，计算合同金额为多少？如果实际成本为11万元，则这种情况合同金额是多少？\n\n> 成本加奖金合同，激励比80/20;估计成本12万，利润1万。如实际成本12万，则合同金额为：12+1=13万；如实际成本为11万，则合同金额为：11+1+（12-11）20%=12.2万\n\n描述项目执行控制的基本步骤\n\n> 1. 建立计划标准\n> 2. 观察项目的性能\n> 3. 测量和分析结果\n> 4. 采取必要措施\n> 5. 做好计划修订工作，控制反馈。\n\n某项目由4四个任务构成，该项目目前执行到第6周末，各项工作在其工期内的每周计划成本、每周实际成本和计划工作量完成情况下表所示：\n\n![微321.png](https://images.ptausercontent.com/e7671d3c-20b2-4e2b-88bd-8271a06a8deb.png)\n\n> 1. 根据提供的信息，计算截至第6周末该项目的BCWS、ACWP、BCWP\n>\n>    ​	BCWS=10+15+5+10+10+10+20+10+5+5 = 100\n>\n>    ​	ACWP=10+16+8+10+10+12+24+12+5+5=112\n>\n>    ​	BCWP=10+15+5+(10+10+10+20+10+10)/2+(5+5+25+5)/2=85 \n>\n> 2. 计算第6周末的成本偏差CV、进度偏差SV，说明结果的实际意义\n>\n>    ​	CV=BCWP-ACWP= 85 - 112= -27\n>\n>    ​	SV=BCWP-BCWS= 85 - 100= -15\n>\n> 3. 按照目前情况，计算完成整个项目实际需要投入多少资金？写出计算公式。\n>\n>    ​	CPI=BCWP**/**ACWP=75.9%\n>\n>    ​	EAC=BAC/CPI=170/75.9% = 224\n\n一个软件项目团队中一般有哪些人员角色？\n\n> 1. 项目经理\n> 2. 架构分析师\n> 3. 系统分析师\n> 4. DBA\n> 5. 程序开发人员\n> 6. 测试人员\n> 7. 系统工程师\n> 8. 质量管理人员\n\n', '软件项目管理9-16章课后题');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('青岛天后宫，始建于明成化三年（1467年），距今已有500多年的历史，是青岛市区现存最古老的明清砖木结构建筑群。 500多年前初建成时，天后宫由三间圣母殿和龙王财神两配殿构成。后历经明、清、民国等七次维修扩建。1996年，青岛市政府对其进行全面修复，并将其辟为＂青岛市民俗博物馆＂，于1998年12月26日正式对外开放。  青岛天后宫现占地面积近4000平方米，建筑面积1500平方米，为二进庭院。其有正殿、配殿、前后两厢、戏楼、钟鼓楼及附属建筑共计殿宇16栋80余间，是一处典型的具有民族风格的古建筑群。除戏楼为琉璃瓦盖顶，其它建筑物均为清水墙、小灰瓦，且经苏州式彩绘点染，雕梁画栋，金碧辉煌。在整个青岛地区的古代建筑中，青岛天后宫的建筑艺术和彩绘艺术都是首屈一指的。 天后宫戏楼大梁的包袱画绘有金陵十二钗等红楼人物，以及春秋故事＂吹箫引凤图＂、＂敦煌飞天图＂等。 天后宫内，古木成荫，绿草茂盛，是典型庙宇与园林风格的有机结合。戏楼两侧是钟楼和鼓楼，前院有四株冬青树，其中靠墙的两株为法国冬青，花坛两边的两株为本地冬青。前院东西厢门前是两株桂花树，每年农历八月十五前后，满树的桂花会使整个院落清香飘溢。 ', '青岛天后宫');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('素有＂海上名山第一＂的青岛崂山位于黄海之滨，主峰1133米，它拔海而立，山海相连，雄山险峡，水秀云奇，自古被称为＂神仙窟宅＂＂灵异之府＂。《齐记》中亦有＂泰山虽云高，不如东海崂＂的记载。昔日秦皇汉武帝登临此山寻仙，唐明皇也曾派人进山炼药，历代文人名士都在此留下游踪，号称＂道教全真天下第二丛林＂。盛时有九宫、八观、七十二庵，崂山道士更是闻名遐迩。山上奇石怪洞，清泉流瀑，峰回路转。人景观和自然景观交相辉映的崂山，1982年被国务院首批确定为国家重点风景名胜区之一，并被林业部确定为国家森林公园。进崂山可分为中、南、东三线，其景色各异。1989年，崂山风景管理委员会成立，对崂山旅游资源的保护、开发起了重要作用。目前，青岛崂山风景名胜区总面积446平方公里，由巨峰、流清、上清、太清、棋盘石、仰口、北九水、华楼、登瀛9个风景游览区和沙子口、王哥庄、北宅、夏庄、惜福镇5个风景恢复区及外缘陆海景点3部分组成。近年来，崂山规划开辟了南线、东线、中线三条游览，修建了太清、仰口、华楼三条索道，并开辟了海上游览航线。现在，崂山以成为以观光度假为重点的我国著名旅游风景名胜区。 主要游览线路： 目前崂山游览线路共有四条。其中陆路三条（南线，东线，中线）水路一条。 1. 南线：由香港东路或东海路向东经沙子口，登瀛，流清河奔太清宫，主要游览太清景区。如果时间允许，可再去上清景区或去巨峰景区；也可去棋盘石景区。此条游览路线距离近，可观几个著名景点，并可当天轻松往返。一般旅行社能安排走这条线，也是最繁忙的崂山旅游线路。 乘坐旅游专线车或几个包乘出租车十分方便，可减轻登陆山之劳累。如乘104路，113路，304路公交车也可游此线。 2. 东线：由李沧区李村出发，先向北转东，经惜福，王哥庄到仰口主要游览仰口景区，如果早晨出发时间较早，游览行程紧凑，剩余时间较多，可向南游览棋盘石景区或直奔太清景区由南线返回。 根据同行人员数量，包乘中巴车或出租轿车，一日内可游完东线和南线主要景点。若乘123路，312路，106路公交车，一般只能游览东线。 3. 中线：也是由李沧区李村出发，向东经北龙口转北，经北宅，乌衣巷赴北九水景区。若时间允许，此线可于途中游览华楼景区；亦可驱车经柳树台攀巨峰，步行过潮音瀑亦可达巨峰。由大崂观可转赴仰口景区。 可包乘出租车或乘107路，110路，311路，365路公交车抵达。 4. 水路：由青岛湾旅游码头乘船游览海上风光，在太清湾登陆，主要游览太清，上清景区。', '青岛崂山风景名胜区');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('青岛植物园始建于一九七六年，面积1500亩，位于市区太平山景区南麓。西邻中山公园、动物园，北靠榉林公园，东接革命烈士纪念馆、湛山寺，南望八大关。园内建有森林乐园、植物精品园、中日友好园、法国楼、听涛阁、水榭等景点。1994年6月青岛植物园正式对外开放，是以林木花卉等观赏植物为主的集科研科普、花木培育及观赏游览于一体的综合性旅游景观。园内汇萃了国内外具有较高欣赏价值的各类花木四百余种，其中珍稀濒危植物近八十种。 1995年，我园被市有关部门确定为全市纪念树栽植点。2001年8月份，我园被评为国家级\\\"AA\\\"级旅游景点，2002年初又被市科协命名为\\\"市科普教育基地', '青岛植物园');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('海军博物馆由海军创建。是中国唯一的一座全面反映中国海军发展的军事博物馆。坐落于青岛市莱阳路八号，东邻鲁迅公园、西接小青岛公园、南濒一望无际的大海、北与栈桥隔水相望。占地四万多平方米。1989年10月1日正式对外开放。海军博物馆现包括军服礼品展厅、武器装备展区、海上展舰区和海战史展室，展出面积达40000多平方米。馆藏的数千件珍贵文物，从不同侧面反映了人民海军从无到有、不断壮大的光辉历程。军服礼品展厅主要展出古代、近代中国海军、人民海军历史资料图片1200余幅，人民海军各时期的制式服装、衔章、徽章、装具和人民海军与世界各国友好交往中接受的230多件珍贵礼品等；武器装备展区和海上展舰区主要陈列退出海军战斗序列的中小型舰艇、飞机、导弹、舰（岸）炮、水中兵器、观通设备、水陆坦克等。其中重要展品有：敬爱的周总理检阅驻青岛海军舰艇部队时乘坐过的鱼雷快艇、军委主席邓小平检阅过的“巨浪一号”潜地导弹、海军首任司令员肖劲光大将乘坐过的飞机和红旗轿车、独闯国民党舰艇巢穴的炮艇“解放”号、海军第一代水上飞机；海上展舰区设在小青岛港区，展出了人民海军第一代驱逐舰“鞍山”号，我国01型舰舰导弹护卫舰“成都”号和首次公开对外展出的33型常规潜艇“长城”号。海军博物馆是增强全民海洋意识，进行爱国主义教育的好课堂。先后被青岛市、山东省定为爱国主义教育基地，并入选国家教委和共青团中央在全国确定的100个爱国主义教育基地之一。通过参观，人们将会看到人民海军在中国共产党的领导下，在艰苦创业、在战斗中成长、在曲折中前进，不断发展壮大的光辉历程。', '青岛海军博物馆');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('国内第一座由企业出资兴建的现代化产业科技馆--海尔科技馆在青岛市高科园东部建成。海尔科技馆创建于1998年并于1999年6月1日正试对外纳客。海尔科技馆座落于美丽的黄海之滨，南依石老人黄金海岸，西邻世纪广场、青岛啤酒城，北临山东省国际会展中心，建筑面积1万平方米。它与美丽的海尔工业园交相辉映，以展示末来社会生活为主题，成为青岛独特的文化科技旅游景观。 科技馆内设世界家电发展史厅、海尔家电发展史厅、21世界未来家庭、未来社会、三维动感电影院、网络教室及高科技展馆，共25个项目。集科技性、教育性、娱乐性于一身，融家电产业历史、文化、科技于一体，并运用高科技手段，为您开启一扇通向未来的大门。 ', '青岛海尔科技馆');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('青岛海滨风景区是国务院1982年首批公布的国家级风景区，也是首批4A国家旅游区。景区位于青岛市市南区前海一线，西起团岛，东至大麦岛，全长25公里，陆地面积8.4平方公里，海域面积5平方公里，并环抱团岛湾、青岛湾、汇泉湾、太平湾和浮山湾，背倚观象山、观海山、信号山、青岛山、太平山和浮山，具有依山面海的优越地理环境，旅游资源类型丰富，是国内少有的身处城市中心的海滨风景区。 从20世纪初开始，青岛由一处军事重镇、商埠逐步发展成为城市，并因为这里空气清新，景色宜人，而被世人誉为避暑、疗养胜地。二、三十年代，国内一大批学者、文化界人士云集青岛，使得青岛成为当时中国的文化重镇。同时，国内的达官显贵及外国商人也进入青岛，活跃了青岛的工业、商业和建筑业。不同国籍、不同地域的文化在这里产生碰撞和融汇，为青岛初期的城市建设构筑了特定的理念：半个多世纪中，\\\"碧海、蓝天、绿树、红瓦、黄墙\\\"及依山就势、鳞次栉比的优美建筑成为青岛独占鳌头的风光特色。 改革开放以来，青岛市突破原有的思维模式，向着现代化国际城市的目标奋进，市区向东、西两个方向拓展，市区东部建成成片的高楼大厦。与之相匹配，新建的道路也不再狭窄蜿蜒，大手笔的景点建设更富有现代特色。城市的发展建设不但完整地保留了海滨原有的风光特点，使现代化景点与自然景点相得益彰，而且对原来的风景区、风景点进一步美化和亮化。景区内的景点，既能各自独立又可彼此相连，其中有八大峡公园、栈桥景区、小青岛、鲁迅公园、小鱼山、百花苑、汇泉广场、八大关景区、五四广场、东海路、香港路等公园、广场和绿地，每年吸引着近千万中外游客前来观光游览。 景区西部海岸线蜿蜒曲折，坡度平缓。栈桥汹涌的海浪，小青岛白色的灯塔，鲁迅公园幽深的黑松林，海水浴场开阔的沙滩以及岸边各具特色的建筑形成了自然与人文合一的美丽景观。青岛十大美景，此处占据七八，其中\\\"琴屿飘灯\\\"、\\\"飞阁回澜\\\"已成为青岛壮观景象的代表。 随着青岛市市区东扩，景区东部近几年得到很大的发展，形成了以现代化新城区与海滨风光结合的新景观，东海路和香港路就是其中的代表作，这两条景观大道，按功能和主题不同划分成许多园区，每个园区都建有绿地、广场和主题雕塑，占地面积10万平方米的五四广场被大树、草坪和繁花所围绕，其主题雕塑五月的风象一支燃烧的火炬，象征着青岛的蓬勃向上，不断发展。 八大关景区除有秀丽的海滨风光外，还汇萃了24个国家200余种风格的建筑，是迄今为数不多的、保存完好的多国风格建筑群，被誉为万国建筑博览馆。为纪念在青岛工作和生活过的、成绩卓著的文化名人而改建的百花苑青岛文化名人雕塑园（亦称百花苑）；岛城第一座古典园林小鱼山；新开辟的居民区活动广场八大峡公园；举办大型节庆活动的汇泉广场等，都是青岛旅游的美好去处。 近几年，青岛市的城市建设和发展突飞猛进，海滨风景区各项设施也不断完善，旅游咨询、导游、购物、食宿、交通等服务功能越来越健全，景区的环境面貌发生了很大的变化，一个大青岛、大旅游的格局已经形成。', '青岛海滨风景区');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('位于太平山东麓，中国近代兴建的最后一批佛教名刹之一。 \n\n![](https://ts1.cn.mm.bing.net/th/id/R-C.a2ebd9487625c8626df36c441b0ec709?rik=93yzDk6rrAJZGg&riu=http%3a%2f%2fyouimg1.c-ctrip.com%2ftarget%2ftg%2f486%2f276%2f694%2f9ae8690b37844c25bec5d1a6f47fd363.jpg&ehk=Gyuxe%2bc7UJDjJXzVNrzyhooJALn2MBsZiQuwMfUiLUk%3d&risl=&pid=ImgRaw&r=0)\n1931年夏，南京国民政府交通部长叶恭绰（解放后任全国政协委员，中国画院院长）和佛学家周叔迦等来青岛避暑，见到道教盛行，佛寺罕见，决定募捐在青岛建造寺庙。\n\n![image.png](https://oss.ashes.vip/Travel/tactic/102594f8-8884-4968-80a5-0bf603b91799.png)\n\n工程自1934年4月开工， 1945年全部竣工，历经5期。 湛山寺坐北向南，是一座五进院落。依地势北高南低，拾阶而上，第一进为山门。山门外台阶右侧有放生池，小桥石栏，风景颇秀。山门前一对石狮为明代遗物，正门横匾“湛山寺”。第二进为天王殿，供奉弥勒菩萨。第三进为大雄宝殿，是全寺主殿，供奉佛教创始人释迦牟尼、文殊菩萨、普贤菩萨。第四进为三圣殿，门上有“海印遗风”匾额，是为纪念明末高僧憨山大师。殿内供阿弥陀佛、观世音菩萨、大势至菩萨。第五进为藏经楼。寺内佛像皆为杭州陆启塑造，多姿多态，栩栩如生。寺院东南侧山丘上建有7级浮屠，名“药师琉璃光如来宝塔”，常称“药师塔”。 湛山寺三面依山，南眺大海，周围风光秀丽。夏季绿阴匝地，海风习习；秋季霜叶如染，是赏秋佳地。著名作家郁达夫曾赞为“湛山一角夏如秋。\n\n”20～30年代，湛山周围曾一度成为中外富绅咸集之避暑颐养区。山南曾辟有高尔夫球场，海边曾辟湛山海水浴场（第四海水浴场）。 \n\n30年代初湛山寺的开光、佛学会、佛教学校的开办及湛山庙会的兴盛曾一度带动形成青岛的宗教旅游。文化大革命中，湛山寺遭严重破坏，现已修整对外开放，成为青岛宗教旅游产品的重要组成内容之一。 1982年，青岛市人民政府将湛山寺列为市级重点文物保护单位。', '青岛湛山寺');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('位于胶南琅琊镇，东临龙湾，西靠琅琊镇，北依车轮山，南有千古名胜琅琊台， 与青岛隔海相望。区内规划有环境优雅的多功能区，是旅游名胜、欣赏风光的好去处。琅琊台古有我国五大港口之称，因秦始皇三度东临，筑台并遣徐福东度求仙，开启中日文化交流先河而蜚声海内外。现经过开发建设，已成为吸引国内外游客的琅琊台风景名胜旅游区。琅琊台前的斋堂岛因秦始皇登临琅琊台在岛上斋戒而得名。距陆地仅0.4公理。面积0.4平方公里。岛上有三个自然村，街道整齐，房舍一新，树木苍翠，景致宜人，是胶南市最富裕的海岛村。岛上居民以捕捞为业。民俗观光旅游是这里的一大特色', '青岛琅琊台风景区');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('青岛，美丽的山海之城。因为有了山、有了海，青岛也便具有了别样的灵秀和魅力。有人说，青岛美得像一首音乐，起伏错落的山头拉出了一曲舒缓的旋律，依山傍海的带有异域风情的红屋顶的建筑、沿海岸线各处迷人的风景是她起伏的旋律中一个个跳动的音符，而这首音乐中，最高的音符便是青岛旅游观光塔--海拔348米。在鲜花掩映中抬头望去，青岛旅游观光塔像一位风姿绰约的少女俏然屹立在山头，这便是青岛十佳景点之一--太平天音。太平，是指青岛旅游观光塔脚下的太平山；天音，天籁之音，便是能让人产生无尽遐想、魅力无穷的青岛旅游观光塔。 太平山位于青岛旅游中心地带的榉林公园，中山公园、动物园、百花苑·文化名人雕塑园、湛山寺环绕周围。青岛旅游观光塔便屹立在海拔110米的太平山头。除具有广播电视发射功能之外，青岛旅游观光塔还是一个观光、餐饮、娱乐、购物、休闲的绝好去处。自1996年正式开业以来，登塔的中外游客已近280万人次。 这里是唯一能把岛城全貌看得清清楚楚的地方，也是最能体会青岛\\\"红瓦绿树、碧海蓝天\\\"的独特魅力的地方。塔上的旋转餐厅、餐饮包房为您准备了精美的自助餐、淮阳菜系的精致菜点，在岛城最高的地方就餐，边看美景，边享美食，可以体会神仙般的感觉。 2001年4月28日，青岛旅游观光塔塔冠大厅被命名为\\\"青岛奥运大厅\\\"并正式揭牌，这可是全国唯一的奥运大厅。她不仅见证了岛城人民申奥成功之夜的激情，还将见证到岛城人民一步步走向2008。目前，青岛旅游观光塔已成为人们了解奥运、抒发奥运情怀的重要场所。许多与奥运有关的重大活动都在此进行。 随着岛城迎奥运的步伐不断加快，青岛电视观光塔必将成为一个爱国主义的教育基地、一个文化艺术的推广基地、一个全民健身的倡导基地、一个城市发展的了望基地！', '青岛电视观光塔');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('避开黄金周，10月中旬出发去青岛。机票：网上订的春秋99块特价机票，加上50的机场建设费，80的燃油加价费，还有强制的20保险费，往返498rmb住宿：在青岛人家庭旅馆网上的订的一套两室一厅（1张大床2张小床1个厨房2个卫生间），180块一晚，据说跟黄金周相比打了5折，需先付一晚的定金，网站才会为你保留并发确认短信，同时会给你一个房东的联系方式，接下来的事情就直接和房东联系。PS：房东提供接机服务，比正常打车稍贵，我们当时讲好是80块10月13号上午7:50从上海虹桥出发，9点多到达青岛流亭机场。因为提前和房东讲好来接机的，故起飞前在机场告知他具体起飞时间，结果竟然关机，登机后起飞前又打了一次，还是关机。到达青岛，立马开机，再打过去，谢天谢地，总算是开机了，听语气似乎是还没有到机场，一番折腾后，总算是顺利到达了住处。住处在海游路，旁边是个建筑工地，很是荒凉，那房子其实是被隔成了2套，只用木板隔开，隔音效果奇差，旁边那套屋里的人说个话，就跟在咱屋里一个样，条件相当一般。幸而交通比较方便，有各路公交发往崂山，台东，栈桥等处。入住，交300定金以及2天的房租（之前付的180定金算一天房租）午饭：云霄路46号海岛渔村。中午人少，挑了个靠窗的桌子，点了网上盛传的辣炒蛤蜊，椒盐虾虎，另加凉粉，酸辣鱼丸汤及酸辣娃娃菜，特别喜欢辣炒蛤蜊：）；退了2.5元一份的纸巾，用自己带的。下午游五四广场，八大关，花石楼（门票5元），信号山公园（门票15元），栈桥。然后兜了兜中山路，号称是青岛最繁华的商业街。晚饭：中山路美达尔烤肉。从栈桥走到这里至少半个小时。5点半左右，人颇少，整个二楼就我们一桌，网上传惊为天人的电烤鱿鱼一般，真的一般，老的很；烤鸡翅，烤板筋，小菜什么的，都只能算中等水平。不知道是不是我们来的时候换厨师了，确实是让我们小小的失望了一把。10月14号崂山崂山之行，选了条最省心省力的经典南线，坐了一个多小时车（公交304路），9点左右到达八水河，到景区入口处工作人员会上车要求买票，联票70，60岁以上的老年人士半价优惠。在山下看到些奇怪的水果，禁不住，买了俩崂山长寿果和莲花果，奸商说是4斤多，被骗去35大洋。硬的要死，啃不动。一路上看到了龙潭瀑，去了明霞洞（门票4元），见到了崂山道士，吃了甜的石花菜凉粉，用凉凉的崂山泉水洗了手，坐了太清索道（单程30，双程50），传闻太清宫不是很好玩，也就没去了。下午1点多就坐车回了。下午去家乐福转了转，发现家乐福里面的烤鱿鱼特别好吃，肉嫩酱香。晚饭去了北大荒人饭店，主要是东北菜，量大，价格中等偏上，要了3个菜，两个人根本吃不完，打包带走了一半。人数多的话比较适合去这里。10月15号上午：极地海洋世界，就在海游路附近，走过去15分钟。门票全价120，我们在淘宝上找了个卖优惠门票的，以90元/张购入2张，只需提前一天联系，第二天在景区附近等就可以。60岁老年人士可以享受半价60元的优惠（直接在海洋世界售票处买即可）。因为是一期工程，后续的二期其他设施还在建设中，所以里面不是特别好玩，除了海豚，白鲸表演比较吸引眼球，其余基本没什么看点，看看饲养员喂鱼，打扫。极地风情表演就是找了几个菲律宾人，在那儿可劲儿甩头发，咿咿呀呀唱歌。中午不到，我们就出馆了。中饭就在极地的KFC解决了。下午去了登州路上的啤酒博物馆（门票50元，60岁以上半价），分A馆和B馆，个人感觉A馆没什么好参观的，就是看一些青岛啤酒厂的历史介绍。B馆比较好玩，实时的车间操作挺好看的，我从没见过那么多啤酒，易拉罐的，玻璃瓶的，中途送的原浆啤酒味道甚好，佐酒的啤酒豆也不赖，可惜只有一小杯和一小袋。醉酒小屋挺好玩的，走进去就重心失调，东倒西歪的。出口处又送了一扎原浆啤酒，我们4人喝了个过瘾。还有个纪念品商店，可以买到啤酒豆，啤酒以及很多有趣的小玩意儿。晚饭：黄家麦岛菜市场买了2个硕大的梭子蟹，25元一斤，2个总共95块。虾虎10块1斤，买了16块钱。用最简单的烹饪方式，放水，盐，姜煮了，吃的时候就着醋和蒜蓉，美味无比啊。不一会儿就被我们消灭干净。', '青岛省钱攻略');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('1897年德国侵占青岛时，胶澳德国总督的官邸选择在当时被称为大石头山（今信号山）的半山腰上。德国总督相当于中国地方军队的最高武官--提督，故此楼又俗称\\\"提督楼\\\"。该建筑始建于1905年，1908年正式入住。它是德国威廉时代典型的建筑式样、建筑材料与青年风格派手法相结合的德式建筑，现在二十世纪初建造的这种风格的房屋在欧洲大陆甚至德国也不多见了。它由德国建筑师拉查鲁维茨设计，该建筑面积为4083平方米，耗资巨大，超过原规定的标准，以至于建筑总监施特拉塞尔不得不接受传讯，到总会计署申辩理由。 迎宾馆的外部建筑气势雄伟，内部是宫庭式木质结构，外观为古堡式，高度为30米的外墙以黄色为基调，局部以花岗岩作装饰，石料加工粗朴，正门墙上由淡绿色、淡灰色花岗岩石组成光芒四射的太阳纹饰，墙角伸出一根粗大的石柱，由之引出的\\\"锚链\\\"环系于太阳四周，以石料凿成帆结作装饰，在波浪饰檐头上伸出一只诺曼底龙头。窄小的圆拱窗壁下镶有精雕的石料窗饰。米红色筒瓦、蓝色鱼鳞瓦、绿色牛舌瓦铺设楼顶，使大楼更加精美别致。1957年环绕迎宾馆修建了围墙形成了占地面积达86000多平方米的庭院，院内遍植果树和多种观赏植物。 ', '青岛迎宾馆（德式官邸旧址）');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 软件项目团队计划\n\n## 团队计划\n\n### 人员职责计划\n\n#### 项目组织结构主要类型\n\n1. 职能型\n\n - 以部门为主体承担项目\n - 可以一个部门承担多个，也可多个部门承担一个\n  - 适合于由一个部门完成的项目或技术比较成熟的项目\n  - 优点：充分发挥职能部门的资源集中优势，便于相互交流，相互支援\n  - 缺点：项目和部门利益发生冲突的时候会丢失项目目标，资源平衡也会出现问题\n\n2. 项目型\n\n- 单目标垂直的组织方式\n- 一个项目一个项目组，项目完成后就解散\n- 以项目经理为首\n- 优点：项目经理对项目负全责，以项目为中心\n- 缺点：资源不能共享，对成员缺少连续性和安全感\n\n3. 矩阵形\n\n- 职能型和项目型混合\n- 从部门中选择合适的项目成员，组成临时的项目组\n- 优点：专职的项目经理 以项目为中心\n- 缺点：容易引起项目经理和职能经历之间的利益冲突，资源共享也会引发冲突\n\n#### 人员职责计划\n\n1. 责任分配矩阵RAM\n\n- 对项目团队成员进行项目分工，明确角色和职责\n\n2. 组织分解结构OBS\n\n- 按照组织现有的部门，单元或团队进行排列，并列出工做任务\n\n3. 文本型\n\n### 干系人计划\n\n- 干系人是能够影响项目决策，活动或者结果的个人，群体或者组织以及会受到或者自认为会受到项目决策，活动或者结果形象的个人，群体或者组织\n- 让项目干系人对项目有正向的影响\n\n### 沟通计划\n\n- 在IT项目中，成功最大的威胁就是沟通的失败\n- 确定谁人需要信息，需要什么信息，何时需要信息，以及如何将信息分发给他们\n- 沟通的方式\n  1. 书面沟通和口头沟通\n  2. 语言沟通和非语言沟通\n  3. 正式沟通和非正式沟通\n  4. 单向沟通和双向沟通\n  5. 网络沟通\n- 沟通的分类\n  1. 内部与外部\n  2. 正式与非正式\n  3. 上级沟通，下级沟通，横向沟通\n  4. 书面与口头\n- 沟通渠道数量\n  - $I=E(E-1)/2$\n  - 渠道越少越好\n    1. 项目组织图\n\n## 敏捷团队计划\n\n### 敏捷的角色\n\n1. 产品负责人\n2. 团队促进者(Scrum主管)\n3. 跨职能团队人员(开发团队)\n\n### 敏捷团队\n\n- 最有效的敏捷团队往往由三到九个成员组成\n- 理想情况下，敏捷团队应该集中在一个工作场所工作\n- 团队100%为专职成员，协同工作\n- 敏捷鼓励自我管理团队\n- 仆人式领导\n  1. 仆人式管理是通过团队服务来领导团队的\n  2. 注重理解和关注团队成员的需要和发展\n  3. 仆人式管理为团队赋权\n  4. 旨在使团队尽可能达到最高绩效\n\n### 沟通\n\n- 高度透明', '项目管理day10');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 软件项目风险计划\n\n## 风险管理过程\n\n### 风险定义\n\n-  风险是对潜在的，未来可能发生损害的一种度量，如果风险确实发生了，则会对项目产生有害的或者负面的影响\n-  软件风险对软件开发过程及软件产品本身可能造成的伤害或损失\n\n### 风险类型\n\n#### 预测角度\n\n1. 已知风险\n2. 可预测风险 过去项目经验\n3. 不可预测风险\n\n#### 范围角度\n\n1. 商业风险\n2. 管理风险\n3. 人员风险\n4. 技术风险\n5. 开发环境风险\n6. 客户风险\n7. 过程风险\n8. 产品规模风险\n\n##### 风险三要素\n\n1. 风险事件\n2. 事件概率\n3. 事件影响\n\n#### 风险管理的四个过程\n\n下节\n\n## 风险管理计划\n\n### 风险识别\n\n- 识别事件系统化确定对项目计划的威胁，识别已知和可预测的风险\n\n  #### 德尔菲方法\n\n  - 选择相关的领域专家，与专家建立直接的函询联系，整理后再匿名返回给各位专家，连续三五次，到所有专家意见趋向一致\n\n  #### 头脑风暴法\n\n  - 专家小组内通过专家会议，激发专家创造性思维，获取相应的分析\n\n  #### 情景分析法\n\n  - 类似于撰写电影剧本，对变化进行情景或画面的描述\n\n  #### 利用风险条目检查表\n\n  - 最常用\n  - 根据条目的回复检查风险\n\n### 风险评估\n\n- 对风险事件发生概率的评估，对项目风险形象的评估，给出项目风险的排序\n\n  #### 分析\n\n  	- 风险发生的概率$P$\n  	- 风险对项目的影响$I$\n  	- 风险值$R=F(P,I)$\n\n  #### 确定优先次序\n\n  - 按风险值排序\n  - 确定最需要关注的TOP风险\n\n  #### 定型风险评估\n\n  - 定型评估风险概率及后果\n\n  #### 定量风险评估\n\n  1. 盈亏平衡分析\n\n     确定项目成本和收益相等时盈亏平衡点的一种分析方法\n\n  2. 敏感性分析\n\n     考察与软件项目有关的一个或多个主要因素发生变化时对该项目投资价格指标的影响程度\n\n  3. 决策树分析(最常用)\n\n     - 图表分析方法\n     - 提供项目所有可供选择的行动方案.行动方案之间的关系,行动方案的后果以及发生的概率\n     - 提供一个最佳的方案的依据\n     - 决策树与EMV\n       - EMV(损益期望值)是决策树的一种计算值\n       - 根据预期结果,发生的概率计算出一种期望的损益\n       - EG方案成功率50%,收益是10 $EMV=10*50%=5$\n\n  4. 模拟\n\n     运用概率以及理论统计方法来预测和研究各种不确定因素对软件项目投资价格指标的定量分析\n\n### 风险规划\n\n- 针对风险分析的结果，制定一定的行动和策略来对付，减少，以至于消灭风险事件造成的影响\n- 主要策略\n  1. 回避风险\n     - 对于可能发生的风险尽可能的规避,采取主动放弃或者拒绝使用导致风险的方案\n     - 可以直接消除风险的损失\n     - 例如放弃使用新技术\n     - 可能会产生新的风险\n  2. 转移风险\n     - 为了避免承担风险损失有意识将损失或与损失有关的财务后果转嫁出去的方法\n     - 例如外包,开脱责任合同,保险\n  3. 损失控制\n     - 损失预防\n       - 项目技术培训\n       - 预防技术失败\n     - 损失抑制\n       - 项目人员储备\n       - 抑制人员流失的损失\n  4. 自留风险\n     - 由项目组织自己承担风险所致损失的措施\n\n#### 敏捷项目风险应对方法\n\n- 损失预防与损失抑制策略\n  - 跨职能项目团队(识别风险)\n  - 选择迭代内容(选择风险小的)\n  - 频繁评审增量产品\n  - 持续测试可以及早发现问题\n  - 客户参与可减少需求变更的风险\n- 敏捷项目存在风险\n  - 没有长期计划,识别一些风险比较困困难\n  - 没有长期规划,存在变更\n\n### 风险控制\n\n- 在项目执行过程中实施和监控风险计划，同时，不断的进行风险识别，风险分析，风险规划的过程', '项目管理day11');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 软件项目合同计划\n\n## 项目合同类型\n\n - 项目采购\n   - 为了执行项目而从项目团队外部获取产品,服务或者结果的过程称为采购\n - 合同\n   - 合同是具有法律效力的协议\n   - 双方自愿达成的协议\n   - 签订这具有相应的法律能力\n   - 有充分的签约理由 \n   - 具有合法的目的\n-  合同类型\n  - 成本补偿合同\n    - 向卖方支付为完成工作而发生的全部合法实际成本,外加一笔费用作为卖方的利润\n    - 适用于工作范围预计会在合同执行期间发生重大变更\n    - 类型\n      - 成本加固定费用\n      - 成本加激励费用\n      - 成本加奖励费用\n  - 总价合同\n    - 总价合同为既定产品,服务或者成果的采购设定一个总价\n    - 这种合同应该在已明确定义需求,且不会出现重大范围变更的情况下使用\n    - 类型\n      - 固定总价(最常用)\n      - 固定价格加奖励费\n      - 总价加经济价格调整\n  - 工料合同(上两种综合)\n    - 客户必须为每一个单位的工作量付出一定的报酬\n    - 是成本补偿合同和总价合同的特点混合型合同\n    - 例如\n      - 工程师单价130美元/工时\n      - 产品单价1500元/功能点\n\n## 项目合同计划\n\n- 合同计划\n  - 明确合同如何进行委托,委托什么项目,何时进行,费用如何等\n  - 选择需要的合同类型,采用的招标方式,合同形式等\n- 输出形式\n  - 招标书或者类似招标书的形式体现\n  - 敏捷宣言认为客户协作高于合同协商\n  - 敏捷的合同 策略\n    - 多层协议结构\n    - 价值交付\n    - 总价增量\n    - 灵活总价方案\n    - 动态范围方案\n\n- 价值交付\n  - 基于价值驱动的进行迭代交付\n- 总价增量\n  - 是不限定项目总预算而是讲范围分解为一些微型交付成果,例如以story为单位的交付成果单独计算成本预算,可以很好的控制成本预算\n- 灵活总价方案\n  - 如果再合同期限之前交付,则可对供应商的高效率进行奖励,相反如果供应商延迟交付,则扣除一定费用.如果敏捷供应商在仅完成一半范围时便可交付足够的价值,且客户不再需要另一半范围,则不必支付这部分费用\n- 动态范围方案\n  - 对具有固定预算的合同,供应商可为客户提供在项目特定点改变项目范围的方案', '项目管理day12');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 项目集成计划执行控制\n\n## 项目集成计划\n\n![image-20220529172954352](https://s2.loli.net/2022/05/29/B8EvsCUqF2hg5mz.png)\n\n- 项目的进度目标和成本目标关系是最近的\n- 工期与质量也有关系\n\n### 项目管理重要的四个要素\n\n- 范围(S)\n- 质量(Q)\n- 进度(T)\n- 成本(C)\n- $C=F(S,Q,T)$\n  - C与S正比\n  - C与Q正比\n  - C与T反比\n\n## 项目集成计划管理\n\n- 对项目每个专项项目进行层层协调,满足项目相关人员的利益要求和期望\n- 基本步骤\n  1. 建立标准\n  2. 采集项目实际数据\n  3. 实际结果与计划比较\n  4. 决定是否修正计划\n  5. 修正计划协调各方\n\n## 敏捷项目集成管理\n\n- 敏捷方法能促进团队成员以及相关领域专家的身份参与整合管理\n- 项目经理的关注点在于营造一个合作型的决策氛围\n- 对具体产品的规划和交付授权交给团队来控制\n- 确保团队有能力应对变更\n- 变更过程可视为一个敏捷项目', '项目管理day13');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 软件项目成本计划\n\n1. 软件项目规模:工作量,例如:软件规划,软件管理,需求分析,系统设计,编码,测试,以及后期维护等任务\n2. 软件项目成本:\n   	1. 完成软件规模相应付出的代价\n    	2. 待开发的软件项目需要的资金\n    	3. 人的劳动的消耗所需要的代价是软件产品的主要成本\n    	4. 货币单位\n\n## 代码行估算法(不常用)\n\n- 从软件程序量的角度定义项目规模\n- 与具体的编程语言有关\n- 功能分解足够详细\n- 有一定的经验数据\n- 容易计算,但没有标准\n\n## 功能点估算(Albrecht适用于信息系统)\n\n- 与实现的语言和技术无关\n- 用系统的功能数量来测量其规模\n- 通过评估,加权,量化得出功能点\n- 功能点=UFC未调整功能点计数*TCF技术复杂度因子\n\n### UFC-未调整功能点计数\n\n#### UTC\n\n1. 外部输入\n   	- 穿越外部边界进入系统内部\n2. 外部输出\n   - 经过内部逻辑的处理提供面向应用的分析\n3. 外部查询\n   - 一个输入引出一个及时的简单输出\n   - 没有处理过程 \n4. 外部接口文件\n   - 用接口将信息传送给另一个系统\n   - 提供的数据之能被引用\n5. 内部逻辑文件\n   	- 系统边界内的文件\n   	- 通过外界输入来维护\n\n根据IFPUG功能点得出五项UTC的定级,再与组件复杂度相乘后得到UFC\n\n所有的UFC相加\n\n### TCF-技术复杂度因子\n\n![image-20220407090034151](https://s2.loli.net/2022/04/07/fPQEOGlsip7y3cF.png)\n\n每个因子可取的范围\n\n![image-20220407090233553](https://s2.loli.net/2022/04/07/dvpFh7ORkPlDbWg.png)\n\n(十四项因子相加后得出的总数)*0.01+0.65=TCF\n\n0.65<=TCP<=1.35\n\n## 用例点估算法\n\n基于需求用例视图的估算方法\n\n1. 计算未调整的角色权值UAW\n   - 角色数*相应的权重之和\n   - ![image-20220407091241338](https://s2.loli.net/2022/04/07/JsKngODMoZ3ASlY.png)\n2. 计算未调整的用例权值UUCW\n   - 用例数*相应的权重之和\n   - ![image-20220407091332548](https://s2.loli.net/2022/04/07/bG7NCudFKYoJX6z.png)\n3. 计算未调整的用例点UUCP\n   - UAW+UUCW\n4. 计算技术和环境因子TEF\n   1. 技术因子TCF\n      - ![image-20220407091602561](https://s2.loli.net/2022/04/07/J2Ol9q8neYHz65Z.png)\n      - 影响等级在0-5之间\n      - (技术因子的权值之和 * 相应的影响等级之和 * 0.01)+0.6\n   2. 环境因子ECF\n      - ![image-20220407091942962](https://s2.loli.net/2022/04/07/O8DvhMgl7ZYfm2a.png)\n      - (环境因子的权值之和 * 相应的影响等级之和 * -0.03)+1.4\n5. 计算调整的用例点UCP\n   - UUCP * TCF * ECF\n6. 计算工作量 \n   - Effort=UCP * PF(项目生产率)\n\n## 类比(自顶向下)估算法\n\n根据相似的项目之前的成本数据,来估算本项目的成本\n\n## 自下而上估算法\n\n- 前提是任务分解完成,从最底层的工作包开始,将估算值累加\n- 相对比较准确\n- 他的准确度来源于每个任务的估算情况\n\n## 三点估算法\n\n基于任务成本的三种估算值来计算预期成本的方法\n\n- 最可能成本CM比较现实的估算成本\n- 最乐观成本CO最好情况所得到的估算成本\n- 最悲观成本CP差好情况所得到的估算成本\n\n1. 三角分布CE=(CO+CM+CP)/3\n2. 贝塔分布CE(CO+4CM+CP)/6\n\n## 参数估算法\n\n称为模型估算\n\n1. ![image-20220407094024503](https://s2.loli.net/2022/04/07/vtTH5xLW7mgVbQG.png)\n\n   ![image-20220407094144217](https://s2.loli.net/2022/04/07/kuf8pLoWUJnjHDd.png)\n\n2. COCOMO\n\n   - ![image-20220407094504512](https://s2.loli.net/2022/04/07/4ag9JbLDjnkCsy6.png)\n\n\n\n\n\n# 敏捷任务估算\n\n1. 高层估算:采用轻量级,快速生成\n2. 短期估算:进行详细的估算\n\n工作量的估算采用StoryPoint故事点,度量一个Story需要付出的工作量相对估算\n\n相对估算\n\n1. Fibonacci七个等级 0 1 2 3 5 8 13\n   - 选取预估为3的StoryPoint的Story\n   - 将需要预估的Story于选取的Story进行比较\n     1. 如果两个工作量差不多,3\n     2. 略少2\n     3. 更少1\n     4. 不需要完成0\n     5. 略多/更多/再多 5/8/13\n     6. 超过13则为Epic,需要分解\n\n\n\n# 成本预算\n\n- 成本预算是将项目的总成本按照项目的进度分摊到各个工作单元去\n- 成本预算的目的是产生成本基线\n\n## 分配项目成本预算\n\n1. 给任务分配资源成本\n   - 根据每个任务的资源分配情况分配\n2. 给任务分配固定资源成本\n   - 当一个项目的资源需要固定数量的资金时,可以向任务分配固定资源成本 \n3. 给任务分配固定成本\n   - 某项任务的成本不变不管任务工期,或使用的资源是什么,任务成本为固定的', '项目管理day6');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('---\n\n---\n\n# 进度管理\n\n## 基本概念\n\n1. 任务定义:为完成项目的各个交付成果所必须进行的多项具体活动\n2. 任务关系(拓扑关系):项目各项任务之间存在一定的关联关系,根据这些关系安排任务之间的顺序\n   - 任务之间的关联关系依据\n     - 强制性依赖关系\n     - 软逻辑关系\n     - 外部依赖关系\n     - 内部依赖关系\n3. 进度管理图示\n\n- 网络图\n  - PDM优先图法:结点表示任务,箭线表示之间的逻辑关系\n    - 方便表示任务之间的各种关系\n    - ![image-20220421084437114](https://s2.loli.net/2022/04/21/ZKVjBfncpwIhC4b.png)\n  - ADM箭线法(双代号网络图):箭线表示任务,两个号唯一确定一个任务 \n    - 虚活动:表示逻辑关系,不需要消耗资源,为了确保两个标号之间只有一个任务\n    - ![image-20220421084944554](https://s2.loli.net/2022/04/21/CJ5sxWthwuQgF6S.png)\n- 甘特图:方便查看任务的工期,开始和结束时间以及资源的信息\n  - ![image-20220421085049724](https://s2.loli.net/2022/04/21/7qO2U5YCFvZjNhl.png)\n- 里程碑图:展示项目中重大工作的完成情况\n- 资源图:项目紧张中资源的情况\n- 燃尽图(敏捷):还有多少任务没有完成\n- 燃起图(敏捷):已经完成了多少任务\n\n## 传统历时估算\n\n计算任务、路径、项目的持续时间\n\n### 传统方法\n\n1. 定额估算\n\n   - $T=Q/(R*S)$\n     - T:活动历时\n     - Q:任务工作量\n     - R:人力数量\n     - S:工作效率(贡献率):1正常\n\n2. 经验导出模型:根据项目数据统计分析得来的\n\n   - $D=a*E^b$\n   - D:进度月单位\n   - E:工作量人月单位\n   - a:2-4之间\n   - b:1/3左右,依赖于项目的自然属性\n\n   1. Walston-Felix模型\n\n      $D=2.4E^0.35$\n\n   2. 基本COCOMO\n\n      $D=2.5E^b$\n\n3. CPM(关键路径法估计):主要体现在进度编排上,估算主要是针对路径的估算\n\n   拓扑图最短工期\n\n   - 通过网络图估算\n   - 每个任务有单一的历时估算\n   - 确定网络图中任务的逻辑关系\n   - 关键路径是网络图中最长的路径\n\n4. PERT(工程评估评审技术)\n\n   - 通过网络图估算\n\n   - 项目中某项单独的活动,存在很大的不确定性\n\n   - 加权算法估算任务历时\n\n     选定三个估算值\n\n     - O是最小估算值:乐观\n     - P是最大估算值:悲观\n     - M是最大可能估算\n     - $E=(O+4m+P)/6$ \n\n   - 利用网络图逻辑关系,确定路径,项目历时\n\n5. 预留分析\n\n   - 应急预留:用来应对已识别的时间储备\n   - 管理预留:用来应对项目范围中不可预见的风险\n\n### 敏捷方法\n\n1. 开发速度稳定前\n   - 举手表决法\n     - 拳头不支持\n     - 五手指支持\n     - 三个手指下有机会和团队讨论反对意见\n     - 不断进行表决,直到所有人都伸出三个手指以上,或同意进入下一个决定\n2. 开发速度稳定后\n   - 基于故事点的生产率的估算\n     - 平均3d/Story Point\n     - 共30Story Point\n     - =90d\n   - 基于迭代生产率的历时估算\n     - 50个Story Point/迭代\n     - 还有500个Story Point\n     - =10个迭代\n\n\n\n## 进度计划编排\n\n### 超前与滞后\n\n- 任务滞后Lag :等待的时间一个项目完成后的另一个项目间断时间\n- 任务超前Lead:将后一个项目时间提前时间段开始\n  - 解决任务的搭接\n  - 对任务可以进行合理的拆分\n  - 缩短项目工期\n\n### 关键路径法\n\n![image-20220421095040441](https://s2.loli.net/2022/04/21/piEVSAz2jxO53eR.png)\n\n- 最早开始时间\n- 最晚开始时间\n- 最早完成时间\n- 最晚完成时间\n- 浮动时间:是一个任务的机动性,他是一个任务在不影响其他任务或者任务完成的情况下可以延迟的时间量\n  - 总浮动:5-1=4\n  - 自由浮动:不影响后置任务的情况下,一个任务可以延迟的时间量小于等于总浮动\n- 关键路径\n  - 时间浮动为0的路径\n  - 网络图中最长的路径\n  - 关键路径是决定项目完成的最短时间\n  - 关键路径上的任何活动延迟都会导致整个项目完成时间的迟\n  - 关键路径不止一条\n\n### 时间压缩法\n\n不改变项目范围的前提下缩短项目工期的方法\n\n1. 应急法(赶工):在最小相关成本增加的条件下,压缩关键路径上的关键活动历时的方法\n\n   也称为时间-成本平衡方法\n\n   - 进度压缩单位成本方法:线性关系\n   - 进度压缩因子方法:非线性方法\n\n2. 平行作业法(快速跟进):采用并行执行任务，加速项目进展\n\n### 资源优化\n\n根据资源的供需情况,调整活动的开始和完成日期.\n\n1. 资源平衡\n   - 在资源需求与资源供给中取得平衡\n2. 资源平滑 \n   - 对进度活动进行调整,从而保证资源最优化.最优效,资源平滑不会改变项目关键路径,完工日期也不会拖延\n\n### 敏捷计划\n\n近期计划和远期计划双重计划,远粗近细\n\n1. 远期计划-发布计划\n2. 近期计划-迭代计划\n\n## 软件项目进度问题模型- SPSP\n\n给定项目任务的工作量,关系需要具备的技能.同时给定人类资源的技能和成本,完成一个合理的进度编排,目标是成本最小,进度最短\n\n$f(x)= W^cos P^cos + W^len P^len$使f(x)达到最小\n\n\n\n# 习题\n\n作为项目经理，你需要给一个软件项目做计划安排，经过任务分解后得到任务A，B，C，D，E，F，G，假设各个任务之间没有滞后和超前，下图是这个项目的PDM网络图。通过历时估计已经估算出每个任务的工期，现已标识在PDM网络图上。假设项目的最早开工日期是第０天，请计算每个任务的最早开始时间，最晚开始时间，最早完成时间，最晚完成时间，同时确定关键路径，并计算关键路径的长度，计算任务F的自由浮动和总浮动.\n\n![习题](https://s2.loli.net/2022/05/18/jPpXVQfNaKFLqeh.png)\n\n![解](https://s2.loli.net/2022/05/18/dLospuK8vQ4qIfM.png)\n\n', '项目管理day7');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 软件项目质量计划\n\n## 软件质量基本概念\n\n软件质量是软件满足明确的说明或者隐含的需求的程度\n\n- 质量模型：人们通常把影响软件质量的特征用软件质量模型来描述\n- 质量的形成： 质量是在开发的过程当中形成的。软件项目的质量在需求阶段 设计阶段 编码阶段已经确定了。后期的检测 修复不能直接提高质量，只是一种打补丁行为或者是一种评估行为\n- 质量成本：\n  1. 预防成本：前期质量成本\n  2. 缺陷成本：后期质量成本\n\n## 软件项目质量活动\n\n- 软件质量管理\n\n  1. 软件质量保证\n  2. 软件质量控制\n\n- 管理的对象\n\n  1. 过程的质量\n  2. 产品的质量\n\n- 质量保证（QA）后期 管理行为\n  将审核的主体与为该主体以前建立的一组规程和标准进行比较\n\n  1. 通过评价项目整体绩效，建立对质量要求的信任\n  2. 提供项目和产品可视化管理报告\n  3. QA不能直接提高本次产品的质量\n\n  - 软件项目质量保证的具体活动\n    1. 项目执行过程的审计\n    2. 项目产品审计\n\n- 质量控制（QC）前期 检查职能\n\n  1. 确定项目结果与质量标准是否相符，同时，确定不符合的原因和消除方法\n  2. 控制产品的质量，及时纠正缺陷\n  3. 例如代码评审，单元测试\n  4. is it right done？\n  5. 直接提高这个产品的质量\n  6. 一般由开发人员实施\n\n  - 质量控制活动\n    1. 测试\n    2. 技术评审\n    3. 代码检查\n    4. 数据分析\n\n## 敏捷质量活动\n\n- 敏捷项目的质量管理特征\n  1. 全程质量审查\n  2. 早发现问题，多版本提交\n  3. 不断进行质量方法评估和改进\n- 具体的敏捷活动\n  1. 结对编程 提高代码质量和项目效率 代码检查行为\n  2. 测试驱动开发 开发功能前，先编写测试代码，然后编写测试用例\n  3. 持续集成与测试 频繁的集成到整体中，对整体进行测试，强调自动化测试\n  4. 不同层面测试 \n     1. 单元测试\n     2. 集成测试\n     3. 系统级测试\n     4. 冒烟测试\n     5. 回归测试\n  5. 验收测试驱动开发 和客户讨论产品的验收标准，创建测试让团队能够编写足够的代码，进行自动化测试，满足标准要求\n  6. 迭代评审 迭代完成后，向相关人员展示迭代版本运行情况，得到用户反馈\n  7. 迭代回顾会议 评审迭代过程 确定是否进行过程改进\n  8. 重构 每个过程之后再逐步完善和设计代码\n\n\n## 软件质量计划\n\n确定项目应达到的质量标准或者目标，同时决定如何满足质量标准的计划安排和方法。为了达到质量目标，需要安排活动和方法，即将质量保证和质量控制活动规划出来\n\n   - 制定质量计划参照方法\n     1. 试验设计\n     2. 基准对照\n     3. 质量成本分析\n     4. 数据图形分析\n        1. 流程图方法\n        2. 因果分析图\n        3. 思维导图', '项目管理day8');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# 软件项目配置管理计划\n\n## 软件配置管理基本概念\n\n- 记录软件产品的演化过程\n- 得到精确的产品配置\n- 最终保证软件产品的完整性，一致性，追溯性，可控性\n\n### 主要功能\n\n1. 版本管理\n2. 变更管理\n3. 其他\n\n### 配置项 （SCI）\n\n- 是受控于软件配置管理的细目，是配置管理的最小单位，即管理的最小文件，需求规格可能是一个文件也可能是多个文件，因此需求规格可以是一个配置项，也可能是多个配置项而且每个配置项也需要定义一个标识符，即文件名\n\n### 基线\n\n- 基线提供了软件生存期中各个开发阶段的一个特定点，标志开发过程一个阶段的结束或者里程碑\n- 一个配置项形成并通过审核形成基线\n- 基线修改需要按照正式的程序执行\n\n\n### 软件配置控制委员会（SCCB）\n\n- 评估变更\n- 批准变更申请\n- 在生存期内规范变更申请流程\n- 对变更进行反馈\n- 与项目管理层沟通\n\n## 软件项目配置管理过程\n\n- 配置项标示与跟踪过程\n- 配置管理环境建立过程\n- 基线变更管理过程\n- 配置管理审计过程\n- 配置状态统计过程\n- 配置管理计划过程\n\n## 敏捷配置管理计划\n\n- 敏捷的一个重要特征是持续交付,配置管理是重要的要素\n\n- 敏捷需要全面配置管理\n\n  - 全面配置管理的基本要求\n\n    1. 代码和编译构建产物的配置管理\n\n       - 制定有效的分支管理策略\n\n         - 基于分支的开发\n           - 每个分支开发周期较长\n           - 开发都在分支上提交\n           - 可能有多个分支是并行的\n\n         - 基于主干的开发(持续交付)\n           - 所有成员代码都提交到主干上\n           - 提交后自动集成进行测试和快速反馈\n\n       - 配置管理工具(git)\n\n    2. 应用的配置管理\n\n    3. 环境的配置管理', '项目管理day9');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('\n<meting-js\n	server=\"netease\"\n	type=\"playlist\"\n	id=\"7374461551\">\n</meting-js>\n\n# 第一章\n\n## 一.填空题\n\n1.  敏捷模型包括（4）个核心价值，对应（12）个敏捷原则。\n2.  项目管理包括（启动过程组）.（计划过程组）.（执行过程组）.（控制过程组）.（收尾过程组）5个过程组。\n\n## 二.判断题\n\n1.  搬家属于项目。（√）\n2.  项目是为了创造一个唯一的产品或提供一个唯一的服务而进行的永久性的努力。（×）\n3.  过程管理就是对过程进行管理，目的是要让过程能够被共享.复用，并得到持续的改进。（√）\n4.  项目具有临时性的特征。（√）\n5.  日常运作存在大量的变更管理，而项目基本保持连贯性的。（×）\n6.  项目开发过程中可以无限制地使用资源。（×）\n7.  相比传统开发的预测性过程，敏捷开发属于自适应过程（√）\n\n## 三.选择题\n\n1. 下列选项中不是项目与日常运作的区别的是（C）\n   A. 项目是以目标为导向的，日常运作是通过效率和有效性体现的。\n   B. 项目是通过项目经理及其团队工作完成的，而日常运作是职能式的线性管理。\n   C. 项目需要有专业知识的人来完成，而日常运作的完成无需特定专业知识。\n   D. 项目是一次性的，日常运作是重复性的。\n\n2. 以下都是日常运作和项目的共同之处，除了（D）\n   A. 由人来做\n   B. 受限于有限的资源\n   C. 需要规划.执行和控制\n   D. 都是重复性工作\n\n3. 下面选项中不是PMBOK的知识域的是（A）\n   A. 招聘管理        B. 质量管理        C. 范围管理        D. 风险管理\n\n4. 下列选项中属于项目的是（C）\n   A．上课        B. 社区保安        C. 野餐活动        D. 每天的卫生保洁\n\n5. 下列选项中正确的是（C）\n   A. 一个项目具有明确的目标而且周期不限\n   B. 一个项目一旦确定就不会发生变更\n   C. 每个项目都有自己的独特性\n   D. 项目都是一次性的并由项目经理独自完成\n\n6. （B）是为了创造一个唯一的产品或提供一个唯一的服务而进行的临时性的努力。\n\n   A. 过程        B. 项目        C. 项目群        D. 组合\n\n7. 下面选项中不是《敏捷宣言》中的内容的是（C）\n   A. 个体和交互胜过过程和工具      \n   B. 可以工作的软件胜过面面俱到的文档    \n   C.  敏捷开发过程是自适应的过程    \n   D. 响应变化胜过遵循计划\n\n8. 下列活动中不是项目的是（C）\n   A．野餐活动        B. 集体婚礼        C. 上课        D. 开发操作系统\n\n9. 下列选项中不是项目的特征的是（C）\n   A. 项目具有明确的目标\n   B. 项目具有限定的周期\n   C. 项目可以重复进行\n   D. 项目对资源成本具有约束性 \n\n## 四.问答题\n\n1. 项目管理知识体系（PMBOK）包括哪10个知识领域？\n\n   答：项目集成管理.项目范围管理.项目时间管理.项目成本管理.项目质量管理.项目人力资源管理.项目沟通管理.项目风险管理.项目采购管理.项目干系人管理\n\n2. 请简述项目管理的5个过程组及其关系。（可简答）\n\n   答：（1）启动过程组：主要是确定一个项目或一个阶段可以开始了，并要求着手实行；定义和授权项目或者项目的某个阶段。\n   （2）计划过程组：为完成项目所要达到的商业要求而进行的实际可行的工作计划的设计.维护，确保实现项目的既定商业目标。计划基准是后面跟踪和监控的基础。\n   （3）执行过程组：根据前面制定的基准计划，协调人力和其他资源，去执行项目管理计划或相关子计划。\n   （4）控制过程组：通过监控和检测过程确保项目达到目标，必要时采取一些修正措施。集成变更控制是一个重要的过程。\n   （5）收尾过程组：取得项目或阶段的正式认可并且有序地结束该项目或阶段。向客户提交相关产品，发布相关结束报告，并且更新组织过程资产并释放资源。\n\n   关系：各个过程组通过其结果进行连接，一个过程组的结果或输出是另一个过程组的输入。其中，计划过程组.执行过程组.控制过程组是核心管理过程组。\n\n3. 项目的特征是什么。\n\n   答：目标性.相关性.临时性.独特性.资源约束性.不确定性\n\n# 第二章\n\n## 一.填空题\n\n1. 项目立项之后，项目负责人会进行（自造-购买）决策，确定待开发产品的哪些部分应该采购.外包开发.自主研发等。\n2. PMI人才三角重点关注（技术项目管理）.（领导力）.（战略和商务管理）3个关键技能。\n3. 在（立项）阶段，应该明确项目的目标.时间表.使用的资源和经费，而且得到项目发起人的认可。\n\n## 二.判断题\n\n1. 项目立项可以确立项目目标.时间和资源成本，同时得到项目发起人的认可。（√）\n2. 项目招标对于一个项目的开发是必需的，即便项目是内部项目。（×）\n3. make or buy决策中的make指的只是自主开发。（√）\n4. 项目建议书是项目计划阶段开发的文档。（×）\n5. 项目立项需要获得项目经理的认可，但不需要项目发起人的认可。（×）\n6. 项目章程是项目执行组织高层批准的确认项目存在的文件，其中不包括对项目经理的授权。（×）\n7. 乙方即供方（有时也称卖方）是为顾客提供产品或服务的一方。（√）\n8. 在软件项目合同中，甲方是需求方，乙方是供方。（√）\n9. 敏捷项目采取的是仆人式管理方式（√）\n\n## 三.选择题\n\n1. 下列不是项目立项过程内容的是（B）\n   A. 项目的目标        \n   B. 项目的风险        \n   C. 项目的时间表       \n   D. 项目使用的资源和经费\n\n2. 以下哪项不包括在项目章程中？（C）\n   A. 对项目的确认    B. 对项目经理的授权    C. 对项目风险的分析    D. 项目目标的描述\n\n3. 项目建议书是（C）阶段开发的文档\n   A. 项目执行        B. 项目结尾        C. 项目初始        D. 项目计划\n\n4. 下列不属于甲方招投标阶段任务的是？（A）\n   A. 编写建议书        B. 招标书定义        C. 供方选择    D. 合同签署\n\n5. 下列不属于乙方招投标阶段任务的是？（D）\n   A. 项目分析        B. 竞标        C. 合同签署        D. 招标书定义\n\n6. PMI人才三角不包括（B）\n   A.技术项目管理\n   B.测试能力\n   C.领导力\n   D.战略和商务管理 \n\n## 四.问答题\n\n1. 某公司希望开发一套软件产品，如果选择自己开发软件的策略，公司需要花费30000元，根据历史信息，维护这个软件每个月需要3500元。如果选择购买软件公司产品的策略，需要18000元，同时软件公司为每个安装的软件进行维护的费用是4200元/月。该公司该如何决策？\n\n   答：自制方案：\n   制造费 30000元维护费 3500元/月\n   购买方案：\n   购买费 18000元维护费 4200元/月\n   制造差额：30000-18000=12000元\n   服务差额：4200-3500=700元\n   自制方案承受月份：12000/700=17. 14\n   如果产品在17个月以内可以选择购买方案，如果超过17个月选择自造方案。\n\n2. 什么是项目章程？\n\n   答：项目章程是项目执行组织高层批准的一份以书面签署的确认项目存在的文件，包括对项目的确认.对项目经理的授权和项目目标的概述等。\n\n# 第三章\n\n## 一.填空题\n\n1.（瀑布模型）生存期模型中，要求项目所有的活动都严格按照顺序进行，一个阶段的输入时下一个阶段的输入。\n\n2. 总体上，项目生存期模型可以是预测型或（适应型）\n3. DevOps是（Development）和（Operations）的组合\n\n## 二.判断题\n\n1. 瀑布模型不适合短期项目。（×）\n2. 增量式模型可以避免一次性投资太多带来的风险。（√）\n3. V模型适合的项目类型是需求很明确.解决方案很明确，而且对系统的性能要求比较严格的项目。（√）\n4. 瀑布模型和V模型都属于预测型生存期模型（√）\n5. 在瀑布生存期模型中，要求项目所有的活动都严格按照顺序执行，一个阶段的输出是下一个阶段的输入。（√）\n6. 极限编程从3个层面提供了13个敏捷实践（√）\n7. 敏捷包括《敏捷宣言》的价值观.12个原则，以及一些通用实践等（√）\n\n## 三.选择题\n\n1. 对于某项目，甲方提供了详细.准确的需求文档。我们的解决方案也很明确。且安全性要求非常严格。此项目采用（C）成存期模型比较合适。\n   A：瀑布模型    B：增量式模型    C：V模型    D：XP模型\n\n2. 下面属于预测型生存期模型的是（A）\n   A.瀑布模型    B.增量型生存期模型  C.Scrum模型  D.原型模型\n\n3. 下面关于敏捷模型描述不正确是（D）\n   A.与传统模型相比，敏捷模型属于自适应过程\n   B.可以应对需求的不断变化\n   C.Scrum模型.XP模型.DevOps模型等都属于敏捷模型\n   D.敏捷型是预测型和迭代型的混合模型\n\n4. XP模型的实践原则不包括以下哪一点？（D）\n   A：快速反馈    B：假设简单    C：包容变化    D：详细设计\n\n5. 在项目初期，一个项目需求不明确的情况下，应避免采用以下哪种生存期模型？（C）\n   A：快速原型模型    B：增量式模型    C：V模型    D：Scrum模型\n\n6. 关于迭代模型，下列说法不正确的是（D）\n   A.不断反馈原型  B.可以加快开发速度  C.项目需求变化大  D.不多次提交\n\n## 四.问答题\n\n1. 写出三种你熟悉的生存期模型，并说明这些模型适用于什么情况下的项目。\n\n   1. 瀑布模型\n      适用于软件需求很明确的软件项目，即一般适用于功能明确.完成.无重大变化的软件系统的开发，即：\n      1. 在项目开始前，项目的需求已经被很好的理解.也很明确，而且项目经理很熟悉为实现这一模型所需要的过程。\n      2. 解决方案在项目开始前也很明确。\n      3. 短期项目可采用瀑布模型。\n   2. V模型\n      适用于项目需求在项目开始前很明确.解决方案在项目开始前也很明确，项目对系统的安全很严格，如航天飞机控制系统.公司的财务系统等。\n   3. 快速原型模型\n      适用于项目的需求在项目开始前不明确，需要减少项目的不确定性的时候。\n\n2. 混合模型是什么模型？\n   把几种不同模型组合成一种混合模型，它允许一个项目能沿着最有效的路径发展，这就是过程开发模型（或混合模型）\n\n\n# 第四章\n\n## 一.填空题\n\n1. 需求管理包括（需求获取）.（需求分析）.（需求规格编写）.（需求验证）.（需求变更） 5个过程。\n2. 敏捷项目主要采用（用户故事）描述需求\n\n## 二.判断题\n\n1. 需求规格说明可以包括系统的运行环境。（√）\n2. 数据流分析方法是一种自下而上逐步求精的分析方法。（×）\n3. 需求分析工作完成的一个基本标志是形成了一份完整的.规范的需求规格说明书。（×）\n4. 需求是指用户对软件的功能和性能的要求，就是用户希望软件能做什么事，完成什么样的功能，达到什么性能。（√）\n5. 用户故事常常写在卡片上，然后将其部署在墙上（√）\n6. 软件项目系统的响应时间属于功能性需求（×）\n7. 数据字典是由数据项.数据流及操作指令组成的（×）\n\n## 三.选择题\n\n1. 下列不属于软件项目管理需求过程的是？（D）\n   A：需求获取    B：需求分析    C：需求规格编写    D：需求更新\n\n2. 下列不属于数据字典组成部分的是？（D）\n   A：数据项    B：数据流    C：数据文件    D：数据库\n\n3. 下列不属于UML需求视图的是？（A）\n   A：甘特图    B：用例图    C：状态图    D：顺序图\n\n4. 下列关于用户故事描述不正确的是（D）\n   A．英文称：user story\n   B．不使用技术语言来描述\n   C．可以描述敏捷需求\n   D．一种数据结构\n\n5. （A）是软件项目的的一个突出特点，可以导致软件项目的蔓延。\n   A：需求变更    B：暂时性    C：阶段性    C：约束性\n\n6. 下列不属于结构化方法设计的是？（D）\n   A：数据流图    B：数据字典    C：系统流程图    D：系统用例图\n\n7. 下列不属于软件需求范畴的是？（A）\n   A：软件项目采用什么样的实现技术\n   B：用户需要软件能做什么样的事情\n   C：用户需要软件完成什么样的功能\n   D：用户需要软件达到什么样的性能\n\n8. 敏捷项目需求一般采用下面（C）描述\n   A.用户用例  B.DFD  C.用户故事  D.数据字典\n\n## 四.问答题\n\n1. 下图是SPM项目需求规格文档中的一个用例图，请根据图中信息判断参与者是什么角色？并写出至少三个用例，如登录.注册等。\n\n   1)参与者是课务管理系统中的学生用户\n   2）登录.注册.选课\n\n# 第五章\n\n## 一.填空题\n\n1. 任务分解是将一个项目分解为更多的工作细目或者（子项目），是项目变得更小.更易管理.更易操作。\n\n2. WBS的全称是（任务分解结构Work Breakdown Structure）。\n\n3. WBS最底层次可交付成果是（工作包work package）。\n\n## 二．判断题\n\n1. WBS提供了项目范围基线。（√）\n2. 一个工作包可以分配给另一个项目经理去完成。（√）\n3. 如果开发人员对项目比较熟悉或者对项目大局有把握，开发WBS时最好采用自底向上方法。（×）\n4. 对于一个没有做过的项目，开发WBS时可以采用自底向上方法。（√）\n5. 在任务分解结果中，最底层的要素必须是实现项目目标的充分必要条件。（√）\n6. 一个工作包应当由唯一主题负责。（√）\n7. WBS的最高层次的可交付成果是工作包。（×）\n8. 对任务的分解只能是自上而下的。（×）\n9. WBS的最底层任务是能分配到一个人完成的任务。（√）\n10. 敏捷项目的一个Epic还可以继续分解为一些用户故事（√）\n\n## 三. 选择题\n\n1. WBS非常重要，因为下列原因，除了（D）\n   A. 帮助组织工作B. 防止遗漏工作C. 为项目估算提供依据D. 确定团队成员责任\n\n2. WBS中的每一个具体细目通常都指定唯一的（A）\n   A. 编码B. 地点C. 功能模块D. 提交截至期限\n\n3. 下列不是创建WBS的方法的是（C）\n   A. 自顶向下B. 自底向上C. 控制方法D. 模板参照\n\n4. 任务分解时，（D）方法从特殊到一般的方向进行，首先定义一些特殊的任务，然后将这些任务组织起来，形成更高级别的WBS层。\n   A. 模板参照B. 自顶向下C. 类比D. 自底向上\n\n5. 下列关于WBS的说法，不正确的是（D）\n   A. WBS是任务分解的结果\n   B. 不包括再WBS中的任务就不是该项目的工作\n   C. 可以采用清单或者图表的形式标石WBS的结果\n   D. 如果项目是一个崭新的项目，最好采用自顶向下方法开发WBS\n\n6. 检验WBS分解结果的标准不包括以下那一项？(B)\n   A. 最底层的要素是否是实现目标的充分必要条件\n   B. 分解的层次不少于3层\n   C. 最底层元素是否有重复\n   D. 最底层要素是否有清晰完整定义\n\n7. WBS是对项目由粗到细的分解过程，它的结构是（B）\n   A. 分层的集合结构  B. 分级的树形结构  C. 分层的线性结构  D. 分级的图状结构\n\n8. 任务分解时，（B）方法从一般到特殊的方向进行，从项目的大局着手，然后逐步分解子细目，将项目变为更细.更完善的部分。\n   A. 模板参照  B. 自顶向下  C. 类比  D. 自底向上\n\n## 四．问答题\n\n1. 试写出任务分解的方法和步骤。\n   答：任务分解的基本步骤：\n\n  2. 确认并分解项目的组成要素(WBS编号)。\n\n  3. 确定分解标准，按照项目实施管理的方法分解，而且分解的标准要统一。\n\n  4. 确认分解是否详细，是否可以作为费用和时间估计的标准，明确责任。\n\n  5. 确定项目交付成果（可以编制WBS字典）。\n\n  6. 验证分解正确性。验证分解正确后，建立一套编号系统。\n\n     任务分解方法：\n\n     1. 模板参照方法\n     2. 类比方法\n     3. 自上而下\n     4. 自下而上\n\n7. 当项目过于复杂是，可以对项目进行任务分解，这样做的好处是什么？\n   答：将一个项目分解为更多的工作细目或者子项目，使项目变得更小.更易管理.更易操作，这样可以提高估算成本.时间和资源的准确性，使工作变得更易操作，责任分工更加明确。\n\n# 第六章\n\n## 一.填空题\n\n1. 软件项目成本包括直接成本和间接成本，一般而言，项目人力成本归属于（直接）成本。\n2. 再在项目初期，一般采用的成本估算方法是（类比估算法）。\n3. 功能点方法中5类功能组件的计数项是（外部输入）.（外部输出）.（外部查询）.（内部逻辑文件）.（外部接口文件）。\n4. 敏捷项目一般采用（故事点）估算方法。\n5. （用例点）方法通过分析用例角色.场景和技术与环境因子等来进行软件估算。\n\n## 二．判断题\n\n1. 故事点估算是一个相对的估算过程。（√）\n2. 在软件项目估算中，估算结果是没有误差的。（×）\n3. 人的劳动消耗所付出的代价是软件产品的主要成本。（√）\n4. 功能点估算与项目所使用的语言和技术有关。（×）\n5. COCOMO81有3个等级的模型：有机型.嵌入型.半嵌入型。（×）\n6. 经验对于估算来说不重要。（×）\n7. 估算时既要考虑直接成本又要考虑间接成本。（√）\n8. 在进行软件估算的时候，可以直接考虑参照其他企业的模型进行项目估算。（×）\n9. 间接成本是与一个具体项目相关的成本。（×）\n\n## 三．选择题\n\n1. 三点估算法选择的3种估算值不包括（D）\n   A．最可能成本  B. 最乐观成本  C. 最悲观成本  D. 项目经理估算值\n\n2. 下面关于估算的说法，错误的是（C）\n   A. 估算是有误差的\n   B. 估算时不要太迷信数学模型\n   C. 经验对于估算来说不重要\n   D. 历史数据对于估算来说非常重要\n\n3. 假设某项目的注册功能为3个故事点，而其中成绩录入工作量比注册功能工作量略多，如果采用Fibonacci 等级标准估算，则成绩录入功能的估算值的（A）\n   A．5个故事点  B. 4个故事点  C. 6个故事点  D. 7个故事点\n\n4. （B）是成本的主要因素，是成本估算的基础。\n   A. 计划B. 规模C. 风险D. 利润\n\n5. 常见的成本估算方法不包括（D）\n   A. 代码行B. 功能点C. 类比法D. 关键路径法\n\n6. 下列不是UFC的功能计数项是（C）\n   A. 外部输出B. 外部文件C. 内部输出D. 内部文件\n\n7. 成本预算的目的是（A）\n   A. 生产成本基线B. 编写报告书C. 指导设计过程D. 方便进度管理\n\n8. 下列不是软件项目规模单位的是（D）\n   A. 源代码长度（LOC）B. 功能点（FP）C. 人天.人月.人年D. 小时\n\n9. 在成本管理过程中，每个时间段中等各个工作单元的成本是（B）\n   A. 估算B. 预算C. 直接成本D. 间接成本\n\n## 四．计算题\n\n1. 项目经理正在进行一个图书馆信息查询系统的项目估算，他采用Delphi的专家估算方法，邀请了3位专家进行估算，第一位专家给出了2万元.7万元.12万元的估算值，第二位专家给出了4万元.6万元.8万元的估算值，第三位专家给出了2万元.6万元.10万元的估算值，试计算这个项目的成本估算值。\n\n   答：专家一：Ei=(ai+4mi+bi)/6=（2+4*7+12）/6=7\n   专家二：Ei=(ai+4mi+bi)/6=（4+4*6+8）/6=6\n   专家三：Ei=(ai+4mi+bi)/6=（2+4*6+10）/6=6\n   Ei=（7+6+6）/3=6. 33（万元）\n\n2. 如果某软件公司正在进行一个项目，预计有50KLOC的代码量，项目是中等规模的半嵌入型的项目，采用中等COCOMO模型，项目属性中只有可靠性为很高级别（即取值为1. 3），其他属性为正常（书上说，正常就是1），计算项目是多少人月的规模，如果是2万元/人月，则项目的费用是多少？\n\n   答：Effort=a*（KLOC）b*F\n   查表a=3，b=1. 12，F=1\n   Effort=3. 0*501. 12*1. 3*1=311. 82（人月）\n   所以项目的费用为2* Effort=623. 64万元\n\n3. 已知某项目使用C语言完成，该项目共有85个功能点，请用IBM模型估算源代码行数.工作量.项目持续时间.人员需要量以及文档数量。\n\n   答：C语言代码行与功能点的关系近似为150LOC/FP，所以，85个功能点代码行数为L85*150=12750行=1. 75KLOC,则:工作量估算E=5. 2*L0. 91=5. 2*12. 750. 91≈52. 725（人月）\n   项目时间  D=4. 1*L0. 36=4. 1*12. 750. 36≈10. 25（月）\n   人员需求量S=0. 54*E0. 6=0. 54*52. 7250. 6≈5. 829（人）\n   文档数量  DOC=49*L1. 01=49*12. 751. 01≈640. 857（页）\n\n# 第七章\n\n## 一.填空题\n\n1.  （关键路径）决定了项目在给定的金钱关系和资源条件下完成项目所需的最短时间。\n2.  （时间）是一种特殊的资源，以其单向性.不可重复性.不可替代性而有别于其他资源。\n3.  在ADM网络图中，箭线表示（活动/任务）。\n4.  （应急法）和（平行作业法）都是时间压缩法。\n5.  工程评估评审技术采用加权平均的公式是（PERT历时=(O+P+4M)/6），其中O是乐观值，P是悲观值，M是最可能值。\n\n## 二.判断题\n\n1.  一个工作也可以通过多个活动完成。（√）\n2.  在项目进行过程中，关键路径是不变的。（×）\n3.  在PDM网络图中，箭线表示的是任务之间的逻辑关系，节点表示的是活动。（√）\n4.  项目各项活动之间不存在相互联系与相互依赖关系。（×）\n5.  在资源冲突问题中，过度分配也属于资源冲突。（√）\n6.  浮动是在不增加项目成本的条件下，一个活动可以延迟的时间量。（×）\n7.  在使用应急法压缩时间时，不一定要在关键路径上选择活动来进行压缩。（×）\n8.  时间是项目规划中灵活性最小的因素。（√）\n9.  外部依赖关系又称强制性依赖关系，指的是项目活动与非项目互动之间的依赖关系。（×）\n10.  当估算某活动时间，存在很大不确定性时应采用CPM估计。（×）\n11.  敏捷项目一般采用远粗近细的计划模式，敏捷的发布计划相当于远期计划，迭代计划相当于近期计划（**√**）\n\n## 三.  选择题\n\n1.  下面说法中不正确的是（D）\n    A．EF=ES+duration            B.   LS=LF-duration\n    C．TF=LS-ES=LF-EF            D.   EF=ES+lag\n\n2.  “软件编码完成之后，我才可以对它进行软件测试”，这句话说明了哪种依赖关系？（A）\n    A．强制性依赖关系        B. 软逻辑关系        C. 外部依赖关系        D. 里程碑\n\n3.  （A）可以显示任务的基本信息，使用该类图能方便的查看任务的工期.开始时间.结束时间以及资源的信息。\n    A．甘特图        B. 网络图            C. 里程碑图        D.  资源图\n\n4.  （C）是项目冲突的主要原因，尤其在项目后期。\n    A．优先级问题        B. 人力问题            C. 进度问题        D.  费用问题\n\n5.  以下哪一项是项目计划中灵活性最小的因素？（A）\n    A．时间        B. 人工成本            C. 管理        D.  开发\n\n6.  以下哪一项不是任务之间的关系？（D）\n    A．结束-开始        B. 开始-开始            C. 结束-结束        D.  结束-开始-结束\n\n7.  快速跟进是指（A）\n    A．采用并行执行任务，加速项目进展        B.  用一个任务取代另外的任务\n    C.   如有可能，减少任务数量                D.  减轻项目风险\n\n8.  下面哪一项将延长项目的进度？（A）\n    A．lag        B. lead            C. 赶工        D. 快速跟进\n\n9.  下面哪一项可以决定进度的灵活性？（B）\n    A．PERT        B. 总浮动            C. ADM        D.  赶工\n\n10.  （B）可以表示敏捷项目的进度，并且可以表示出剩余的任务\n     A．燃起图  B. 燃尽图  C. 里程碑图  D. 网络图\n\n## 四.  问答题\n\n1. 对一个任务进行进度估算时，A是乐观者，估计用6天完成，B是悲观者，估计用24天完成，C是有经验者，认为最有可能用12天完成，那么这个任务的历时估算介于10天到16天的概率是多少？\n   解：E=(6+24+4*12)/6=13，    δ=(24-6)/6=3\n   E-δ=10\n   E+δ=16\n   所以任务历时估算介于10——16天的概率为：68. 3%\n\n2. 请将下图所示的PDM（优先图法）网络图改画为ADM（箭线法）网络图。\n   ![图1](https://s2.loli.net/2022/05/19/DCbfLWBo8kty72c.png)\n\n   解：上图对应的ADM图如下所示：\n   ![图2](https://s2.loli.net/2022/05/19/BMGUmrgbZLcXoES.png)\n\n3. 根据下面任务流程图和下表给出的项目历时估算值，采用PERT方法估算，求出项目在14. 57天内完成的概率的近似值。\n   ![图3](https://s2.loli.net/2022/05/19/p5N8YHGUjrJWzkf.png)\n\n  解：E1=(2+6+4*3)/6=20/6，E2=(4+8+4*6)/6=6，E3=(3+6+4*4)/6=25/6\n  任务方差.标准差分别为：\n   ![图4](https://s2.loli.net/2022/05/19/upYlxsv8ImEM15z.png)\n  所以，E= E1+ E2+ E3=13. 5天，δ=1. 07\n  E-δ=12. 43，E+δ=14. 57            [12. 43，14. 57]的概率为：68. 3%\n  E-2δ=11. 36，E+2δ=15. 64            [11. 36，15. 64]的概率为：95. 5%\n  E-3δ=10. 29，E+3δ=16. 71            [10. 29，16. 71]的概率为：99. 7%\n  所以，项目在14. 57天内完成的概率为：50%+68. 3%/2=84. 15%\n\n# 第八章\n\n## 一.填空题\n\n1. （审计）是对过程或产品的一次独立质量评估。\n2. 质量成本包括预防成本和（缺陷成本）。\n3. （软件质量）是软件满足明确说明或者隐含的需求的程度。\n4. McCall质量模型关注的3个方面是（产品运行）.（产品转移）.（产品修改）。\n5. 质量管理总是围绕着质量保证和（质量控制）过程两个方面进行。\n6. 质量保证的主要活动是（项目执行过程审计）和（项目产品审计）。\n\n## 二.判断题\n\n1. 质量是满足要求的程度，包括符合规定的要求和客户隐含的需求。（√）\n2. 软件质量是软件满足明确说明或者隐含的需求的程度。（√）\n3. 软件质量可以通过后期测试得以提高。（×）\n4. 质量计划可以确定质量保证人员的特殊汇报渠道。（√）\n5. 软件质量是代码正确的程度。（×）\n6. 敏捷项目要求全程的质量审查（×）\n\n## 三.选择题\n\n1. 下列不属于质量管理过程的是（D）\n   A 质量计划 B 质量保证 C 质量控制 D 质量优化\n\n2. 项目质量管理的目标是满足（C）的需要\n   A 老板 B 项目经理 C 项目 D 组织\n\n3. 下列属于质量成本的是（A）\n   A 预防成本 B 缺陷数量 C 预测成本 D 缺失成本\n\n4. 下列不是质量计划方法的是（C）\n   A 质量成本分析 B 因果分析图 C 抽样分析 D 基准对照\n\n5. 下列不是软件质量模型的是（D）\n   A Boehm质量模型 B McCall 质量模型 C ISO/IEC 9216质量模型 D Mark质量模型\n\n6. 质量控制非常重要，但是进行质量控制也需要一定的成本，（B）可以降低质量控制的成本。\n   A 进行过程分析 B 使用抽样统计 C 对全程进行监督 D 进行质量审计\n\n7. McCall 质量模型不包含（C）\n   A 产品修改 B 产品转移 C 产品特点 D 产品运行\n\n8. 下面（D）不是敏捷项目的质量实践\n   A. 结对编程  B. TDD  C. 迭代评审  D. 需求规格编写过程审计\n\n## 四.问答题\n\n1. 简述质量保证的主要活动，以及质量保证的要点。\n   答：质量保证的主要活动是项目执行过程审计和项目产品审计。\n   质量保证的要点是：对项目进行评价.推测能否达到质量指标.建立对项目的信心\n\n2. 简述质量保证与质量控制的关系。\n   答：质量保证（QA）是通过评价项目整体绩效,建立对质量要求的信任，提供项目和产品可视化的管理报告。这个任务本身并不能提高产品的质量，但是通过质量保证的一系列工作可以间接地提高产品的质量。质量保证一般由质量保证部门人员实施。\n\n   质量控制（QC）是确定项目结果与质量标准是否相符,同时,确定消除不符的原因和方法，它控制产品的质量，及时纠正缺陷。这个任务本身提高产品的质量，一般由开发人员实施。\n\n   质量保证是后期质量活动，质量控制是前期质量活动。它们是有区别的:质质量保证是针对项目实施过程的管理手段，质量控制是针对项目产品的技术手段;实施质量保证是针对过程改进和审计的，强调的是过程改进和信心保证。实施质量控制是按照质量要求，检查具体可交付成果的质量，强调的是具体的可交付成果。\n\n# 第九章\n\n## 一.填空题\n\n1. （完整性和可跟踪性）是软件配置管理的核心功能。\n2. （基线）标志开发过程中一个阶段的结束和里程碑。\n3. 基线变更控制包括（变更请求）.（变更控制）.（变更批准/拒绝）.（变更实现）等步骤。\n4. （版本管理）.（变更管理）是配置管理的主要功能。\n5. 基线变更时，需要经过（SCCB）授权。\n6. SCCB的全称是（软件配置控制委员会）。\n\n## 二. 判断题\n\n1. 一个软件配置项可能有多个标识。（×）\n2. 基线提供了软件开发阶段的一个特定点。（×）\n3. 有效的项目管理能够控制变化，以最有效的手段应对变化，不断命中移动的目标。（√）\n4. 一个（些）配置项形成并通过审核，即形成基线。（√）\n5. 软件配置项是项目需定义其受控于软件配置管理的款项，每个项目的配置项是相同的。（×）\n6. 基线的修改不需要每次都按照正式的程序执行。（×）\n7. 基线产品是不能修改的。（×）\n8. 基线修改应受到控制，但不一定要经SCCB授权。（×）\n9. 变更控制系统包括从项目变更申请.变更评估.变更审批到变更实施的文档化流程。（√）\n10. 持续支付领域强调对项目所有的相关产物及其之间的关系都要进行有效配置管理（对）\n11. 持续支付更倾向于使用基于分支的开发模式（错）\n\n## 三. 选择题\n\n1. 下列不属于SCCB的职责的是（D）\n   A 评估变更 B 与项目管理层沟通 C 对变更进行反馈 D 提出变更申请\n\n2. 为了更好地管理变更，需要定义项目基线，关于基线的描述，下列描述正确的是（B）\n   A 不可变化\n   B 可以变化，但是必须通过基线变更控制流程处理\n   C 所以的项目必须定义基线\n   D 基线发生变更时，必须修改需求\n\n3. 软件配置管理无法确保以下哪种软件产品属性（A）\n   A 正确性 B 完整性 C 一致性 D 可控性\n\n4. 变更控制需要关注的是（B）\n   A 阻止变更    B 标识变更，提出变更，管理变更\n   C 管理SCCB    D 客户的想法\n5. 以下哪项不是项目配置管理中可能遇到的问题？（B）\n   A 找不到某个文件的历史版本\n   B 甲方与乙方在资金调配上存在意见差异\n   C 开发人员未经授权修改代码或文档\n   D 因协同开发中，或者异地开发，版本变更混乱导致整个项目失败\n6. 以下哪项不属于软件项目配置管理的问题（B）\n   A. 找不到某个文件的历史版本\n   B. 甲方和乙方在资金调配上存在意见差异\n   C. 开发人员未经授权修改代码或文档\n   D. 因协同开发中，或者异地开发，版本变更混乱导致整个项目失败\n\n## 四.简答题\n\n1. 写出配置管理的基本过程。\n   答：（1）配置项标识.跟踪；（2）配置管理环境建立；（3）基线变更管理；（4）配置管理审计；（5）配置状态统计；（6）配置管理计划。\n\n2. 说明软件配置控制委员会（SCCB）的基本职责。\n   答：评估变更.批准变更申请.在生存期内规范变更申请流程.对变更进行反馈.与项目管理层沟通。\n\n3. 写出几个常见的软件配置项。\n   答：软件项目计划.需求分析结果.软件需求规格说明书.设计规格说明书.源代码清单.厕所规格说明书.测试计划.测试用例与实验结果.可执行程序.用户手册.维护文档。\n\n# 第十章\n\n## 一.填空\n\n1. 可以充分发挥部门资源优势集中的组织结构为（职能型组织结构）\n2. 组织结构的主要类型（职能型）.（项目型）.（矩阵型）\n3. （会议形式）沟通最有可能协助解决复杂的问题。\n4. 当项目中有20个人时，沟通渠道最多有（190）。\n\n## 二.判断\n\n1. 项目干系人是项目计划的一部分。（√）\n2. 项目型的优点是可以资源共享。（×）\n3. 应尽量多建立一些沟通渠道。(×)\n4. 项目沟通的基本原则是及时性.准确性.完整性和可理解性(√)\n5. 在IT项目中，成功的最大威胁是沟通的失败(√)\n6. 责任分配矩阵是明确项目团队成员的角色与职责的有效工具(√)\n7. 口头沟通不是项目沟通的方式(×)\n8. 对于紧急的信息，应该通过口头的方式沟通；对于重要的信息，应采用书面的方式沟通(√)\n9. 沟通计划包括确定谁需要信息，需要什么信息，何时需要信息，以及如何接收信息等(√)\n10. 敏捷团队的人员一般在3~9人，而且一般集中地在一个场地开发，可以围坐一个桌子开会（√）\n\n## 三.选择\n\n1. （A）以图形方式展示项目团队成员及其报告关系这样可以减少沟通渠道，减少成本\n   A.项目组织图  B.甘特图  C.网络图  D.RAM图\n\n2. 下面不是敏捷角色的是（D）\n   A.产品负责人  B.团队促进者  C.跨职能团队成员  D.合同管理者\n\n3. 在项目管理的3种组织结构中，适用于主要由一个部门完成的项目或技术比较成熟的项目组织结构是( C)\n   A矩阵型组织结构  B项目型组织结构  C职能型组织结构  D都一样\n\n4. 项目经理花在沟通上的时间是(B)\n   A.20%-40%  B.75%-90%  C.60%  D. 30%-60%\n\n5. 在（C）组织结构中，项目成员没有安全感\n   A职能型B矩阵型C项目型D弱矩阵型\n\n6. 下列关于干系人的描述中，不正确的是（D）\n   A影响项目决策的个人.群体或者组织\n   B影响项目活动的个人.群体或者组织\n   C影响项目结果的个人.群体或者组织\n   D所有项目人员\n\n7. 编制沟通计划的基础是( A)\n   A沟通需求分析B项目范围说明书C项目管理计划D历史资料\n\n8. 项目团队原来有5个成员，现在人员扩充，又增加了3个成员这样沟通渠道增加了（A）\n   A.2. 8倍  B.两倍  C.4倍  D.1. 6倍\n\n9. 对于项目中比较重要的通知，最好采用（B）沟通方式\n   A口头B书面C网络方式D电话\n\n10. 在一个高科技公司，项目经理正在为一个新的项目选择合适的组织结构，这个项目涉及多的领域和特性，他应该选择（A）组织结构\n    A矩阵型B项目型C职能型D组织型\n\n## 三.简答题\n\n1. 写出5种以上项目沟通方式  P217\n   沟通方式主要有书面沟通和口头沟通.语言沟通和非语言沟通.正式沟通和非正式沟通.单向沟通和双向沟通.网络沟通等\n\n2. 对于特别重要的内容，你认为一般采用哪些方式才能确保有效沟通  P220\n   对于特别重要的内容，要采用多种方式进行有效沟通确保传达到位，除发送邮件外还要电话提醒.回执等，重要的内容还要通过举行各种会议进行传达\n\n# 第十一章\n\n## 一.填空题\n\n1. 风险评估的方法包括（定性）和定量风险分析。\n2. 决策树分析是一种（形象化的图表分析）方法。\n3. 项目风险的三要素是（风险事件）.（风险事件发生的概率）.（风险造成的影响）。\n4. （回避）风险是指尽可能地规避可能发生的风险，采取主动放弃或者拒绝使用导致风险的方案。\n5. 定量风险评估主要包括（访谈）.（盈亏平衡分析）.（决策树分析）.（模拟法）.（敏感性分析）等方法。\n\n## 二.判断题\n\n1. 任何项目都是有风险的。（√）\n2. 风险是损失发生的不确定性，是对潜在的.未来可能发生损害的一种度量。（×）\n3. 风险识别.风险评估.风险规划.风险控制是风险管理的4个过程。（√）\n4. 应对风险的常见策略是回避风险.转移风险.损失控制和自留风险。（√）\n5. 项目的风险几乎一样。（×）\n6. 购买保险是一种回避风险的应对策略（×）\n7. 敏捷项目没有长期计划，这本身也是一个风险，因为存在一些无法识别的风险。（错）\n\n## 三.选择题\n\n1. 下列不属于项目风险的三要素的是（B）。\n   A. 一个事件  B. 事件的产生原因  C. 事件发生的概率  D. 事件的影响\n\n2. 下列属于可预测风险的是（C）。\n   A. 不现实的交付时间  B. 没有需求或软件范围的文档  C. 人员调整  D. 恶略的开发环境\n\n3. 下列不是风险管理过程的是（D）\n   A. 风险评估  B. 风险识别  C. 风险规划  D. 风险收集\n\n4. 下列说法错误的是（D）。\n   A. 项目风险的3个要素是一个事件.事件发生的概率.事件的影响\n   B. 风险规划的4个过程是风险识别.风险评估.风险规划.风险控制\n   C. 风险规划的主要策略是回避风险.转移风险.损失控制.自留风险\n   D. 项目风险是由风险发生的可能性决定的\n\n5. 在一个项目的开发过程中采用了新的技术，为此，项目经理找来专家对项目组人员进行技术培训，这是什么风险应对策略？（B）。\n   A. 回避风险  B. 损失控制  C. 转移风险  D. 自留风险\n\n6. 下列不属于风险评估方法的是（D）。\n   A. 盈亏平衡分析  B. 模拟法  C. 决策树分析  D. 二叉树分析\n\n## 四.问答题\n\n1. 一个项目在进行规划的时候，碰到了一个风险问题，项目经理决定是否采用方案A。如果采用方法A需要使用一个新的开发工具，而能够掌握这个工具的概率是30%，通过使用这个工具可以获利5万元，如果采用方案A而不能掌握这个工具，将损失1万元。利用决策树分析技术说明这个项目经理是否应该采用这个方案A？（绘制决策树）\n   ![图5](https://s2.loli.net/2022/05/19/9B4UyQDG6w3PEH2.png)\n\n   通过上面分析可知，应该采用方案A。\n\n2. 某企业在今年有甲乙两种产品方案可以选择，每种方案的状态.收益和概率如表11-11所示，绘制决策树时，判断哪种方案将有更大收益。\n   ![图6](https://s2.loli.net/2022/05/19/kxue7swPEmJnczO.png)\n\n   ![图7](https://s2.loli.net/2022/05/19/gW7q8kjcbeHoNKl.png)\n\n   ![图8](https://s2.loli.net/2022/05/19/YJFtgXCHkG1QsL9.png)\n\n# 第十二章\n\n## 一. 填空\n\n1.  为执行项目而从项目团队外获取产品.服务或者成果的过程称为：（采购）\n2.  合同双方当事人承担不同角色，这些角色包括：（甲方）.（乙方）\n3.  一个CPFF合同类型，估计成本是10万元，固定费用是成本1. 5万元，当成本提高至20万元是，合同金额为：（21. 5万元）\n\n## 二. 判断\n\n1.  软件项目外包的实质是软件开发过程从公司内部部分或者全部延伸到公司外部的过程（×）\n2.  对于甲方来说，风险最高的是CPCC合同类型，风险最低的是FFP合同类型，乙方则相反（√）\n3.  如果一个项目的合同类型是固定价格（FFP），合同价格是100万元，实际花费是160万元，则项目结算金额为160万元（×）\n4.  成本加激励费用（CPIF）合同居有激励机制（√）\n5.  《敏捷宣言》认为“客户协作高于合同协商”（√）\n\n## 三. 选择\n\n1. 下列合同类型中，卖方承担的风险最大的是（D）\n   A. 成本加成本百分比  B. 成本加固定费  C. 成本加奖金  D.  固定价格\n2. 某项目采用成本加奖金的成本补偿类合同，当预算成本为20万元，利润4万元，且奖励分配为80/20时，如果实际成本降至16万元，则项目总价为（C）。\n   A. 24万元  B. 23. 2万元  C. 20. 8万元  D. 20万元\n3. 合同是需要靠（D）约束的。\n   A. 双方达成的共识  B. 道德  C. 责任  D. 相关法律法规\n4. 下面哪项不是敏捷项目设计的动态特性的合同签署技术（D ）\n   A. 多层结构  B. 总结增量  C. 动态范围方案  D. 固定价格\n', '项目管理期末复习');
